(107, 1, 0, 'Việc giám sát thi công xây dựng công trình phải đảm bảo các yêu cầu sau ?', 'Thực hiện trong suốt quá trình thi công từ khi khởi công xây dựng, trong thời gian thực hiện cho đến khi hoàn thành và nghiệm thu công việc, công trình xây dựng', 'Giám sát thi công công trình đúng với thiết kế xây dựng được phê duyệt, tiêu chuẩn áp dụng, quy chuẩn kỹ thuật, quy định về quản lý, sử dụng vật liệu xây dựng, chỉ dẫn kỹ thuật và hợp đồng xây dựng', 'Trung thực khách quan, không vụ lợi', 'Tất cả các yêu cầu trên', 4, '2021-04-06 06:35:55', '2021-04-06 06:35:55'),
