(295, 2, 1, 'Nhằm đảm bảo sự chuyển tiếp êm thuận, không gây ra “xóc” mạnh cho xe chạy qua đoạn chuyển tiếp thì độ bằng phẳng theo dọc tim đường S (S là độ dốc dọc giữa hai điểm trên mặt đường theo phương dọc theo tim đường do sự chênh lệch lún của hai điểm đó) giữa đường và cầu đối với đường cao tốc có vận tốc thiết kế 100 và 120 km/h là bao nhiêu trong các giá trị sau ?', 'Độ bằng phẳng S ≤ 1/150', 'Độ bằng phẳng S ≤ 1/175', 'Độ bằng phẳng S ≤ 1/200', 'Độ bằng phẳng S ≤ 1/250', 4, '2022-03-28 06:14:13', '2022-03-28 06:14:13'),
