(297, 2, 1, 'Khi xác định lưu lượng xe tính toán để xác định Eyc mặt đường phải xét đến hệ số ảnh hưởng của số làn xe. Trong trường hợp đường có 4 làn xe có dải phân cách giữa thì hệ số phân phối trục xe f chọn là bao nhiêu ?', 'Hệ số f = 1', 'Hệ số f = 0,55', 'Hệ số f= 0,35', 'Hệ số f = 0,3', 3, '2022-03-28 06:14:54', '2022-03-28 06:14:54'),
