(300, 2, 1, 'Độ bằng phẳng của mặt đường có thể dùng thước 3 mét để kiểm trĐối với mặt đường cấp cao A1 (bê tông nhựa, bê tông xi năng) thì quy định nào đúng trong các phương án sau:', '70% số khe hở dưới 3mm và 30% số khe hở phải dưới 5 mm.', '20% số khe hở dưới 3mm và 80% số khe hở phải dưới 5 mm.', '30% số khe hở dưới 3mm và 70% số khe hở phải dưới 5 mm', '40% số khe hở dưới 3mm và 60% số khe hở phải dưới 5 mm', 1, '2022-03-28 06:16:26', '2022-03-28 06:16:26'),
(301, 2, 1, 'Trong tiêu chuẩn thiết kế đường quy định cao độ thiết kế nền đường. Quy định nào trong 4 trường hợp sau đây là đúng và đủ?', 'Cao độ thiết kế của nền đường là cao độ ở tim đường.', 'Cao độ thiết kế của nền đường là cao độ ở tim đường. Khi có hai nền đường độc lập sẽ có hai cao độ thiết kế trên hai mặt cắt dọc riêng biệt.', 'Cao độ thiết kế của nền đường là cao độ vai đường', 'Cao độ thiết kế của nền đường là cao độ mép mặt đường', 2, '2022-03-28 06:16:47', '2022-03-28 06:16:47'),
