(303, 2, 1, 'Độ bằng phẳng của mặt đường có thể dùng thước 3 mét để kiểm tra. Đối với mặt đường cấp cao A2 (bê tông nhựa nguội, trên có láng mặt, thấm nhập nhựa, láng nhựa) thì quy định nào đúng trong các phương án sau:', 'Tất cả phải dưới 5 mm.', '20% số khe hở dưới 3mm và 80% số khe hở phải dưới 5 mm.', '30% số khe hở dưới 3mm và 70% số khe hở phải dưới 5 mm', '40% số khe hở dưới 3mm và 60% số khe hở phải dưới 5 mm', 1, '2022-03-28 06:17:24', '2022-04-15 22:37:44'),
(304, 2, 1, 'Cường độ kết cấu áo đường mềm được đặc trưng bởi giá trị nào trong các phương án sau?', 'Mô đun đàn hồi của các lớp mặt đường.', 'Mô đun đàn hồi của các lớp móng đường.', 'Mô đun đàn hồi của lớp nền đất dưới kết cấu áo đường.', 'Mô đun đàn hồi chung của các lớp trong kết cấu áo đường + nền đất', 4, '2022-03-28 06:20:05', '2022-03-28 06:20:05'),
(305, 2, 1, 'Khi thiết kế đường cao tốc ở vùng địa hình núi, đồi cao và vùng địa hình khó khăn người ta quy định chọn vận tốc hợp lý để giảm kinh phí xây dựng. Trong các phương án sau chọn phương án nào là hợp lý.', 'Tốc độ thiết kế 100 - 120 km/h', 'Tốc độ thiết kế 80 - 100 km/h', 'Tốc độ thiết kế 60 - 80 km/h', 'Tốc độ thiết kế 50 - 60 km/h', 3, '2022-03-28 06:20:36', '2022-03-28 06:20:36'),
