(309, 2, 1, 'Trên các tuyến đường có bố trí các tuyến xe buýt, để đảm bảo an toàn tiêu chuẩn thiết kế quy định có thể sử dụng loại chỗ dừng đơn giản hoặc chỗ dừng cách ly. Với các phương án sau, phương án nào đúng?', 'Trên đường Vtk ≥40 km/h, nhất thiết phải thiết kế chỗ dừng cách ly.', 'Trên đường Vtk ≥60 km/h, nhất thiết phải thiết kế chỗ dừng cách ly.', 'Trên đường Vtk ≥80 km/h, nhất thiết phải thiết kế chỗ dừng cách ly', 'Trên đường Vtk ≥100 km/h, nhất thiết phải thiết kế chỗ dừng cách ly', 3, '2022-03-28 06:48:07', '2022-03-28 06:48:07'),
