(319, 2, 1, 'Khi đắp nền đường trên đất yếu phải sử dụng lớp đệm cát để thoát nước ngang. Trong các trường hợp sau trường hợp nào phải dùng tầng đệm cát:', 'Trường hợp đắp trực tiếp trên đất yếu', 'Trường hợp đào một phần hay toàn bộ tầng đất yếu', 'Sử dụng giếng cát hay bấc thấm thoát nước thẳng đứng', 'Tất cả 3 trường hợp trên', 4, '2022-03-28 06:50:56', '2022-03-28 06:50:56'),
(320, 2, 1, 'Trong tiêu chuẩn thiết kế đường ô tô TCVN 4054 - 2005 ngoài đường ô tô cao tốc, có các phương án phân loại dưới đây. Phương án nào đúng.', 'Đường có 6 cấp, từ cấp I tới cấp VI', 'Đường có 5 cấp, từ cấp I tới cấp V', 'Đường có 4 cấp, từ cấp I tới cấp IV', 'Đường có 3 cấp, từ cấp I tới cấp III', 1, '2022-03-28 06:51:12', '2022-03-28 06:51:12'),
(321, 2, 1, 'Theo tiêu chuẩn thiết kế đường giao thông nông thôn TCVN 0380: 2014 đường giao thông nông thôn có mấy cấp? chọn phương án đúng?', 'Có 1 cấp A', 'Có 2 cấp A, B', 'Có 3 cấp A, B, C', 'Có 4 cấp A, B, C, D', 4, '2022-03-28 06:51:28', '2022-03-28 06:51:28'),
(322, 2, 1, 'Tốc độ thiết kế của đường được hiểu thế nào?', 'Tốc độ lớn nhất cho phép xe chạy trên đường', 'Tốc độ khai thác của đường', 'Là tốc độ được dùng để tính toán các chỉ tiêu kỹ thuật chủ yếu của đường trong trường hợp khó khăn', 'Tốc độ trung bình xe chạy trên đường', 3, '2022-03-28 06:51:43', '2022-03-28 06:51:43'),
(323, 2, 1, 'Chiều rộng một làn xe trong tiêu chuẩn thiết kế đường TCVN 4054 - 2005 có mấy loại kích thước? Phương án nào đúng và đủ?', 'Có các chiều rộng 3,75 m, 3,5 mét, 3,0 m và 2,75 m.', 'Có các chiều rộng 3,75 m, 3,5 mét và 3,0 m.', 'Có các chiều rộng 3,75 m, 3,5 m.', 'Chỉ có chiều rộng 3,5 m.', 1, '2022-03-28 06:52:04', '2022-03-28 06:52:04'),
(324, 2, 1, 'Trong tiêu chuẩn thiết kế yếu tố hình học của đường quy định mấy loại bán kính đường cong nằm tối thiểu? phương án nào đúng và đủ.', 'Bán kính đường cong nằm tối thiểu giới hạn', 'Bán kính đường đường cong tối thiểu giới hạn, tối thiểu thông thường', 'Bán kính đường cong tối thiểu giới hạn, tối thiểu không siêu cao', 'Bán kính tối thiểu giới hạn, tối thiểu thông thường và tối thiểu không siêu cao', 4, '2022-03-28 06:52:21', '2022-03-28 06:52:21'),
(325, 2, 1, 'Trong tiêu chuẩn thiết kế yếu tố hình học của đường quy định trong trường hợp nào phải bố trí đường cong chuyển tiếp.', 'Khi vận tốc thiết kế Vtk ≥ 30 km/h', 'Khi vận tốc thiết kế Vtk ≥ 40 km/h', 'Khi vận tốc thiết kế Vtk ≥ 60 km/h', 'Khi vận tốc thiết kế Vtk ≥ 80 km/h', 3, '2022-03-28 06:52:39', '2022-03-28 06:52:39'),
(326, 2, 1, 'Trong thiết kế đường việc phối hợp giữa các yếu tố tuyến nhằm mục đích gì', 'Tạo tầm nhìn tốt, cung cấp thông tin cho người lái xe để kịp thời xử trí các tình huống.', 'Tạo tâm lý thoải mái cho người lái, ít mệt nhọc, năng suất cao.', 'Tạo cho công trình phù hợp với cảnh quan, góp phần nâng cao vẻ đẹp khu vực đặt tuyến.', 'Để đạt tất cả mục đích nêu trên', 4, '2022-03-28 06:52:54', '2022-03-28 06:52:54'),
(327, 2, 1, 'Trong tiêu chuẩn thiết kế đường quy định độ dốc dọc lớn nhất tùy thuộc vào cấp hạng đường và điều kiện địa hình. Trường hợp đường cấp I đồng bằng thì độ dốc dọc lớn nhất là bao nhiêu?', 'Độ dốc dọc lớn nhất 3%', 'Độ dốc dọc lớn nhất 4%', 'Độ dốc dọc lớn nhất 5%', 'Độ dốc dọc lớn nhất 6%', 1, '2022-03-28 06:53:10', '2022-03-28 06:53:10'),
(328, 2, 1, 'Trong tiêu chuẩn thiết kế đường quy định độ dốc dọc lớn nhất tùy thuộc vào cấp hạng đường và điều kiện địa hình. Trường hợp đường cấp III, miền núi thì độ dốc dọc lớn nhất là bao nhiêu?', 'Độ dốc dọc lớn nhất 4%', 'Độ dốc dọc lớn nhất 5%', 'Độ dốc dọc lớn nhất 6%', 'Độ dốc dọc lớn nhất 7%', 4, '2022-03-28 06:53:25', '2022-03-28 06:53:25'),
(329, 2, 1, 'Quy định về hệ số đầm chặt đất nền đường phụ thuộc vào các yếu tố nào?', 'Phụ thuộc vào nền đường đào, đắp', 'Phụ thuộc vào cấp hạng kỹ thuật của đường', 'Phụ thuộc vào chiều sâu từ đáy áo đường xuống', 'Phụ thuộc vào cả 3 yếu tố trên', 4, '2022-03-28 06:53:40', '2022-03-28 06:53:40'),
(330, 2, 1, 'Trong tiêu chuẩn thiết kế đường đô thị TCXDVN104: 2007 phân loại đường phố trong đô thị thành mấy loại.?', 'Có 4 loại đường đô thị', 'Có 3 loại đường đô thị', 'Có 2 loại đường đô thị', 'Có 1 loại đường đô thị', 1, '2022-03-28 06:53:54', '2022-03-28 06:53:54'),
(331, 2, 1, 'Trong tiêu chuẩn thiết kế đường đô thị TCXDVN104: 2007 phân loại quảng trường trong đô thị thành mấy loại?', 'Có 1 loại quảng trường.', 'Có 2 loại quảng trường.', 'Có 3 loại quảng trường.', 'Có 4 loại quảng trường.', 3, '2022-03-28 06:54:09', '2022-03-28 06:54:09'),
(332, 2, 1, 'Trong tiêu chuẩn thiết kế đường TCVN 4054 - 2005, lưu lượng thiết kế là lưu lượng xe con được quy đổi từ các loại xe khác, thông qua mặt cắt trong ngày đêm, tính cho năm tương lai. Với đường cấp I, II, năm tương lai quy định là năm nào trong các phương án sau?', 'Năm thứ 10', 'Năm thứ 15', 'Năm thứ 20', 'Năm thứ 25', 3, '2022-03-28 06:54:27', '2022-03-28 06:54:27'),
(333, 2, 1, 'Trong tiêu chuẩn thiết kế đường TCVN 4054 - 2005, lưu lượng thiết kế là lưu lượng xe con được quy đổi từ các loại xe khác, thông qua mặt cắt trong ngày đêm, tính cho năm tương lai. Với đường cấp III, IV, năm tương lai quy định là năm nào trong các phương án sau?', 'Năm thứ 10', 'Năm thứ 15', 'Năm thứ 20', 'Năm thứ 25', 2, '2022-03-28 06:55:49', '2022-03-28 06:55:49'),
(334, 2, 1, 'Trong tiêu chuẩn thiết kế đường TCVN 4054 - 2005, lưu lượng thiết kế là lưu lượng xe con được quy đổi từ các loại xe khác, thông qua mặt cắt trong ngày đêm, tính cho năm tương lai. Với đường cấp V, VI và đường nâng cấp, năm tương lai quy định là năm nào trong các phương án sau?', 'Năm thứ 10', 'Năm thứ 15', 'Năm thứ 20', 'Năm thứ 25', 1, '2022-03-28 06:56:04', '2022-03-28 06:56:04'),
(335, 2, 1, 'Độ dốc ngang của mặt đường trên các đoạn thẳng được quy định để đảm bảo thoát nước mưa, phụ thuộc vào loại mặt đường. Với mặt đường bê tông xi măng và bê tông nhựa chọn độ dốc ngang bao nhiêu là đúng?', 'Độ dốc ngang 1,5 - 2,0 %', 'Độ dốc ngang 1,5 - 3,0 %', 'Độ dốc ngang 2,0 - 3,0 %', 'Độ dốc ngang 3,0 - 4,0 %', 1, '2022-03-28 06:56:19', '2022-03-28 06:56:19'),
(336, 2, 1, 'Trong tiêu chuẩn thiết kế đường TCVN 4054 - 2005 quy định: H là chiều cao tĩnh không, tính từ điểm cao nhất của phần xe chạy chưa xét đến chiều cao dự trữ nâng cao mặt đường khi sửa chữa, cải tạo, nâng cấp); h chiều cao tĩnh không ở mép ngoài lề đường. Khi thiết kế đường cấp I, II, III chọn các giá trị nào trong các phương án sau:', 'H = 5,0, h = 4,5m', 'H = 4,75, h = 4,0 m', 'H = 4,5 , h = 4,0 m', 'H = 4,25, h = 4,0 m', 2, '2022-03-28 06:56:51', '2022-03-28 06:56:51'),
(337, 2, 1, 'Trong tiêu chuẩn thiết kế đường TCVN 4054 - 2005 quy định: H là chiều cao tĩnh không, tính từ điểm cao nhất của phần xe chạy (chưa xét đến chiều cao dự trữ nâng cao mặt đường khi sửa chữa, cải tạo, nâng cấp); h chiều cao tĩnh không ở mép ngoài lề đường. Khi thiết kế đường cấp IV và thấp hơn chọn các giá trị nào trong các phương án sau:', 'H = 5,0, h = 4,5 m', 'H = 4,75, h = 4,0 m', 'H = 4,5 , h = 4,0m', 'H = 4,25, h = 4,0 m', 3, '2022-03-28 06:57:06', '2022-03-28 06:57:06'),
(338, 2, 1, 'Trong tiêu chuẩn thiết kế mặt đường, phân ra mấy loại tầng mặt đường (cấp mặt đường)?', 'Chỉ có 1 loại tầng mặt đường', 'Có 2 loại tầng mặt đường', 'Có 3 loại tầng mặt đường', 'Có 4 loại tầng mặt đường', 4, '2022-03-28 06:57:20', '2022-03-28 06:57:20'),
(339, 2, 1, 'Tải trọng tính toán mặt đường mềm, đối với đường ngoài đô thị được quy định tải trọng trục xe. Tải trọng quy định là bao nhiêu?', 'Tải trọng trục 12 KN', 'Tải trọng trục 14 KN', 'Tải trọng trục 10KN', 'Tải trọng trục 8 KN', 3, '2022-03-28 06:57:52', '2022-03-28 06:57:52'),
(340, 2, 1, 'Tải trọng tính toán mặt đường cứng, đối với đường ngoài đô thị được quy định tải trọng trục xe. Tải trọng quy định là bao nhiêu?', 'Tải trọng trục 12 KN', 'Tải trọng trục 14 KN', 'Tải trọng trục 10KN', 'Tải trọng trục 8 KN', 3, '2022-03-28 06:58:07', '2022-03-28 06:58:07'),
(341, 2, 1, 'Khi khảo sát đường phải đo cao chi tiết các cọc để khớp với cao độ các mốc, sai số giữa hai lần đo fh = √L (Căn bậc 2 của L); trong đó fh tính bằng mm, L khoảng cách giữa hai mốc tính bằng Km; giá trị cho dưới đây. Trong các phương án đưa ra chọn phương án đúng.', 'fh = 20. L', 'fh = 30. L', 'fh = 40. L', 'fh = 50. L', 4, '2022-03-28 07:01:25', '2022-03-28 07:01:25'),
(342, 2, 1, 'Khi khảo sát lập thiết kế kỹ thuật tuyến đường, quy định phải đo dài tổng quát để đóng các cọc H, cọc Km, quy định sai số cho phép hai lần đo fl = 1/ L,. fl sai số tính bằng mét, L chiều dài đo tính bằng mét, a giá trị cho dưới đây. Trong các phương án đưa ra chọn phương án đúng.', 'fl = 1/100. L', 'fl = 1/500. L', 'fl = 1/1000. L', 'fl = 1/1500. L', 3, '2022-03-28 07:01:44', '2022-03-28 07:01:44'),
(343, 2, 1, 'Khi khảo sát lập thiết kế kỹ thuật tuyến đường, quy định phải đo dài chi tiết để đóng các cọc, chỉ cần đo một lần khớp vào H, cọc Km, quy định sai số cho phép fl = 1/ L,. fl sai số tính bằng mét, L chiều dài đo tính bằng mét, a giá trị cho dưới đây. Trong các phương án đưa ra chọn phương án đúng.', 'fl = 1/100. L', 'fl = 1/500. L', 'fl = 1/1000. L', 'fl = 1/1500. L', 2, '2022-03-28 07:02:56', '2022-03-28 07:02:56'),
(344, 2, 1, 'Để xác định hiệu ứng do tải trọng thường xuyên DC tác dụng lên cầu dầm liên tục thi công theo phương pháp đúc hẫng cân bằng ta chất tải trọng này lên sơ đồ tính toán nào của kết cấu nhịp ?', 'Sơ đồ dầm liên tục.', 'Sơ đồ dầm giản đơn mút thừa.', 'Sơ đồ đúc hẫng cân bằng.', 'Sơ đồ kết cấu nhịp trước khi thực hiện đốt hợp long cuối cùng', 4, '2022-03-28 07:03:16', '2022-03-28 07:03:16'),
(345, 2, 1, 'Hãy cho biết cách tính hệ số phân bố ngang của cầu dầm và cầu bản đặt chéo một góc θ so với dòng chảy ?', 'Tính như cầu đặt thẳng nhưng khoảng cách s giữa các dầm lấy bằng s/cosθ.', 'Tính như đối với cầu đặt thẳng sau đó nhân với hệ số điều chỉnh c1.', 'Tính như đối với cầu thẳng sau đó nhân với hệ số điều chỉnh tgθ/c1.', 'Tính như đối với cầu thẳng sau đó nhân với hệ số điều chỉnh 1- c1(tgθ)3/2', 4, '2022-03-28 07:04:04', '2022-03-28 07:04:04'),
(346, 2, 1, 'Hãy giải thích tại sao tỉ lệ giữa chiều dài nhịp biên và chiều dài nhịp chính trong cầu dầm liên tục thi công theo công nghệ đúc hẫng cân bằng lại không lấy theo tỉ lệ hợp lý đối với dầm liên tục là 0,8 ?', 'Để giảm chiều dài đoạn dầm đúc trên đà giáo cố định.', 'Để giảm phản lực gối lên mố hoặc trụ biên.', 'Để không xuất hiện mô men âm ở mặt cắt giữa nhịp chính.', 'Để sơ đồ làm việc của kết cấu nhịp gần với sơ đồ đúc hẫng.', 3, '2022-03-28 07:04:28', '2022-03-28 07:04:28'),
(347, 2, 1, 'Hãy cho biết sơ đồ được áp dụng để phân tích nội lực hộp dầm cầu bê tông thi công phân đoạn làm việc theo phương ngang cầu ?', 'Tính theo sơ đồ bản kê hai cạnh.', 'Tính theo sơ đồ dầm liên tục.', 'Tính theo sơ đồ khung kín.', 'Tính theo sơ đồ bản kê bốn cạnh.', 3, '2022-03-28 07:04:42', '2022-03-28 07:04:42'),
(348, 2, 1, 'Xét ảnh hưởng của các tải trọng thi công đến nội lực tính toán của các dạng kết cấu nhịp cầu thi công theo phương pháp phân đoạn như thế nào ?', 'Chỉ xét đối với sơ đồ kết cấu nhịp trong giai đoạn thi công, không xét trong giai đoạn khai thác.', 'Cộng tác dụng giai đoạn có sơ đồ thi công bất lợi nhất với hiệu ứng dỡ tải khi rút tải trọng thi công khỏi kết cấu nhịp.', 'Không ảnh hưởng đến nội lực tính toán vì tải trọng thi công chỉ xuất hiện tạm thời.', 'Xét với sơ đồ kết cấu nhịp trong giai đoạn thi công để kiểm tra, không cộng với hiệu ứng dỡ tải.', 2, '2022-03-28 07:05:06', '2022-03-28 07:05:06'),
(349, 2, 1, 'Xét tác dụng của lực căng các dây văng lên sự phân bố nội lực trong các bộ phận của kết cấu nhịp cầu dây văng như thế nào?', 'Đặt lực căng dây tại các nút liên kết dầm-dây của sơ đồ hoàn chỉnh.', 'Lần lượt thay từng đôi dây bằng các lực căng vào sơ đồ hoàn chỉnh, sau đó cộng tác dụng.', 'Lần lượt thay từng nhánh dây bằng lực căng vào sơ đồ hoàn chỉnh, sau đó cộng tác dụng.', 'Tính theo trình tự lắp dây, thay từng nhánh dây bằng lực căng, sau đó cộng tác dụng.', 4, '2022-03-28 07:05:24', '2022-03-28 07:05:24'),
(350, 2, 1, 'Lực nâng (hoặc ép xuống) của gió tác dụng lên cánh hẫng của dầm đúc hẫng trong giai đoạn thi công được tính như thế nào?', '1,25 kN/m2 x diện tích mặt cầu x sin 10°.', '0,5 kN/m2 x diện tích mặt cầu x sin 10°.', '2,4 x10-4 Mpa x diện tích mặt cầu.', 'Tính theo tải trọng gió đứng điều 3.8.2 (22TCN-272-05)', 3, '2022-03-28 07:06:00', '2022-03-28 07:06:00'),
(351, 2, 1, 'Thế nào là bàn mặt cầu sườn hở, bàn mặt cầu sườn kín?', 'Mặt cầu sườn hở là bản mặt cầu trực hướng có các sườn không liên tục, sườn kín là sườn liên tục trên suốt chiều rộng mặt cầu.', 'Mặt cầu sườn hở có các sườn là thép bản hoặc chữ T, chữ L còn sườn kín có dạng chữ U, chữ V hoặc lượn sóng.', 'Mặt cầu sườn hở có các sườn giao nhau nhưng không hàn với nhau, mặt cầu sườn kín hàn với nhau.', 'Mặt cầu sườn hở là bản mặt cầu bằng thép mắt võng, mặt cầu sườn kín là mặt cầu bằng thép tấm.', 2, '2022-03-28 07:06:13', '2022-03-28 07:06:13'),
(352, 2, 1, 'Có bao nhiêu giải pháp xử lý vùng mô men âm ở cầu dầm thép liên hợp bản bê tông cốt thép?', '2', '3', '4', '5', 4, '2022-03-28 07:06:32', '2022-03-28 07:06:32'),
(353, 2, 1, 'Hệ số làn xe m không được dùng cho những trường hợp nào?', 'Trạng thái giới hạn mới.', 'Khi số làn chất tải là 2.', 'Trạng thái mỏi và khi sử dụng hệ số phân bố ngang tính theo các công thức lập sẵn trong Tiêu chuẩn 22TCN 272-05.', 'Khi sử dụng các phương pháp phân tích chính xác.', 3, '2022-03-28 07:06:45', '2022-03-28 07:06:45'),
(354, 2, 1, 'Bản bê tông mặt cầu của cầu dầm thép liên hợp bản BTCT có chiều dày bằng 1/12 khoảng cách s giữa hai dầm chủ, khẩu độ tính toán L= 10s. Hãy cho biết chiều rộng hữu hiệu bản bê tông của dầm nằm bên trong kết cấu nhịp nhận giá trị nào trong trong số những đại lượng sau?', '12 lần chiều dày của bản cộng với ½ chiều rộng bản cánh dầm thép', 'Bằng khoảng cách s giữa các dầm.', 'Bằng 1/4L.', '12 lần chiều dày bản cộng với chiều rộng bản cánh dầm thép', 2, '2022-03-28 07:07:00', '2022-03-28 07:07:00'),
(355, 2, 1, 'Những tải trọng theo phương dọc cầu tác dụng lên những trụ nằm trong phạm vi nhịp thông thuyền gồm những loại nào?', 'Lực hãm xe BR, lực ma sát FR, gió WL+WS và lực va tầu CV.', 'Lực hãm xe BR, lực ma sát, lực gió (dọc) WL+WS và 50% lực va tầu CV.', 'Lực hãm xe BR, lực ma sát FR, gió WL+WS.', 'Lực hãm xe BR và lực va tầu CV.', 2, '2022-03-28 07:07:18', '2022-03-28 07:07:18'),
(356, 2, 1, 'Hãy cho biết nguyên lý xác định vị trí trục trung hòa của mặt cắt dầm BTCT hoặc bê tông ứng suất trước chịu uốn?', 'Xác định theo nguyên lý hình học tìm trọng tâm tiết diện nguyên của bê tông.', 'Xác định theo nguyên lý hình học tìm trọng tâm tiết diện tính đổi từ cốt thép sang bê tông.', 'Từ phương trình cân bằng các thành phần lực trong các loại cốt thép và hợp lực của khối ứng suất vùng bê tông chịu nén.', 'Dựa vào tỉ lệ giữa chiều cao vùng chịu nén của bê tông và chiều cao có hiệu của tiết diện x/h0 ứng với hàm lượng cốt thép tối đa.', 3, '2022-03-28 07:07:32', '2022-03-28 07:07:32'),
(357, 2, 1, 'Khả năng chống nứt của dầm bê tông chịu uốn được thiết kế dựa trên tiêu chí nào?', 'Khống chế ứng suất kéo trong bê tông đối với dầm BTCT thường.', 'Không cho xuất hiện ứng suất kéo trong bê tông đối với dầm bê tông ứng suất trước.', 'Khống chế ứng suất kéo trong cốt thép thường fsa ≤ 0,6fy.', 'Khống chế độ mở rộng vết nứt.', 3, '2022-03-28 07:07:49', '2022-03-28 07:07:49'),
(358, 2, 1, 'Để tính độ võng và độ vồng của dầm bê tông chịu uốn, độ cứng của dầm được xem xét như thế nào?', 'Độ cứng của của tiết diện nguyên: Eclg', 'Độ cứng của tiết diện tính đổi: Ecltd', 'Độ cứng của tiết diện nguyên không đàn hồi: 0,85Eclg', 'Độ cứng của mặt cắt có hiệu: Ecle (trong đó le ≤ Ig)', 1, '2022-03-28 07:08:22', '2022-03-28 07:08:22'),
(359, 2, 1, 'Hãy cho biết tỉ lệ giữa chiều dài nhịp biên và chiều dài nhịp chính của cầu dầm liên tục thi công theo công nghệ đúc hẫng cân bằng?', '0,80', '0,75', '0,70', '0,65', 4, '2022-03-28 07:08:38', '2022-03-28 07:08:38'),
(360, 2, 1, 'Sức kháng cắt danh định của dầm bê tông cốt thép và bê tông ứng suất trước bao gồm những thành phần nào?', 'Sức kháng cắt của bê tông Vc, của cốt thép đai thường Vs và cốt thép đai dự ứng lực Vp.', 'Sức kháng cắt của bê tông Vc, của cốt đai thường Vs và của cốt dự ứng lực kéo xiên Vp.', 'Sức kháng cắt của bê tông Vc, của cốt đai thường nằm trong phạm vi vết nứt xiên góc θ° và phân lực thẳng đứng của cốt thép dự ứng lực kéo xiên Vp', 'Trị số nhỏ nhất của: Vc phụ thuộc β +Vs trong vết nứt xiên θ° + Vp và Vc không phụ thuộc β + Vp', 4, '2022-03-28 07:08:59', '2022-03-28 07:08:59'),
(361, 2, 1, 'Mục đích của việc tính các mất mát ứng suất trước trong trong cốt thép dự ứng lực.', 'Để xác định lực căng kéo cốt thép và các hiệu ứng do căng kéo.', 'Để xác định ứng suất có hiệu tác dụng lên bê tông.', 'Để xác định ứng suất kéo trong cốt thép ứng suất trước.', 'Để xác định sức kháng uốn của dầm.', 1, '2022-03-28 07:09:15', '2022-03-28 07:09:15'),
(362, 2, 1, 'Mất mát ứng suất tức thời là những dạng mất mát nào?', 'Là những mất mát ứng suất xảy ra ngay tại thời điểm căng kéo.', 'Là những mất mát xảy ra sau thời điểm căng kéo.', 'Là những mất mát xảy ra ngay tại thời điểm truyền lực căng lên bê tông.', 'Là những mất mát xây ra ngay sau thời điểm truyền lực căng lên bê tông.', 4, '2022-03-28 07:10:30', '2022-03-28 07:10:30'),
(363, 2, 1, 'Ảnh hưởng của hiện tượng co ngót và từ biến đến ứng xử của dầm bê tông dự ứng lực được xét đến trong thiết kế như thế nào?', 'Tính các mất mát ứng suất trước.', 'Tính các mất mát ứng suất và độ võng tĩnh của dầm.', 'Tính các mất mát ứng suất và phân phối lại nội lực trong dầm.', 'Không gây ảnh hưởng đến dầm vì là hệ tĩnh định.', 2, '2022-03-28 07:10:47', '2022-03-28 07:10:47'),
(364, 2, 1, 'Trường hợp nào sức kháng uốn danh định của dầm thép liên hợp ấy bằng mô men dẻo Mp.', 'Tiết diện dầm thép đáp ứng yêu cầu mặt cắt đặc chắc.', 'Bản bụng đặc chắc, bản cánh chịu nén được giằng liên kết và kích thước dầm đảm bảo tỉ lệ Dp/D’ ≤1.', 'Bản bụng đặc chắc và kích thước dầm đảm bảo tỉ lệ Dp/D’ ≤1.', 'Bản bụng và bản cánh chịu nén đặc chắc, bản cánh chịu nén được giằng liên kết, kích thước dầm đảm bảo tỉ lệ Dp/D’ ≤1', 3, '2022-03-28 07:11:33', '2022-03-28 07:11:33'),
(365, 2, 1, 'Hãy cho biết nguyên lý tính mô men chảy My và mô men dẻo Mp giống nhau hay khác nhau?', 'Giống nhau vì đều là tổng các mô men tác dụng riêng lẻ của các phần so với trục trung hòa.', 'Khác nhau vì My = Fy*Sn còn Mp = ΣPidi', 'Khác nhau vì My = MDC + MDW + MAD còn Mp = ΣPidi', 'Giống nhau vì cả hai loại mô men đều tính theo ba thành phần M = MDC + MDW + ΣPidi chỉ khác nhau ở vị trí trục trung hòa.', 3, '2022-03-28 07:11:53', '2022-03-28 07:11:53'),
(366, 2, 1, 'Các neo đinh liên kết trong dầm liên hợp được bố trí như thế nào trên mặt dầm thép?', 'Bố trí thành hai hàng và theo từng nhóm, khoảng cách đinh trong nhóm bằng 6 lần đường kính đinh.', 'Bố trí thành hai hàng chạy suốt chiều dài dầm theo bước đinh đều nhau bằng chiều dài dầm/số lượng đinh n.', 'Bố trí thành hai hàng chạy suốt chiều dài dầm, bước đinh bố trí giảm dần từ giữa nhịp về hai phía đầu dầm theo giá trị lực cắt mỏi.', 'Bố trí thành hai hàng chạy suốt chiều dài dầm theo bước đinh ≤ 600mm.', 2, '2022-03-28 07:13:27', '2022-03-28 07:13:27'),
(367, 2, 1, 'Sức kháng cắt của dầm thép liên hợp bản bê tông cốt thép bao gồm những thành phần nào?', 'Sức kháng cắt của tiết diện dầm thép và sức kháng cắt của cốt thép bản mặt cầu.', 'Sức kháng cắt của dầm thép không xét bản bê tông.', 'Sức kháng cắt của bản bụng dầm thép.', 'Sức kháng cắt của bản bụng được tăng cường,', 3, '2022-03-28 07:13:41', '2022-03-28 07:13:41'),
(368, 2, 1, 'Khi thiết kế cầu nhỏ, cống phải căn cứ vào lưu lượng được tính toán với tần suất quy định tùy vào cấp đường. Với đường cấp I, II tần suất tính toán là bao nhiêu?', 'Tần suất 1%', 'Tần suất 2%', 'Tần suất 4%', 'Tần suất 5%', 2, '2022-03-28 07:13:55', '2022-03-28 07:13:55'),
(369, 2, 1, 'Khi thiết kế cầu nhỏ, cống phải căn cứ vào lưu lượng được tính toán với tần suất quy định tùy vào cấp đường. Với đường cấp III đến VI tần suất tính toán là bao nhiêu?', 'Tần suất 1%', 'Tần suất 2%', 'Tần suất 4%', 'Tần suất 5%', 3, '2022-03-28 07:14:08', '2022-03-28 07:14:08'),
(370, 2, 1, 'Khi thiết kế khầu độ cầu phải căn cứ vào lưu lượng được tính toán với tần suất quy định tùy vào loại cầu. Với cầu lớn, cầu trung tần suất tính toán là bao nhiêu?', 'Tần suất 1%', 'Tần suất 2%', 'Tần suất 4%', 'Tần suất 5%', 1, '2022-03-28 07:14:22', '2022-03-28 07:14:22'),
(371, 2, 1, 'Để dẫn hướng xe chạy an toàn thì tại những vị trí có ta luy âm lớn hơn giá trị quy định, đường cong bán kính nhỏ, đường dẫn lên cầu phải bố trí cọc tiêu. Theo quy định chiều cao bao nhiêu phải bố trí cọc tiêu?', 'Khi chiều cao ta luy từ 1,0 m', 'Khi chiều cao ta luy từ 1,5 m', 'Khi chiều cao ta luy từ 2,0 m', 'Khi chiều cao ta luy từ 2,5 m', 3, '2022-03-28 07:14:38', '2022-03-28 07:14:38'),
(372, 2, 1, 'Để đảm bảo an toàn xe chạy thì tại những vị trí nền đường đắp cao lớn hơn giá trị quy định, đường dẫn lên cầu, cầu cạn... phải bố trí lan can phòng hộ. Theo quy định chiều cao bao nhiêu phải bố trí lan can phòng hộ?', 'Khi chiều cao hơn 2,0 m', 'Khi chiều cao hơn 3,0 m', 'Khi chiều cao hơn 4,0 m', 'Khi chiều cao hơn 5,0 m', 3, '2022-03-28 07:14:53', '2022-03-28 07:14:53'),
(373, 2, 1, 'Vì sao nói chỉ số RQD được sử dụng phổ biến trong nghiên cứu địa chất của khối đá?', 'Vì RQD đặc trưng cho tính chất nứt nẻ của khối đá.', 'Vì thông qua RQD để đánh giá độ bền của khối đá.', 'Vì sử dụng RQD để phân loại địa chất khối đá.', 'Vì người ta sử dụng chỉ số này trong hầu hết các phương pháp phân loại địa chất khối đá.', 4, '2022-03-28 07:15:06', '2022-03-28 07:15:06'),
(374, 2, 1, 'Khẩu độ thoát nước dùng trong thiết kế cầu là gì?', 'Là chiều rộng mặt nước của sông tại mức nước cao nhất.', 'Là tổng các chiều rộng mặt thoáng dưới cầu tính theo mức nước cao nhất.', 'Là khoảng cách thông thủy giữa hai mố cầu tính theo mức nước cao nhất.', 'Là chiều rộng mặt nước của sông tại mức nước lũ lịch sử.', 3, '2022-03-28 07:15:36', '2022-03-28 07:15:36'),
(375, 2, 1, 'Chiều cao đáy dầm của kết cấu nhịp cầu vượt sông được xác định như thế nào?', 'Điểm thấp nhất của đáy dầm cao hơn mực nước cao nhất (MNCN) 0,5m.', 'Điểm thấp nhất của đáy dầm cao hơn MNCN 0,7m.', 'Điểm thấp nhất của đáy dầm cao hơn MNCN 0,7m đối với sông có cây trôi và 0,5m đối với sông không có cây trôi.', 'Điểm thấp nhất của đây dầm cao hơn MNCN 1,0 m đối với sông có cây trôi và 0,5m đối với sông không có cây trôi.', 4, '2022-03-28 07:15:50', '2022-03-28 07:15:50'),
(376, 2, 1, 'Cao độ đáy dầm của cầu vượt qua đường bộ xác định như thế nào?', 'Bằng cao độ mặt đường dưới cầu + chiều cao của khổ giới hạn theo Tiêu chuẩn thiết kế đường bộ.', 'Bằng cao độ mặt đường dưới cầu + chiều cao của khổ giới hạn theo Tiêu chuẩn thiết kế đường bộ + 25mm', 'Bằng cao độ mặt đường dưới cầu + chiều cao của khổ giới hạn theo Tiêu chuẩn thiết kế đường bộ + độ lún và độ võng của cầu.', 'Bằng cao độ mặt đường dưới cầu + chiều cao của khổ giới hạn theo tiêu chuẩn thiết kế đường bộ + độ lún và độ võng của cầu nếu độ lún và độ võng >25mm.', 4, '2022-03-28 07:16:08', '2022-03-28 07:16:08'),
(377, 2, 1, 'Mức nước thông thuyền dưới cầu được xác định như thế nào?', 'Là mức nước trung bình trong năm.', 'Là mức nước lũ tính với tần suất 15 năm xảy ra một lần.', 'Là mức nước lũ tính với tần suất 10%', 'Là mức nước lũ tính với tần suất 5%.', 4, '2022-03-28 07:16:22', '2022-03-28 07:16:22'),
(378, 2, 1, 'Độ võng cho phép đối với tất cả các loại kết cấu nhịp cầu là bao nhiêu?', 'L/800 đối với tất cả các loại cầu.', 'L/800 đối với cầu đường sắt và L/400 đối với cầu đường bộ.', 'L/600 đối với cầu đường sắt và L/400 đối với cầu đường bộ.', 'L/600 đối với cầu đường sắt và L/250 đối với cầu đường bộ', 1, '2022-03-28 07:16:37', '2022-03-28 07:16:37'),
(379, 2, 1, 'Để đảm bảo thoát nước khỏi mặt cầu, hệ thống ống thoát nước phải đáp ứng những yêu cầu gì?', '1m2 mặt cầu ít nhất có 4cm2 diện tích ống thoát.', '1m2 mặt cầu ít nhất có 4cm2 diện tích ống thoát và đường kính trong của ống thoát Dtr ≥ 150mm', '1m2 mặt cầu ít nhất có 1cm2 diện tích ống thoát, đường kính trong của ống Dtr ≥ 90mm và cự ly giữa các ống thoát ≤ 10m/ống.', '1m2 mặt cầu ít nhất có 1cm2 diện tích ống thoát, đường kính trong của ống Dtr  ≥ 100mm và cự ly giữa các ống thoát ≤ 15m/ống.', 4, '2022-03-28 07:16:54', '2022-03-28 07:16:54'),
(380, 2, 1, 'Bản bê tông mặt cầu của cầu dầm được phép tính theo phương pháp gần đúng bằng cách chia thành các dải bản tương đương. Chiều rộng của dải bản tương đương cầu dầm bê tông được lấy bằng bao nhiêu?', '1000mm', '1800mm', '660+ 0,55s tại mặt cắt giữa nhịp và 1220+0,25s tại mặt cắt tim dầm.', 'Khoảng cách giữa hai dầm chủ s (mm).', 3, '2022-03-28 07:17:10', '2022-03-28 07:17:10'),
(381, 2, 1, 'Hãy cho biết chiều dài cốt thép chờ với đường kính là d và sử dụng mối nối bằng dây thép buộc.', 'Bằng 25d', 'Bằng 30d', 'Bằng 300mm', 'Bằng (1,0 ÷ 1,7) chiều dài triển khai của cốt thép.', 4, '2022-03-28 07:17:25', '2022-03-28 07:17:25'),
(382, 2, 1, 'Trong dầm bê tông dự ứng lực căng trước sử dụng từng tạo xoắn kéo thẳng, một số tạo cáp được bọc chống dính bám ở hai đầu. Số lượng tao cáp được bọc này cho phép tối đa là bao nhiêu?', '40% tổng số tao cáp.', '30% tổng số tao cáp.', '25% tổng số tao cáp.', '20% tổng số tao cáp.', 3, '2022-03-28 07:17:48', '2022-03-28 07:17:48'),
(383, 2, 1, 'Chiều dày bảo vệ đối với cốt thép trong điều kiện môi trường khô cạn bình thường tối thiểu là bao nhiêu?', '1,5 đường kính cốt thép.', '3,5cm', '3,0cm', '2,5cm', 4, '2022-03-28 07:18:09', '2022-03-28 07:18:09'),
(384, 2, 1, 'Chiều dày bảo vệ đối với cốt thép đứng của cọc khoan nhồi được chọn là bao nhiêu?', '5,0 cm', '7,5 cm', '9,0 cm', '3,0 lần đường kính cốt thép.', 3, '2022-03-28 07:18:30', '2022-03-28 07:18:30'),
(385, 2, 1, 'Trong dầm bê tông hàm lượng cốt thép dự ứng lực và cốt thép thường được giới hạn theo tỉ số giữa khoảng cách thớ chịu nén của bê tông đến trục trung hòa và khoảng cách hữu hiệu của cốt thép chịu kéo dHãy cho biết giới hạn này bằng bao nhiêu?', '0,55', '0,45', '0,42', '0,40', 3, '2022-03-28 07:18:45', '2022-03-28 07:18:45'),
(386, 2, 1, 'Trong dầm bê tông lắp ghép sử dụng đá 1x2, cốt đai đứng của sườn dầm có đường kính danh định là 14mm, tại khu vực đầu dầm cự li tối thiểu giữa các thanh cốt đai được phép bố trí là bao nhiêu?', '28mm', '39mm', '41mm', '52mm', 2, '2022-03-28 07:19:02', '2022-03-28 07:19:02'),
(387, 2, 1, 'Cự li tối đa của cốt thép cấu tạo bố trí trong dầm bê tông được quy định như thế nào?', 'Không vượt quá chiều dày của bộ phận kết cấu hoặc 250mm.', 'Không vượt quá chiều dày của bộ phận kết cấu hoặc 300mm.', 'Không vượt quá 1,5 chiều dày bộ phận kết cấu và 400mm.', 'Không vượt quá 1,5 chiều dày bộ phận kết cấu và 450mm.', 4, '2022-03-28 07:19:23', '2022-03-28 07:19:23'),
(388, 2, 1, 'Cự li giữa các tao cáp đơn đường kính 12,7mm bố trí trong dầm bê tông dự ứng lực chế tạo theo công nghệ căng trước, bê tông đá 1x2 được bố trí tối thiểu là bao nhiêu?', '51mm', '44mm', '39mm', '38mm', 2, '2022-03-28 07:21:08', '2022-03-28 07:21:08'),
(389, 2, 1, 'Hãy cho biết giới hạn chảy Fy của thép kết cấu sử dụng cho dầm cầu.', '190 Mpa', '210 Mpa', '250 Mpa', '270 Mpa', 3, '2022-03-28 07:21:41', '2022-03-28 07:21:41'),
(390, 2, 1, 'Hãy cho biết cách tính tác dụng của xe tải thiết kế lên tường thân của mố chữ U bê tông cốt thép?', 'Tính theo tải trọng chất thêm ES với áp lực phân bố pi là áp lực của các tải trọng bánh xe truyền qua lớp áo đường phía sau mố.', 'Tính theo tải trọng chất thêm ES với các lực tập trung Pi là các tải trọng của trục bánh xe đặt trên mặt đường sau mố.', 'Tính theo tải trọng chất thêm ES với hoạt tải tác dụng lớn nhất qs là áp lực phân bố lớn nhất của tải trọng trục thông qua lớp áo đường sau mổ.', 'Tính theo hoạt tải chất thêm LS với chiều cao đất tương đương heq.', 4, '2022-03-28 07:22:08', '2022-03-28 07:22:08'),
(391, 2, 1, 'Mật độ kiểm tra độ chặt của mỗi lớp đất đắp sau khi đầm nén xong được quy định như thế nào?', 'Tối thiểu 3 vị trí trên 1000 m2', 'Tối thiểu 2 vị trí trên 1000 m2', 'Tối thiểu 2 vị trí trên 1500 m2', 'Tối thiểu 3 vị trí trên 1500 m2', 2, '2022-03-28 07:22:29', '2022-03-28 07:22:29'),
(392, 2, 1, 'Khi nghiệm thu độ bằng phẳng của mặt trên cùng nền đường ô tô cấp III sau khi thi công (cả với nền đào và nền đắp) bằng thước dài 3 m, phải thỏa mãn điều kiện nào sau đây?', '100% số khe hở dưới thước dài 3 m không vượt quá 15 mm', '70% số khe hở dưới thước dài 3 m không vượt quá 7 mm, còn lại không vượt quá 15 mm', '70% số khe hở dưới thước dài 3 m không vượt quá 15 mm, còn lại không vượt quá 20 mm.', '100% số khe hở dưới thước dài 3 m không vượt quá 20 mm', 3, '2022-03-28 07:22:48', '2022-03-28 07:22:48'),
(393, 2, 1, 'Khi kiểm tra nghiệm thu kích thước hình học của nền đường sau thi công đối với đường cao tốc, cấp I, II và III, sai số cho phép của vị trí trục tim tuyến đường là bao nhiêu?', 'Không quá 30 mm', 'Không quá 50 mm', 'Không quá 70 mm', 'Không quá 100 mm', 2, '2022-03-28 07:23:03', '2022-03-28 07:23:03'),
(394, 2, 1, 'Nhiệt độ tối thiểu cho phép đổ hỗn hợp bê tông nhựa nóng từ xe ô tô vào phễu của máy rải là bao nhiêu?', '110°C khi sử dụng loại nhựa đường 60/70', '120°C khi sử dụng loại nhựa đường 60/70', '125°C khi sử dụng loại nhựa đường 60/70', '130°C khi sử dụng loại nhựa đường 60/70', 3, '2022-03-28 07:23:18', '2022-03-28 07:23:18'),
(395, 2, 1, 'Điều kiện thời tiết nào dưới đây xảy ra thì không được phép thi công hỗn hợp bê tông nhựa rải nóng?', 'Nhiệt độ không khí lớn hơn 15°C', 'Trời mưa', 'Nhiệt độ không khí thấp hơn 15°C', 'Cả hai trường hợp B và C', 4, '2022-03-28 07:24:10', '2022-03-28 07:24:10'),
(396, 2, 1, 'Phương pháp nào dưới đây được dùng để xác định hàm lượng nhựa tối ưu của hỗn hợp bê tông nhựa chặt được sử dụng ở Việt Nam?', 'Phương pháp Marshall.', 'Phương pháp Superpave.', 'Phương pháp Hveen.', 'Tất cả các phương pháp trên.', 1, '2022-03-28 07:24:32', '2022-03-28 07:24:32'),
(397, 2, 1, 'Chỉ tiêu nào dưới đây không dùng để đánh chất lượng của nhựa đường đặc 60/70?', 'Độ kim lún ở 25°C', 'Độ ổn định lưu trữ 24h', 'Điểm hóa mềm (dụng cụ vòng và bi)', 'Độ kéo dài ở 25°C', 2, '2022-03-28 07:24:50', '2022-03-28 07:24:50'),
(398, 2, 1, 'Có thể sử dụng phương pháp nào dưới đây để kiểm tra phục vụ cho công tác nghiệm thu độ bằng phẳng mặt đường bê tông nhựa?', 'Phương pháp dùng thước 3 m', 'Phương pháp sử dụng thiết bị đo IRI', 'Cả hai phương pháp A và B', 'Phương pháp sử dụng thiết bị đo độ xóc tích lũy', 3, '2022-03-28 07:25:07', '2022-03-28 07:25:07'),
(399, 2, 1, 'Không được phép thi công mặt đường bê tông xi măng trong các điều kiện nào dưới đây?', 'Mưa tại hiện trường', 'Tốc độ gió ≥ 10,8 m/s (cấp 6 trở lên)', 'Nhiệt độ không khí ở hiện trường thi công < 40°C', 'Cả A và B.', 4, '2022-03-28 07:25:25', '2022-03-28 07:25:25'),
(400, 2, 1, 'Có thể sử dụng phương pháp nào dưới đây để kiểm tra độ bằng phẳng của mặt đường bê tông xi măng phục vụ cho việc nghiệm thu?', 'Phương pháp sử dụng thiết bị phân tích trắc dọc APL', 'Phương pháp sử dụng thiết bị đo IRI', 'Phương pháp sử dụng thiết bị đo mặt cắt kiểu không tiếp xúc', 'Phương pháp sử dụng thiết bị đo độ xóc tích lũy', 2, '2022-03-28 07:25:44', '2022-03-28 07:25:44'),
(401, 2, 1, 'Trong thi công móng cọc đóng bằng búa hơi hoặc búa diezen, nếu đóng cọc chưa đến độ sâu thiết kế mà cọc không xuống được hoặc độ chối rất nhỏ. Cách giải quyết thế nào?', 'Thay búa nặng hơn và đóng tiếp.', 'Thay búa rung để rung hạ cọc.', 'Ngừng đóng, cắt cọc.', 'Kiểm tra lại độ chối lý thuyết, nghỉ một thời gian sau đó đóng tiếp rồi mới quyết định.', 4, '2022-03-28 07:25:59', '2022-03-28 07:25:59'),
(402, 2, 1, 'Khi đổ bê tông cọc khoan nhồi trong hố khoan có nước hoặc dung dịch betonite, việc đổ bê tông sẽ thực hiện theo cách nào?', 'Đổ liên tục cho đến khi kết thúc.', 'Chia thành các đợt đổ, thời gian mỗi đợt giới hạn trong 4 giờ.', 'Chia thành các đợt đổ, thời gian nghỉ giữa mỗi đợt không ít hơn 4 giờ.', 'Cả 3 cách làm trên đều được.', 1, '2022-03-28 07:26:17', '2022-03-28 07:26:17'),
(403, 2, 1, 'Để xây dựng đài cọc có đỉnh đài nằm thấp hơn mực nước thi công. Nhà thầu đã làm vòng vây ngăn nước, nhưng hút nước trong vòng vây không cạn. Khi đó cần phải làm gì?', 'Đổ bê tông đài cọc trong nước bằng phương pháp dùng ống rút thẳng đứng.', 'Đổ bê tông đài cọc trong nước bằng phương pháp vữa dâng.', 'Đổ bê tông trong nước để bịt đáy vòng vây, hút cạn nước rồi thi công đài cọc.', 'Có thể làm theo một trong ba cách trên', 3, '2022-03-28 07:26:38', '2022-03-28 07:26:38'),
(404, 2, 1, 'Thử tải giàn giáo trong xây dựng cầu nhằm mục đích gì?', 'Kiểm tra độ bền các bộ phận của giàn giáo.', 'Kiểm tra độ cứng của giàn giáo.', 'Khử các biến dạng không đàn hồi của giàn giáo và biến dạng dư của nền móng giàn giáo.', 'Cả 3 mục đích trên.', 3, '2022-03-28 07:26:56', '2022-03-28 07:26:56'),
(405, 2, 1, 'Khi cẩu lắp cấu kiện dầm cầu đúc sẵn bằng BTCT hoặc khi căng cốt thép trong kết cấu BTCT dự ứng lực trước căng sau, yêu cầu cường độ bê tông đạt bao nhiêu?', '≥ 70% R28', '≥ 80% R28', '≥ 90% R28', 'Tùy theo quy định của thiết kế', 4, '2022-03-28 07:27:30', '2022-03-28 07:27:30'),
(406, 2, 1, 'Khi chế tạo dầm cầu BTCT dự ứng lực theo công nghệ căng sau, việc căng các bó theo cách nào sau đây là đúng?', 'Căng đồng thời tất cả các bó.', 'Căng từng bó theo thứ tự đã được tính toán trước của tư vấn thiết kế.', 'Căng từng bó theo thứ tự bất kì.', 'Có thể áp dụng một trong ba cách trên', 2, '2022-03-28 07:27:43', '2022-03-28 07:27:43'),
(407, 2, 1, 'Khi cầu cọc BTCT phải treo tối thiểu cọc tại:', 'Một vị trí.', 'Hai vị trí.', 'Ba vị trí.', 'Một trong 3 trường hợp trên.', 2, '2022-03-28 07:32:05', '2022-03-28 07:32:05'),
(408, 2, 1, 'Việc tạo dự ứng lực cho cốt thép trong chế tạo cọc ống BTCT dự ứng lực được thực hiện khi nào:', 'Căng trước khi đổ bê tông.', 'Căng sau khi đổ bê tông.', 'Vừa căng ứng lực vừa đổ bê tông.', 'Một trong 3 phương án trên.', 1, '2022-03-28 07:32:22', '2022-03-28 07:32:22'),
(409, 2, 1, 'Độ chối khi đóng cọc bằng búa diezl được xác định dựa trên cơ sở nào sau đây:', 'Độ lún trung bình của cọc/1 nhát búa trong suốt quá trình đóng.', 'Độ lún của cọc/1 nhát búa cuối cùng.', 'Độ lún trung bình của cọc/1 nhát búa trong 01 mét cuối cùng.', 'Độ lún trung bình của cọc/1 nhát búa trong loạt đóng cuối cùng.', 4, '2022-03-28 07:34:15', '2022-03-28 07:34:15'),
(410, 2, 1, 'Điều kiện để coi là hoàn thành thi công đóng cho một cọc:', 'Cọc đã được đóng đến cao độ thiết kế.', 'Cọc được đóng đến độ sâu đạt độ chối thiết kế.', 'Cọc được đóng đến cao độ và đạt độ chối thiết kế.', 'Cọc đóng chưa đến cao độ, nhưng đã đạt độ chối thiết kế.', 3, '2022-03-28 07:34:30', '2022-03-28 07:34:30'),
(411, 2, 1, 'Khi đóng cọc có sai lệch về vị trí lớn hơn cho phép, không thể xử lý bằng các biện pháp sau:', 'Kéo và neo giữ cọc vào vị trí thiết kế.', 'Nhổ lên và đóng thay thế cọc khác.', 'Đóng bổ sung cọc khác.', 'Không xử lý cọc, mà điều chỉnh kết cấu trên cho phù hợp', 1, '2022-03-28 07:34:46', '2022-03-28 07:34:46'),
(412, 2, 1, 'Trước khi thi công, thành phần cấp phối của bê tông được xác định bằng phương pháp sau:', 'Dựa trên loại, cấp bê tông được quy định trong thiết kế', 'Dựa trên cơ sở thiết kế công thức trộn.', 'Dựa trên thí nghiệm trong phòng với vật liệu dự kiến sẽ sử dụng.', 'Thực hiện tất cả các bước trên.', 4, '2022-03-28 07:34:59', '2022-03-28 07:34:59'),
(413, 2, 1, 'Nếu đang phơi đất để hạ độ ẩm nhưng chưa đạt độ ẩm quy định mà trời sắp mưa thì cần đầm lèn ngay để bảo vệ lớp dưới đó được lèn chặt nhằm hạn chế nước thấm vào trong đất đang phơi. Sau đó lớp đầm tạm này sẽ xử lý như thế nào?', 'Không phải xử lý gì và có thể thi công các lớp tiếp theo', 'Cần cầy xới lớp đầm tạm và trộn thêm đất khô vào để đắp', 'Cần đào bỏ lớp đất đầm tạm thay bằng lớp đất đạt tiêu chuẩn độ ẩm để đắp', 'Nếu còn khả năng thì đầm tiếp đạt độ chặt, nếu không phải cầy xới băm nhỏ, phơi lại', 4, '2022-03-28 07:35:23', '2022-03-28 07:35:23'),
(414, 2, 1, 'Nếu trong thi công lỡ đào rãnh lấn vào đường thì xử lý thế nào?', 'Không phải xử lý', 'Đắp đất bù lại', 'Không đắp đất bù lại, mà có biện pháp gia cường chống xói lở', 'Đáp án B hoặc đáp án C', 3, '2022-03-28 07:35:49', '2022-03-28 07:35:49'),
(415, 2, 1, 'Khi đắp hoặc bù lớp đất nhỏ hơn 10 cm thì cần phải thi công như thế nào để đảm bảo sự dính bám và đồng nhất?', 'Cầy xới lớp đất dưới, tưới ẩm, lấy đất cùng loại băm nhỏ 2 - 4 cm rải lên để đắp', 'Đào sâu lớp mặt xuống cho đủ chiều dầy quy định rồi mới rải đất lên đắp', 'Đắp lớp đất cùng loại dầy 20 cm sau đó gọt bớt để đảm bảo chiều dầy 10 cm', 'Một trong ba đáp án trên đều được', 1, '2022-03-28 07:36:05', '2022-03-28 07:36:05'),
(416, 2, 1, 'Khi đắp đất hai bên mang cống thì cần phải:', 'Chia thành từng lớp nằm ngang và đắp lần lượt từng bên', 'Chia thành từng lớp nằm ngang đối xứng, đắp đồng thời cả hai bên', 'Rải đất hai bên mang cống tới cao độ đỉnh cống và đầm đồng thời cả hai bên', 'Đáp án A hoặc đáp án B', 2, '2022-03-28 07:36:27', '2022-03-28 07:36:27'),
(417, 2, 1, 'Trong một trắc ngang nếu sử dụng hai loại đất đắp có tính thấm nước khác nhau thì khi thi công cần phải tuân theo điều kiện nào dưới đây?', 'Cần phải phân thành từng lớp đắp xen kẽ nhau', 'Mỗi loại đất được đắp thành một lớp trên suốt mặt cắt ngang', 'Khi lớp đất dễ thấm nước đắp trên lớp khó thấm nước, dốc ngang mặt lớp dưới phải ≥ 4%', 'Cả đáp án B và đáp án C', 4, '2022-03-28 07:42:48', '2022-03-28 07:42:48');
INSERT INTO `cauhois` (`idcauhoi`, `linhvuc`, `trangthai`, `cauhoi`, `dapan1`, `dapan2`, `dapan3`, `dapan4`, `dapandung`, `created_at`, `updated_at`) VALUES
(418, 2, 1, 'Công tác rải đất để đảm trên nền đất yếu hay nền bão hòa nước thì cần được tiến hành như thế nào?', 'Rải đất ở giữa trước rồi tiến ra mép ngoài biên', 'Rải đất từ mép ngoài biên vào giữa', 'Theo đáp án A nhưng khi đắp tới độ cao 3m thì rải đất từ mép biên vào giữa', 'Đáp án A hoặc đáp án B đều đúng', 3, '2022-03-28 07:43:14', '2022-03-28 07:43:14'),
(419, 2, 1, 'Biện pháp nào khi thi công để đảm bảo được độ chặt yêu cầu khi lắp đất mái dốc và mép biên?', 'Cần rải đất rộng hơn đường biên thiết kế 20 - 30 cm theo chiều thẳng so với mái dốc', 'Cần tăng số công đầm ở những vị trí này', 'Cần tăng cường thêm đầm thủ công sau đầm máy', 'Cả đáp án A và B', 1, '2022-03-28 07:43:32', '2022-03-28 07:43:32'),
(420, 2, 1, 'Khi giám sát công tác nổ mìn, công tác nào phải làm trước trong số các việc sau:', 'Kiểm tra gương đào và trạng thái của lỗ mìn trước khi nạp.', 'Kiểm tra đảm bảo an toàn cho người và thiết bị máy móc.', 'Trước khi nổ mìn máy móc phải di chuyển đến khoảng cách an toàn.', 'Kiểm tra hộ chiếu khoan nổ.', 4, '2022-03-28 07:43:53', '2022-03-28 07:43:53'),
(421, 2, 1, 'Trước khi thi công đại trà nền đường, phải thi công thí điểm một đoạn dài tối thiểu 100 m trong trường hợp nào dưới đây?', 'Nền đắp đối với đường cao tốc, đường cấp I, cấp II và cấp III.', 'Nền đào hoặc đắp có áp dụng kỹ thuật, công nghệ hoặc vật liệu mới.', 'Nền đường đặc biệt (trên đất yếu, nền vùng sạt lở, nền đào đá cứng, nền đắp bằng vật liệu nhẹ).', 'Cả ba trường hợp trên.', 4, '2022-03-28 07:44:10', '2022-03-28 07:44:10'),
(422, 2, 1, 'Khi nền tự nhiên có độ dốc ngang từ 20% đến 50%, trước khi đắp nền đường, cần phải có biện pháp xử lý như thế nào?', 'Đắp trực tiếp trên mặt nền tự nhiên.', 'Đào bỏ lớp đất hữu cơ, sau đó đắp trực tiếp.', 'Kết hợp đánh bậc cấp và đào bỏ lớp hữu cơ trước khi đắp.', 'Xây dựng công trình chống đỡ phía dưới dốc (tường chắn các loại).', 3, '2022-03-28 07:44:25', '2022-03-28 07:44:25'),
(423, 2, 1, 'Trước khi đầm nén, đất đã rải phải có độ ẩm như thế nào?', 'Độ ẩm tốt nhất, với sai số cho phép là ± 1%.', 'Độ ẩm tốt nhất, với sai số cho phép là ± 2%', 'Độ ẩm tốt nhất, với sai số cho phép là ± 3%', 'Độ ẩm tốt nhất, với sai số cho phép là ± 4%', 2, '2022-03-28 07:44:40', '2022-03-28 07:44:40'),
(424, 2, 1, 'Để đảm bảo chất lượng công tác đắp nền đường, phải dùng biện pháp thi công nào dưới đây?', 'Đắp lấn dần từ chỗ cao xuống chỗ thấp.', 'Đắp thành từng lớp từ chỗ thấp nhất lên cao dần.', 'Đắp lẫn lộn các loại đất, đá, đất lẫn đá trên cùng một đoạn nền đường.', 'Đắp loại đất có chỉ số sức chịu tải CBR thấp ở trên và cao ở phía dưới.', 2, '2022-03-28 07:44:58', '2022-03-28 07:44:58'),
(425, 2, 1, 'Loại vật liệu nào phù hợp để đắp đoạn tiếp giáp giữa mố cấu hoặc lưng cống với nền đường đắp liền kề?', 'Vật liệu có tính thoát nước tốt, tính nén lún nhỏ như đất lẫn sỏi cuội, cát lẫn đá dăm, cát hạt vừa, cát hạt thô.', 'Đất có tính thoát nước kém.', 'Cát mịn.', 'Đá phong hóa.', 1, '2022-03-28 07:45:17', '2022-03-28 07:45:17'),
(426, 2, 1, 'Để đảm bảo an toàn lao động trong quá trình thi công nền đường bằng phương pháp nổ mìn, phải thực hiện tốt nội dung nào dưới đây?', 'Thi công nổ mìn về ban đêm.', 'Lắp đặt thuốc nổ ở các lỗ mìn cũ không nổ.', 'Phải có cảnh báo và hiệu lệnh phòng tránh cho công trường và dân cư xung quanh.', 'Đáp án A và B.', 3, '2022-03-28 07:45:40', '2022-03-28 07:45:40'),
(427, 2, 1, 'Sai số cho phép về vị trí tim rãnh xây cho phép đối với đường cấp III, IV và V là bao nhiêu?', '10 mm', '50 mm', '70 mm', '100 mm', 4, '2022-03-28 07:46:00', '2022-03-28 07:46:00'),
(428, 2, 1, 'Phương pháp nào dưới đây thường được sử dụng để xác định mô đun đàn hồi của nền đất ở hiện trường?', 'Phương pháp dùng tấm ép cứng', 'Phương pháp dùng cần đo võng Benkelman', 'Phương pháp dùng thiết bị đo độ võng FWD', 'Phương pháp dùng chùy xuyên động DCP', 1, '2022-03-28 07:46:13', '2022-03-28 07:46:13'),
(429, 2, 1, 'Chỉ tiêu nào dưới đây thường được dùng để đánh giá chất lượng của hỗn hợp cấp phối đá dăm khi xem xét chấp nhận nguồn cung cấp vật liệu?', 'Độ hào mòn Los-Angeles của cốt liệu.', 'Hàm lượng hạt thoi dẹt.', 'Độ ẩm.', 'Đáp án A và B.', 4, '2022-03-28 07:46:37', '2022-03-28 07:46:37'),
(430, 2, 1, 'Mật độ kiểm tra độ chặt lu lèn lớp móng cấp phối đá dăm để phục vụ công tác nghiệm thu như thế nào?', '7000 m2 kiểm tra tại 2 vị trí ngẫu nhiên.', '9000 m2 kiểm tra tại 2 vị trí ngẫu nhiên.', '7000 m2 kiểm tra tại 3 vị trí ngẫu nhiên.', '9000 m2 kiểm tra tại 3 vị trí ngẫu nhiên.', 1, '2022-03-28 07:46:54', '2022-03-28 07:46:54'),
(431, 2, 1, 'Khe hở tối đa cho phép dưới thước 3 m khi nghiệm thu độ bằng phẳng của lớp móng trên cấp phối đá dăm là bao nhiêu?', '3 mm', '5 mm', '7 mm', '10 mm', 2, '2022-03-28 07:48:25', '2022-03-28 07:48:25'),
(432, 2, 1, 'Để xác định giới hạn dẻo và giới hạn chảy của cấp phối thiên nhiên, tiến hành thí nghiệm với phần vật liệu lọt sàng nào dưới đây?', 'Sàng 2,36 mm', 'Sàng 4,75 mm', 'Sàng 0,425 mm', 'Sàng 1,18 mm', 3, '2022-03-28 07:48:43', '2022-03-28 07:48:43'),
(433, 2, 1, 'Có thể sử dụng phương pháp nào dưới đây để bảo dưỡng lớp móng cấp phối gia cố xi măng?', 'Tưới nước trực tiếp lên mặt lớp cấp phối gia cố xi măng hàng tuần.', 'Tưới nhũ tương nhựa đường a xít với lượng 0,8 - 1,0 lít/m2', 'Phủ kín 5 cm cát trên bề mặt lớp cấp phối gia cố xi măng và tưới nước giữ cho cát ẩm trong vòng 7 ngày.', 'Đáp án B hoặc C.', 4, '2022-03-28 07:49:08', '2022-03-28 07:49:08'),
(434, 2, 1, 'Khi thi công mặt đường thấm nhậm nhựa, quy định về nhiệt độ đối với nhựa đường 60/70 trước khi phun tưới là bao nhiêu?', '150°C ± 10°C', '160°C ± 10°C', '170°C ± 10°C', '180°C ± 10°C', 2, '2022-03-28 07:49:22', '2022-03-28 07:49:22'),
(435, 2, 1, 'Nhiệt độ không khí tối thiểu cho phép thi công mặt đường láng nhựa nóng là bao nhiêu?', '0° C', '5° C', '10° C', '15° C', 4, '2022-03-28 07:49:46', '2022-03-28 07:49:46'),
(436, 2, 1, 'Có thể sử dụng phương pháp nào dưới đây để kiểm tra phục vụ cho công tác nghiệm thu độ nhám của mặt đường bê tông nhựa?', 'Phương pháp sử dụng con lắc Anh.', 'Phương pháp rắc cát.', 'Phương pháp dùng thiết bị MTM.', 'Phương pháp đo cự li hãm xe.', 2, '2022-03-28 07:50:03', '2022-03-28 07:50:03'),
(437, 2, 1, 'Để xác định độ chặt của bê tông nhựa ở hiện trường, có thể sử dụng phương pháp nào?', 'Đem so sánh khối lượng thể tích của mẫu khoan ở hiện trường và mẫu đúc trong phòng thí nghiệm từ hỗn hợp lấy ở trạm ở lý trình tương ứng.', 'Phương pháp dùng phễu rót cát.', 'Phương pháp đồng vị phóng xạ.', 'Tất cả các phương pháp trên.', 1, '2022-03-28 07:51:04', '2022-03-28 07:51:04'),
(438, 2, 1, 'Khi thi công bằng công nghệ ván khuôn trượt, độ sụt yêu cầu của hỗn hợp bê tông xi măng là bao nhiêu?', '10 - 20 mm', '20 - 30 mm', '20 - 40 mm', '40 - 60 mm', 1, '2022-03-28 07:51:19', '2022-03-28 07:51:19'),
(439, 2, 1, 'Thí nghiệm rắc cát dùng để xác định chỉ tiêu nào dưới đây?', 'Độ góc cạnh của cát.', 'Độ bằng phẳng.', 'Độ nhám.', 'Độ chặt của vật liệu.', 3, '2022-03-28 07:51:34', '2022-03-28 07:52:55'),
(440, 2, 1, 'Công việc nào sau đây không thuộc nội dung công tác hoàn thiện?', 'Khôi phục lại các mốc đường chuyền các cấp, cọc tim tuyến.', 'Sửa chữa những chỗ thừa, thiếu bề rộng, độ cao của nền đường.', 'Gọt mái đào, vỗ lại mái đắp chuẩn bị cho công tác gia cố nếu cần thiết.', 'Hoàn chỉnh rãnh thoát nước, gọt mui luyện của nền đường.', 1, '2022-03-28 07:51:49', '2022-03-28 07:52:37'),
(441, 2, 1, 'Khi đào cấp thì kích thước cấp phụ thuộc yếu tố nào?', 'Phương pháp thi công thủ công hay cơ giới.', 'Phương tiện đầm lèn.', 'Cả hai đáp án A và B.', 'Loại đất của nền đất thiên nhiên.', 3, '2022-03-28 07:52:07', '2022-03-28 07:52:24'),
(442, 2, 1, 'Nguyên tắc khi lấy mẫu để kiểm tra chất lượng đầm nén nền đường cần lấy ở những vị trí nào?', 'Ở mép đường, nền đắp đầu cầu, hai bên sườn cống, lưng tường chắn.', 'Ở những chỗ đại diện và những nơi đặc biệt quan trọng.', 'Phân bố đều trên mặt bằng và mặt cắt công trình, cứ mỗi lớp đắp lấy một đợt mẫu.', 'Cả đáp án B và C.', 4, '2022-03-28 07:53:34', '2022-03-28 07:53:34'),
(443, 2, 1, 'Mái đường cần được gia cố trong trường hợp nào?', 'Nền đắp cao trên 1m hoặc dưới 1m nhưng dùng đất không tốt.', 'Nền đường đắp cao trên 6 m và sử dụng đất đắp không tốt.', 'Nền đường bị ảnh hưởng của dòng nước chảy, đường qua đồng chiêm trũng.', 'Cả hai đáp án A và đáp án C.', 4, '2022-03-28 07:53:57', '2022-03-28 07:53:57'),
(444, 2, 1, 'Những tiêu chí có thể được dùng để kiểm tra chất lượng đất đắp là gì?', 'Độ chặt yêu cầu.', 'Thành phần hạt so với thiết kế.', 'Hệ số thấm, sức kháng trượt của vật liệu và mức độ co ngót khi đầm nén.', 'Cả ba đáp án trên.', 4, '2022-03-28 07:54:15', '2022-03-28 07:54:15'),
(445, 2, 1, 'Ở khu vực đồng bằng, nếu nền đắp dưới 2 m và dốc ngang là 5% thì rãnh dọc được đào như thế nào?', 'Ở phía thấp và mép rãnh cách chân đường tối thiểu 1 m.', 'Ở phía cao và mép rãnh cách chân đường tối thiểu 1 m.', 'Ở cả hai bên và mép rãnh cách chân đường tối thiểu 0,5 m.', 'Đáp án A hoặc đáp án B', 2, '2022-03-28 07:54:34', '2022-03-28 07:54:34'),
(446, 2, 1, 'Khi thiết kế nổ mìn gần các công trình, thiết bị thì phương pháp nổ mìn nào là thích hợp nhất?', 'Nổ mìn vi sai hoặc nổ định hướng.', 'Nổ mìn ốp hoặc nổ mìn nông.', 'Nổ mìn buồng.', 'Cả hai đáp án A và B.', 1, '2022-03-28 07:54:56', '2022-03-28 07:54:56'),
(447, 2, 1, 'Sai lệch về độ ẩm của đất đắp so với độ ẩm tốt nhất dao động trong khoảng nào để khi đắp đất đạt được khối lượng thể tích khô lớn nhất?', 'Đối với đất dính 10%; đối với đất không dính 20% của độ ẩm tốt nhất.', 'Đối với đất dính 20%; đối với đất không dính 10% của độ ẩm tốt nhất.', '10% không phân biệt loại đất.', '20% không phân biệt loại đất.', 1, '2022-03-28 07:59:24', '2022-03-28 07:59:24'),
(448, 2, 1, 'Mục đích của công tác đầm thí nghiệm trước khi thi công đại trà là để xác định được:', 'Loại máy đầm hiệu quả nhất của đơn vị thi công.', 'Áp suất đầm, số lần đầm, chiều dầy lớp đất, độ ẩm tốt nhất và độ ẩm khống chế.', 'Chiều dầy tối đa của lớp đất đầm nén tương ứng với loại máy đầm.', 'Cả ba đáp án trên.', 2, '2022-03-28 07:59:58', '2022-03-28 07:59:58'),
(449, 2, 1, 'Nền đường sau khi thi công xong xuất hiện vết nứt, trường hợp nào vẫn được nghiệm thu?', 'Nứt nẻ nhỏ, vết nứt ngắn, đứt đoạn không có hướng nhất định.', 'Nứt dải liên tục theo tim hoặc các hướng khác.', 'Mặt bị dộp (bóc bánh đa).', 'Không có trường hợp nào được nghiệm thu trong ba đáp án trên.', 1, '2022-03-28 08:00:20', '2022-03-28 08:00:20'),
(450, 2, 1, 'Khi kiểm tra nghiệm thu độ bằng phẳng mặt nền đường yêu cầu khe hở dưới đáy thước không được vượt quá trị số nào?', '3 cm', '2 cm đối với nền đất và 3-5cm đối với nền đá', '3-5 cm đối với nền đất và 2cm đối với nền đá từ cấp 4 đến cấp 1', '2 cm đối với nền đất và 3-5cm đối với nền đá từ cấp 4 đến cấp 1', 4, '2022-03-28 08:00:34', '2022-03-28 08:00:34'),
(451, 2, 1, 'Khi hỗn hợp bê tông bị mất độ sụt quá nhanh, TVGS cần kiểm tra nguyên nhân nào?', 'Nhiệt độ XM và cốt liệu cao.', 'Nguồn vật liệu thay đổi so với vật liệu đã làm thí nghiệm xác định cấp phối.', 'Cách trộn phụ gia hóa dẻo không phù hợp.', 'Cả 3 nguyên nhân trên.', 4, '2022-03-28 08:00:51', '2022-03-28 08:00:51'),
(452, 2, 1, 'Khi thi công kết cấu nhịp BTCT ứng suất trước, nếu sử dụng bê tông có phụ gia hóa dẻo và phát triển nhanh cường độ, sau khi đổ bê tông bao lâu có thể tiến hành căng cốt thép ứng suất trước?', '3 - 4 ngày.', '7 ngày.', '14 ngày.', 'Tùy theo kết quả thí nghiệm và theo thiết kế', 4, '2022-03-28 08:01:04', '2022-03-28 08:01:04'),
(453, 2, 1, 'Khi chọn phương pháp lao lắp kết cấu nhịp cầu BTCT, cần xem xét yếu tố nào dưới đây?', 'Chiều dài nhịp, trọng lượng khối dầm cần cẩu lắp.', 'Số lượng nhịp.', 'Địa hình, địa chất, thủy văn.', 'Cả 3 yếu tố trên.', 4, '2022-03-28 08:01:21', '2022-03-28 08:01:21'),
(454, 2, 1, 'Trong các yếu tố dưới đây, yếu tố nào không ảnh hưởng đến độ võng của kết cấu nhịp cầu dầm BTDUL thi công theo công nghệ đúc hẫng cân bằng?', 'Tải trọng xe đúc và trọng lượng các đốt dầm.', 'Lực căng các thanh neo đốt dầm K0 vào đỉnh trụ.', 'Lực căng cốt thép ứng suất trước trong dầm.', 'Nhiệt độ môi trường, từ biến và co ngót của bê tông.', 2, '2022-03-28 08:01:36', '2022-03-28 08:01:36'),
(455, 2, 1, 'Phương pháp căng đồng thời tất cả các bó cốt thép ứng suất trước có thể áp dụng cho trường hợp nào dưới đây?', 'Chế tạo các cấu kiện BTCT ƯST lắp ghép theo phương pháp căng trước.', 'Chế tạo các cấu kiện BTCT ƯST lắp ghép theo phương pháp căng sau.', 'Thi công kết cấu nhịp cầu BTCT ƯST theo công nghệ đúc dầm trên hệ giàn giáo và ván khuôn di động.', 'Thi công kết cấu nhịp cầu BTCT ƯST theo công nghệ đúc đẩy.', 1, '2022-03-28 08:01:50', '2022-03-28 08:01:50'),
(456, 2, 1, 'Nhà thầu biên soạn Quy trình thi công một hạng mục xây dựng đã trình Tư vấn giám sát và được thông quNếu xẩy ra sai sót thì phải chịu trách nhiệm:', 'Nhà thầy xây dựng.', 'Tư vấn giám sát đã duyệt Quy trình đó.', 'Cả đáp án A và B.', 'Chủ đầu tư.', 3, '2022-03-28 08:02:24', '2022-03-28 08:02:24'),
(457, 2, 1, 'Tải trọng thử tải bằng bao nhiêu phần trăm tải trọng tác dụng lên kết cấu phụ tạm:', '30%', '70%', '100%', '125%', 4, '2022-03-28 08:02:38', '2022-03-28 08:02:38'),
(458, 2, 1, 'Nhà thầu dùng Giá lao cầu tự chế và Cần cầu nổi tự chế trên hệ nổi để lao cầu. Ai có quyền kiểm tra và cho phép sử dụng Giá lao cầu và Hệ cẩu nổi này:', 'Tư vấn giám sát.', 'Cục Đăng kiểm Bộ GTVT.', 'Sở Xây dựng địa phương.', 'Chủ đầu tư.', 2, '2022-03-28 08:02:56', '2022-03-28 08:02:56'),
(459, 2, 1, 'Thời điểm phù hợp nhất để hạ dầm cầu lên gối là lúc nào:', 'Bất cứ lúc nào đã chuẩn bị xong.', 'Sáng sớm hoặc ban đêm khi nhiệt độ thấp nhất trong ngày.', 'Giữa trưa hoặc lúc nhiệt độ cao nhất trong ngày.', 'Lúc nhiệt độ gần với nhiệt độ trung bình năm.', 4, '2022-03-28 08:03:12', '2022-03-28 08:03:12'),
(460, 2, 1, 'Thời điểm nào là hợp lý nhất để đo kiểm tra cao độ các đốt kết cấu nhịp đang đúc hẫng và điều chỉnh ván khuôn đốt đúc tiếp theo:', 'Trước khi lắp cốt thép thường của đốt tiếp theo.', 'Sau khi lắp cốt thép thường của đốt tiếp theo, ngay trước khi đổ bê tông đốt tiếp theo.', 'Trước khi lắp cốt thép thường của đốt tiếp theo, vào thời điểm sáng sớm trước khi có nắng.', 'Trước khi lắp cốt thép thường của đốt tiếp theo, vào buổi trưa nắng gắt.', 3, '2022-03-28 08:03:33', '2022-03-28 08:03:33'),
(461, 2, 1, 'Khi bắt buộc phải bố trí điểm dừng đối với bê tông đổ tại chỗ, việc xử lý bề mặt mối nối phải được thực hiện trong khoảng thời gian sau:', 'Trong vòng 2 h.', 'Trong vòng 4 h.', 'Trong vòng 6 h.', 'Trong vòng 9 h.', 1, '2022-03-28 08:03:54', '2022-03-28 08:03:54'),
(462, 2, 1, 'Khi đổ bê tông được chia thành nhiều lớp, việc đầm bê tông phải được thực hiện như sau:', 'Đầm xuyên đến vị trí tiếp giáp giữa 2 lớp vừa đổ và lớp dưới.', 'Đầm xuyên khoảng 5 cm của lớp dưới.', 'Đầm xuyên khoảng 10 cm của lớp dưới.', 'Đầm xuyên vào toàn bộ chiều dày của lớp dưới.', 3, '2022-03-28 08:04:09', '2022-03-28 08:04:09'),
(463, 2, 1, 'Chiều cao cho phép bê tông rơi tự do khi đổ bê tông:', 'Dưới 1 m', 'Dưới 1.5 m', 'Dưới 2 m', 'Dưới 3 m', 2, '2022-03-28 08:04:29', '2022-03-28 08:04:29'),
(464, 2, 1, 'Cho phép lắp dựng các bộ phận kết cấu khác lên trên kết cấu bê tông đổ tại chỗ sau khi cường độ đã đạt:', 'Đạt 50% cường độ thiết kế.', 'Đạt 70% cường độ thiết kế.', 'Đạt 90% cường độ thiết kế.', 'Đạt 100% cường độ thiết kế.', 2, '2022-03-28 08:04:55', '2022-03-28 08:04:55'),
(465, 2, 1, 'Cho phép lắp dựng các bộ phận kết cấu khác lên trên kết bê tông đổ tại chỗ sau khi cường độ đã đạt:', 'Đạt 50% cường độ thiết kế.', 'Đạt 70% cường độ thiết kế.', 'Đạt 90% cường độ thiết kế.', 'Đạt 100% cường độ thiết kế.', 2, '2022-03-28 08:05:12', '2022-03-28 08:05:12'),
(466, 2, 1, 'Công tác hạ cọc tường cừ vào nền đất có thể thực hiện bằng thiết bị như sau:', 'Bằng búa diêzel.', 'Bằng búa hơi.', 'Bằng búa rung.', 'Bằng bất kỳ một trong 3 thiết bị nêu trên.', 3, '2022-03-28 08:05:28', '2022-03-28 08:05:28'),
(467, 2, 1, 'Việc đóng một cọc cừ được coi là hoàn thành khi:', 'Hạ cọc đến cao độ thiết kế.', 'Hạ cọc đến khi đạt độ chối thiết kế.', 'Hạ cọc đến cao độ thiết kế và đạt độ chối thiết kế.', 'Bất kỳ trong 3 trường hợp nêu trên.', 1, '2022-03-28 08:05:46', '2022-03-28 08:05:46'),
(468, 2, 1, 'Việc đổ bê tông dầm mũ tường cừ trong điều kiện một phần luôn bị ngập nước không thể tiến hành được bằng phương pháp như sau:', 'Đúc sẵn bộ phận kết cấu luôn bị ngập.', 'Đổ bê tông dưới nước bằng phương pháp rút ống thẳng đứng.', 'Đổ bê tông dưới nước bằng phương pháp vữa dâng.', 'Chế tạo ván khuôn thép kín cho phần kết cấu ở dưới nước để đổ trong điều kiện khô.', 3, '2022-03-28 08:06:04', '2022-03-28 08:06:04'),
(469, 2, 1, 'TVGS có bắt buộc phải kiểm tra Danh mục các phép thử được phép thực hiện của PTN mà Nhà thầu đệ trình:', 'Không nhất thiết vì công tác kiểm tra chất lượng là trách nhiệm của NT.', 'Không cần thiết, vì PTN đã được cấp dấu LAS thì đương nhiên được thực hiện các phép thử.', 'Nhất thiết phải kiểm tra và so sánh với những phép thử phải thực hiện trong dự án.', 'Nếu PTN đã có chứng chỉ hợp chuẩn, còn hiệu lực và không bị đình chỉ hoạt động thì không cần thiết phải kiểm tra.', 3, '2022-03-28 08:06:28', '2022-03-28 08:06:28'),
(470, 2, 1, 'TVGS xử lý thế nào trong trường hợp: khi đang thực hiện dự án, phát hiện thấy tem hiệu chuẩn của thiết bị thí nghiệm - thử nghiệm đã hết hiệu lực.', 'Không có ý kiến gì vì thiết bị đã được kiểm tra trước khi chấp thuận cho PTN hoạt động trong dự án.', 'Tiếp tục cho làm thí nghiệm, sau đó yêu cầu PTN kiểm tra hiệu chuẩn bổ sung.', 'Không có xử lý gì vì các phép thử trước đây cũng đã tiến hành trên chính thiết bị ấy.', 'Đình chỉ thí nghiệm, yêu cầu PTN mời đơn vị có chức năng đến kiểm tra, hiệu chuẩn lại.', 4, '2022-03-28 08:06:49', '2022-03-28 08:06:49'),
(471, 2, 1, 'TVGS có nhất thiết phải giám sát quá trình lấy mẫu, vận chuyển và bàn giao mẫu cùng với Nhà thầu không?', 'Không nhất thiết, vì TVGS không thể có đủ người để làm các công việc ấy.', 'Bắt buộc, vì công việc này có ảnh hưởng lớn đến tính đúng đắn của phép thử.', 'Chỉ nên đi vài lần đầu, các lần sau có thể để NT tự làm công việc này.', 'Không cần thiết, vì TVGS chỉ cần kiểm tra quá trình thí nghiệm của NT là đủ.', 1, '2022-03-28 08:07:07', '2022-03-28 08:07:07'),
(472, 2, 1, 'Công tác giám sát thi công, yêu cầu về kiểm tra kết quả lao dọc và sang ngang dầm BTCT, Độ sai lệch cho phép đường tim nhịp cầu lao ra so với thiết kế:', 'Không lớn hơn 40mm', 'Không lớn hơn 50mm', 'Không lớn hơn 60mm', 'Không lớn hơn 70mm', 1, '2022-03-28 08:07:25', '2022-03-28 08:07:25'),
(473, 2, 1, 'Các chỉ tiêu cần quan tâm khi chấp nhận chứng chỉ thí nghiệm cốt thép là gì?', 'Giới hạn chảy, giới hạn bền, độ dãn dài, đường kính uốn và góc uốn.', 'Loại, đường kính, giới hạn chảy.', 'Loại, đường kính, giới hạn chảy, giới hạn bền, độ dãn dài, đường kính uốn và góc uốn, tính hàn (khi có mối hàn)', 'Phương án A và B.', 3, '2022-03-28 08:07:44', '2022-03-28 08:07:44'),
(474, 2, 1, 'Trình tự đổ bê tông mặt cắt dầm hộp nào là hợp lý nhất:', 'Bản đáy hộp, 2 góc hộp bên dưới, 2 thành hộp, bản nắp hộp.', 'Bản đáy hộp, 2 thành hộp, bản nắp hộp.', '2 góc hộp bên dưới, bản đáy hộp, 2 thành hộp, bản nắp hộp.', '2 góc hộp bên dưới, 2 thành hộp, bản nắp hộp.', 3, '2022-03-28 08:08:09', '2022-03-28 08:08:09'),
(475, 2, 1, 'Việc thử tải xe đúc hẫng cầu BTCT DUL được thực hiện khi nào:', 'Phương án 1: ngay sau khi chế tạo xong xe đúc tại nhà máy chế tạo.', 'Phương án 2: sau khi lắp ráp hoàn chỉnh xe đúc tại vị trí trên đốt K0 chưa bao gồm phần ván khuôn.', 'Phương án 3: sau khi lắp ráp hoàn chỉnh xe đúc tại vị trí trên đốt K0 bao gồm cả phần ván khuôn.', 'Phương án 4: cả thử tải trong Nhà máy (Phương án 1) và phương án 3.', 4, '2022-03-28 08:08:30', '2022-03-28 08:08:30'),
(476, 2, 1, 'Khi thi công đúc hẫng đốt K0, dùng loại phụ gia nào là đúng:', 'Phụ gia siêu dẻo, siêu giảm nước, tăng cường độ cao sớm.', 'Phụ gia siêu dẻo, siêu giảm nước, kéo dài thời gian ninh kết, tăng cường độ cao.', 'Phụ gia cuốn khí.', 'Phụ gia trợ bơm.', 2, '2022-03-28 08:08:48', '2022-03-28 08:08:48'),
(477, 2, 1, 'Khi thi công đúc hẫng các đốt dầm và đốt hợp long, dùng loại phụ gia nào là đúng:', 'Phụ gia siêu dẻo, siêu giảm nước, tăng cường độ cao sớm.', 'Phụ gia siêu dẻo, siêu giảm nước, kéo dài thời gian ninh kết, tăng cường độ cao.', 'Phụ gia cuốn khí.', 'Phụ gia trợ bơm.', 1, '2022-03-28 08:09:04', '2022-03-28 08:09:04'),
(478, 2, 1, 'Khi thi công đúc đốt hợp long, chọn cấp bê tông thế nào?', 'Giống như cấp bê tông của các đốt đúc hẫng khác.', 'Cao hơn ít nhất 10% so với cấp bê tông của các đốt đúc hẫng khác.', 'Tùy Tư vấn giám sát quyết định.', 'Tùy Chủ đầu tư quyết định.', 1, '2022-03-28 08:09:19', '2022-03-28 08:09:19'),
(479, 2, 1, 'Độ sụt tối thiểu hợp lý của hỗn hợp bê tông khi đúc hẫng là bao nhiêu:', 'Phương án 1: 5 cm', 'Phương án 2: 10 cm', 'Phương án 3: 15 cm', 'Tùy chọn một trong 3 cách nêu trên do Tư vấn giám sát quyết định.', 2, '2022-03-28 08:09:41', '2022-03-28 08:09:41'),
(480, 2, 1, 'Số lượng cọc khoan nhồi cần phải kiểm tra siêu âm trên một công trường cầu là bao nhiêu:', 'Tất cả các cọc.', 'Ít nhất 50% tổng số cọc.', 'Do Tư vấn giám sát quyết định.', 'Kết hợp B và C.', 4, '2022-03-28 08:10:13', '2022-03-28 08:10:13'),
(481, 2, 1, 'Loại vật liệu nào dưới đây có thể sử dụng để đắp nền đường?', 'Đất á cát.', 'Đất bùn, đất than bùn.', 'Đất mùn lẫn hữu cơ có thành phần hữu cơ quá 10%, đất có lẫn cỏ và rễ cây, lẫn rác thải sinh hoạt.', 'Đất có lẫn thành phần muối dễ hòa tan quá 5%', 1, '2022-03-28 08:10:35', '2022-03-28 08:10:35'),
(482, 2, 1, 'Công việc nào sau đây không phải là công tác chuẩn bị thi công nền đường?', 'Khôi phục và cố định các cọc định vị tuyến đường thiết kế.', 'Xử lý mặt nền tự nhiên trước khi đắp nền.', 'Định vi các điểm đặc trưng của nền đường.', 'Dọn dẹp mặt bằng thi công.', 2, '2022-03-28 08:10:56', '2022-03-28 08:10:56'),
(483, 2, 1, 'Mục đích của đoạn thi công thử nghiệm nền đường là gì?', 'Khẳng định các thông số chính của công nghệ đầm nén cần đạt được trong quá trình thi công đại trà.', 'Khẳng định các chỉ tiêu và phương pháp kiểm soát chất lượng trong quá trình thi công.', 'Khẳng định công nghệ và phương án tổ chức thi công.', 'Tất cả các đáp án trên.', 4, '2022-03-28 08:11:18', '2022-03-28 08:11:18'),
(484, 2, 1, 'Phương án đắp đất nào được phép sử dụng để đắp đoạn tiếp giáp giữa mố cầu với nền đường đắp liền kề?', 'Đắp thành từng lớp xiên lấn dần từ phía nền đắp về mố cầu.', 'Đắp thành từng lớp từ dưới lên trên với chiều dày đầm nén từ 20 đến 30 cm.', 'Đắp thành từng lớp từ dưới lên trên với chiều dày đầm nén không quá 20 cm.', 'Đắp thành từng lớp từ dưới lên trên với chiều dày đầm nén từ 30 đến 40 cm.', 3, '2022-03-28 08:12:03', '2022-03-28 08:12:03'),
(485, 2, 1, 'Trong thi công nền đường, đất đào thừa phải đổ ở đâu?', 'Đổ ở một số khu vực nhất định được phép đổ.', 'Đỗ ở sông suối và các vị trí trũng gần tuyến đường đang thi công.', 'Đổ ở sườn dốc phía dưới nền đường đào.', 'Đổ ở khu vực đất canh tác gần tuyến đường đang thi công.', 1, '2022-03-28 08:12:23', '2022-03-28 08:12:23'),
(486, 2, 1, 'Để phục vụ nghiệm thu nền đường cần kiểm tra những nội dung nào dưới đây?', 'Kiểm tra các biên bản đã thực hiện trong quá trình thi công.', 'Kiểm tra các yếu tố hình học của nền đường.', 'Kiểm tra chất lượng công tác gia cố mái taluy nền đường.', 'Tất cả các đáp án trên.', 4, '2022-03-28 08:12:39', '2022-03-28 08:12:39'),
