(529, 2, 1, 'Đường đi của máy đầm như thế nào là đúng yêu cầu kỹ thuật đầm lèn?', 'Theo hướng thẳng góc với trục của công trình và từ ngoài mép vào tim của công trình.', 'Theo hướng thẳng góc với trục của công trình và từ tim ra ngoài mép của công trình.', 'Theo hướng dọc trục của công trình đắp và từ ngoài mép vào tim của công trình.', 'Theo hướng dọc trục của công trình đắp và từ tim ra ngoài mép của công trình.', 3, '2022-03-28 08:26:36', '2022-03-28 08:26:36'),
(530, 2, 1, 'Khi đắp đất hoàn trả lại vào hố móng thì có được phép tận dụng đắt đào để đắp không?', 'Không được phép.', 'Được phép.', 'Được phép tận dụng nếu mỏ đất đắp quá xa.', 'Được phép sử dụng nếu đất đào đảm bảo chất lượng.', 4, '2022-03-28 08:26:55', '2022-03-28 08:26:55'),
(531, 2, 1, 'Với độ dốc của đáy nền đường thì cần phải xử lý đánh cấp trước khi đắp?', '< 10%', '10 % - 20 %', '20 % - 33 %', '> 33 %', 3, '2022-03-28 08:27:09', '2022-03-28 08:27:09'),
