(534, 2, 1, 'Yêu cầu nào là bắt buộc khi tiến hành nổ mìn?', 'Chỉ được nổ mìn ở những khu vực thi công cách xa khu dân cư.', 'Tổ chức bảo quản và cung cấp thuốc nổ an toàn.', 'Báo trước cho cơ quan địa phương, nhân dân và giải thích các tín hiệu, báo hiệu.', 'Cả hai đáp án B và C.', 4, '2022-03-28 08:28:10', '2022-03-28 08:28:10'),
(535, 2, 1, 'Công tác nổ phá được coi là không đạt yêu cầu khi khối lượng đất đá nổ phá ra thực tế nhỏ hơn bao nhiêu % so với khối lượng thiết kế?', '20 %', '30 %', '50 %', '80 %', 2, '2022-03-28 08:28:25', '2022-03-28 08:28:25'),
(536, 2, 1, 'Khi thi công nền đường đắp thì chiều dầy lớp đất đắp được quy định như thế nào?', '20 cm.', '30 cm.', 'Được quy định trong quy trình tùy theo từng loại đất.', 'Tùy theo điều kiện thi công, loại đất, loại máy đầm, độ chặt yêu cầu.', 4, '2022-03-28 08:28:43', '2022-03-28 08:28:43'),
(537, 2, 1, 'Khi bắt buộc phải thi công nền đường trong mùa mưa thì cần phải thực hiện các biện pháp nào sau đây?', 'Đắp đất theo từng lớp đất nghiêng ra ngoài.', 'Thoát nước tốt bãi, hố lấy đất.', 'Bố trí diện thi công hẹp, quá trình đào, vận chuyển, san đầm đất không quá 1 buổi làm việc.', 'Cả 3 đáp án trên.', 4, '2022-03-28 08:29:07', '2022-03-28 08:29:07'),
(538, 2, 1, 'Khi bạt mái công trình đất, có thể dùng máy ủi và máy san để bạt mái trong trường hợp nào?', 'Chiều cao đắp < 3m; độ dốc mái ≤ 1:3', 'Chiều cao đắp > 3m; độ dốc mái ≤ 1:3', 'Chiều cao đắp < 3m; độ dốc mái > 1:3', 'Chiều cao đắp > 3m; độ dốc mái > 1:3', 2, '2022-03-28 08:29:22', '2022-03-28 08:29:22'),
(539, 2, 1, 'Khi đắp đất trong vùng đầm lầy cần đặc biệt lưu ý đến những công việc nào sau đây?', 'Chuẩn bị nền móng: chặt cây, đào gốc, vớt rác rong rêu.', 'Bóc lớp than bùn trong phạm vi đáy móng đến lớp đất nguyên thổ, vét sạch hết bùn.', 'Theo dõi trạng thái của nền đắp khi máy thi công đi lại.', 'Cả 3 đáp án trên.', 4, '2022-03-28 08:29:42', '2022-03-28 08:29:42'),
(540, 1, 0, 'Theo quy định của pháp luật về xây dựng, hoạt động xây dựng gồm các công việc nào dưới đây?', 'a. Lập quy hoạch xây dựng, lập dự án đầu tư xây dựng công trình, khảo sát xây dựng', 'b. Thiết kế xây dựng, thi công xây dựng, giám sát xây dựng, quản lý dự án, lựa chọn nhà thầu, nghiệm thu, bàn giao đưa công trình vào khai thác sử dụng', 'c. Bảo hành, bảo trì công trình xây dựng và hoạt động khác có liên quan đến xây dựng công trình', 'd. Các công việc nêu tại điểm a, b và c', 4, '2022-03-28 18:21:37', '2022-03-28 18:23:27'),
(541, 1, 1, 'Các hoạt động đầu tư xây dựng chịu sự điều chỉnh của pháp luật nào dưới đây?', 'Pháp luật về xây dựng', 'Pháp luật về xây dựng và pháp luật về đầu tư công', 'Pháp luật về xây dựng và pháp luật về đấu thầu', 'Pháp luật về xây dựng và pháp luật khác có liên quan', 4, '2022-03-28 18:24:24', '2022-03-28 18:24:24'),
(542, 1, 1, 'Theo quy định của pháp luật về xây dựng, hoạt động xây dựng gồm các công việc nào dưới đây?', 'Lập quy hoạch xây dựng, lập dự án đầu tư xây dựng công trình, khảo sát xây dựng', 'Thiết kế xây dựng, thi công xây dựng, giám sát xây dựng, quản lý dự án, lựa chọn nhà thầu, nghiệm thu, bàn giao đưa công trình vào khai thác sử dụng', 'Bảo hành, bảo trì công trình xây dựng và hoạt động khác có liên quan đến xây dựng công trình', 'Các công việc nêu tại điểm a, b và c', 4, '2022-03-28 18:24:59', '2022-03-28 18:24:59'),
(543, 1, 1, 'Dự án đầu tư xây dựng sử dụng vốn ODA thì thực hiện theo quy định nào?', 'Theo quy định của Hiệp định vay vốn mà Việt Nam ký kết với tổ chức cho vay', 'Theo pháp luật về xây dựng', 'Theo quy định của Hiệp định vay vốn mà Việt Nam ký kết với tổ chức cho vay, các quy định của pháp luật về xây dựng và pháp luật khác liên quan', 'Theo quy định của Hiệp định vay vốn mà Việt Nam ký kết với tổ chức cho vay và các quy định của pháp luật về xây dựng', 3, '2022-03-28 18:25:45', '2022-03-28 18:25:45'),
(544, 1, 1, 'Việc áp dụng tiêu chuẩn, quy chuẩn kỹ thuật trong hoạt động đầu tư xây dựng phải tuân thủ theo những nguyên tắc nào?', 'Tuân thủ Quy chuẩn kỹ thuật quốc gia', 'Tiêu chuẩn được viện dẫn trong quy chuẩn kỹ thuật hoặc văn bản quy phạm pháp luật khác có liên quan', 'Tiêu chuẩn được áp dụng trong hoạt động đầu tư xây dựng theo nguyên tắc tự nguyện', 'Tất cả các quy định tại a, b và c', 4, '2022-03-28 18:26:17', '2022-03-28 18:26:17'),
(545, 1, 1, 'Việc giám sát đánh giá đầu tư đối với các dự án đầu tư xây dựng sử dụng vốn đầu tư công, vốn nhà nước ngoài đầu tư công căn cứ vào các quy định nào?', 'Pháp luật về xây dựng', 'Pháp luật về đầu tư công', 'Pháp luật về đầu tư công và pháp luật về xây dựng', 'Pháp luật về đầu tư công, pháp luật về xây dựng và pháp luật khác có liên quan', 4, '2022-03-28 18:26:43', '2022-03-28 18:26:43'),
(546, 1, 1, 'Những chủ thể nào bắt buộc phải mua bảo hiểm công trình trong thời gian thi công xây dựng đối với công trình có ảnh hưởng đến an toàn cộng đồng, môi trường, công trình có yêu cầu kỹ thuật đặc thù, điều kiện thi công xây dựng phức tạp?', 'Chủ đầu tư xây dựng công trình', 'Nhà thầu thi công xây dựng công trình', 'Nhà thầu tư vấn thiết kế xây dựng công trình', 'Cả 3 chủ thể nêu tại a, b và c', 1, '2022-03-28 18:27:20', '2022-03-28 18:27:20'),
(547, 1, 1, 'Nội dung nào sau đây là đúng quy định về trách nhiệm mua bảo hiểm bắt buộc trong hoạt động đầu tư xây dựng?', 'Chủ đầu tư mua bảo hiểm công trình trong thời gian xây dựng đối với công trình có ảnh hưởng đến an toàn cộng đồng, môi trường, công trình có yêu cầu kỹ thuật đặc thù, điều kiện thi công xây dựng phức tạp', 'Nhà thầu tư vấn mua bảo hiểm trách nhiệm nghề nghiệp tư vấn đầu tư xây dựng đối với công việc khảo sát xây dựng, thiết kế xây dựng của công trình xây dựng từ cấp II trở lên', 'Cả nội dung a và b đều đúng', 'Các nội dung trên đều sai', 3, '2022-03-28 18:28:05', '2022-03-28 18:28:05'),
(548, 1, 1, 'Dự án đầu tư xây dựng được phân thành loại và nhóm A, B, C đối với các nguồn vốn nào?', 'Nguồn vốn đầu tư công', 'Nguồn vốn nhà nước ngoài đầu tư công', 'Nguồn vốn khác không phải nguồn vốn nêu tại điểm a và b', 'Tất cả các nguồn vốn nêu tại điểm a, b và c', 4, '2022-03-28 18:28:33', '2022-03-28 18:28:33'),
(549, 1, 1, 'Đối với công trình cấp II và cấp III, quy định về thời gian thẩm định thiết kế xây dựng triển khai sau thiết kế cơ sở của cơ quan chuyên môn về xây dựng tính từ ngày nhận đủ hồ sơ hợp lệ như thế nào là đúng sau đây?', 'Không quá 40 ngày', 'Không quá 30 ngày', 'Không quá 25 ngày', 'Không quá 20 ngày', 2, '2022-03-28 18:28:59', '2022-03-28 18:28:59'),
(550, 1, 1, 'Theo quy định của pháp luật về xây dựng, những công tác gì được liệt kê dưới đây thuộc giai đoạn chuẩn bị dự án?', 'Quyết định hoặc chấp thuận chủ trương đầu tư', 'Lập, thẩm định, phê duyệt Báo cáo nghiên cứu khả thi đầu tư xây dựng', 'Xin cấp phép xây dựng', 'Bao gồm công tác a và b', 4, '2022-03-28 18:29:29', '2022-03-28 18:29:29'),
(551, 1, 1, 'Theo quy định của pháp luật về xây dựng, công tác nào sau đây ở giai đoạn thực hiện dự án?', 'Thanh toán khối lượng xây lắp hoàn thành', 'Giám sát thi công xây dựng', 'Vận hành, chạy thử; nghiệm thu hoàn thành công trình xây dựng', 'Tất cả các công tác trên', 4, '2022-03-28 18:30:00', '2022-03-28 18:30:00'),
(552, 1, 1, 'Theo quy định của pháp luật về xây dựng, công trình xây dựng được phân cấp phục vụ quản lý hoạt động đầu tư xây dựng trên cơ sở các căn cứ nào?', 'Quy mô, mức độ quan trọng, thông số kỹ thuật của công trình', 'Thời hạn sử dụng, vật liệu', 'Yêu cầu xây dựng công trình', 'Tất cả các căn cứ trên', 1, '2022-03-28 18:30:27', '2022-03-28 18:30:27'),
(553, 1, 1, 'Việc phân loại công trình xây dựng theo quy định của pháp luật về xây dựng trên cơ sở tiêu chí nào?', 'Theo tính chất kết cấu và công năng sử dụng công trình', 'Theo kiến trúc công trình', 'Do người quyết định đầu tư quy định', 'Do chủ đầu tư quy định', 1, '2022-03-28 18:31:02', '2022-03-28 18:31:02'),
(554, 1, 1, 'Những dự án đầu tư xây dựng nào có thể được phân chia thành các dự án thành phần hoặc phân kỳ đầu tư để quản lý thực hiện như một dự án độc lập?', 'Dự án quan trọng quốc gia, dự án nhóm A', 'Khi mỗi dự án thành phần có thể vận hành, khai thác độc lập', 'Dự án nhóm b, c', 'Cả 3 phương án a, b và c', 2, '2022-03-28 18:32:08', '2022-03-28 18:32:08'),
(555, 1, 1, 'Dự án đầu tư xây dựng phải đáp ứng các yêu cầu nào dưới đây?', 'Phù hợp với quy hoạch và kế hoạch sử dụng đất tại địa phương nơi có dự án đầu tư xây dựng', 'Có phương án công nghệ và phương án thiết kế xây dựng phù hợp', 'Bảo đảm chất lượng, an toàn trong xây dựng và bảo vệ môi trường', 'Cả 3 phương án trên', 4, '2022-03-28 18:32:49', '2022-03-28 18:32:49'),
(556, 1, 1, 'Các dự án đầu tư xây dựng có quy mô nhóm nào yêu cầu phải lập Báo cáo nghiên cứu tiền khả thi để trình cấp có thẩm quyền quyết định hoặc chấp thuận chủ trương đầu tư?', 'Dự án quan trọng quốc gia', 'Dự án PPP theo quy định của pháp luật về đầu tư theo phương thức đối tác công tư', 'Dự án nhóm A sử dụng vốn đầu tư công', 'Cả 3 phương án trên', 4, '2022-03-28 18:33:44', '2022-03-28 18:33:44'),
(557, 1, 1, 'Trừ trường hợp người quyết định đầu tư có yêu cầu lập Báo cáo nghiên cứu khả thi đầu tư xây dựng, dự án đầu tư xây dựng công trình chỉ cần yêu cầu lập Báo cáo kinh tế - kỹ thuật đầu tư xây dựng gồm trường hợp nào sau đây?', 'Dự án đầu tư xây dựng sử dụng cho mục đích tôn giáo', 'Dự án đầu tư xây dựng mới, sửa chữa, cải tạo, nâng cấp có tổng mức đầu tư dưới 15 tỷ đồng (không bao gồm tiền sử dụng đất)', 'Cả trường hợp a và b', 'Không bao gồm a và b', 3, '2022-03-28 18:34:11', '2022-03-28 18:34:11'),
(558, 1, 1, 'Đối với dự án đầu tư xây dựng sử dụng vốn nhà nước ngoài đầu tư công, cơ quan chuyên môn về xây dựng thẩm định đối với dự án nào sau đây?', 'Dự án từ nhóm B trở lên', 'Dự án có công trình ảnh hưởng lớn đến an toàn, lợi ích cộng đồng thuộc chuyên ngành quản lý', 'Đáp án a và b đúng', 'Các dự án trên địa bàn phụ trách', 3, '2022-03-28 18:35:05', '2022-03-28 18:35:05'),
(559, 1, 1, 'Đối với dự án đầu tư xây dựng sử dụng vốn đầu tư công, cơ quan chuyên môn về xây dựng dựng thuộc Bộ quản lý công trình xây dựng chuyên ngành thẩm định đối với dự án nào sau đây?', 'Dự án nhóm A; dự án nhóm B do người đứng đầu cơ quan trung ương quyết định đầu tư hoặc phân cấp, ủy quyền quyết định đầu tư', 'Dự án được đầu tư xây dựng trên địa bàn hành chính từ 02 tỉnh trở lên', 'Dự án do Thủ tướng Chính phủ giao', 'Bao gồm tất cả các dự án trên', 4, '2022-03-28 18:37:14', '2022-03-28 18:37:14'),
(560, 1, 1, 'Đối với dự án quan trọng quốc gia có công nghệ hạn chế chuyển giao sử dụng vốn đầu tư công thì cơ quan nào sau đây thẩm định thiết kế công nghệ?', 'Sở Xây dựng', 'Cơ quan chuyên môn trực thuộc người quyết định đầu tư', 'Chủ đầu tư xây dựng', 'Hội đồng thẩm định nhà nước', 4, '2022-03-28 18:37:44', '2022-03-28 18:37:44'),
(561, 1, 1, 'Đối với các dự án đầu tư xây dựng điều chỉnh, cơ quan chuyên môn về xây dựng thẩm định Báo cáo nghiên cứu khả thi điều chỉnh trong trường hợp nào sau đây?', 'Khi điều chỉnh dự án có thay đổi về mục tiêu, quy mô sử dụng đất, quy mô đầu tư xây dựng', 'Khi điều chỉnh làm tăng tổng mức đầu tư dự án đối với dự án sử dụng vốn đầu tư công, dự án sử dụng vốn nhà nước ngoài đầu tư công', 'Cả trường hợp a và b', 'Không bao gồm các trường hợp ở trên', 3, '2022-03-28 18:38:11', '2022-03-28 18:38:11'),
(562, 1, 1, 'Đối với nguồn vốn khác thì cơ quan chuyên môn về xây dựng thuộc các Bộ quản lý công trình xây dựng chuyên ngành thẩm định những dự án nào?', 'Dự án đầu tư xây dựng có công trình cấp đặc biệt, cấp I và cấp II, dự án được đầu tư xây dựng trên địa bàn hành chính của 02 tỉnh trở lên', 'Dự án do Quốc hội, Thủ tướng Chính phủ chấp thuận chủ trương đầu tư; dự án nhóm A; dự án đầu tư xây dựng có công trình cấp đặc biệt, cấp I; dự án được đầu tư xây dựng trên địa bàn hành chính của 02 tỉnh trở lên', 'Dự án đầu tư xây dựng có công trình từ cấp III trở lên và dự án được đầu tư xây dựng trên địa bàn hành chính của 02 tỉnh trở lên', 'Chỉ dự án nhóm A', 2, '2022-03-28 18:40:50', '2022-03-28 18:40:50'),
(563, 1, 1, 'Cơ quan chuyên môn về xây dựng thẩm định Báo cáo nghiên cứu khả thi đầu tư xây dựng đối với các dự án nào sau đây?', 'Dự án sử dụng vốn đầu tư công; Dự án đầu tư xây dựng có quy mô từ nhóm B trở lên hoặc có công trình ảnh hưởng lớn đến an toàn, lợi ích cộng đồng sử dụng vốn nhà nước ngoài đầu tư công', 'Dự án PPP; Dự án đầu tư xây dựng có quy mô lớn hoặc có công trình ảnh hưởng lớn đến an toàn, lợi ích cộng đồng sử dụng vốn khác', 'Cả a và b', 'Không bao gồm a và b', 3, '2022-03-28 18:41:19', '2022-03-28 18:41:19'),
(564, 1, 1, 'Đối với dự án sử dụng vốn đầu tư công, dự án sử dụng vốn nhà nước ngoài đầu tư công chỉ cần lập Báo cáo kinh tế - kỹ thuật, người quyết định đầu tư thẩm định những nội dung nào sau đây?', 'Sự phù hợp về quy hoạch, mục tiêu, quy mô đầu tư và các yêu cầu khác được xác định trong quyết định hoặc chấp thuận chủ trương đầu tư xây dựng', 'Sự đáp ứng yêu cầu của thiết kế bản vẽ thi công về bảo đảm an toàn công trình và biện pháp bảo đảm an toàn công trình lân cận', 'Việc lập tổng mức đầu tư xây dựng, xác định giá trị tổng mức đầu tư xây dựng', 'Tất cả các nội dung ở trên', 4, '2022-03-28 18:41:48', '2022-03-28 18:41:48'),
(565, 1, 1, 'Hợp đồng trong hoạt động xây dựng theo hình thức giá có những loại nào?', 'Hình thức trọn gói, hình thức theo thời gian', 'Hình thức điều chỉnh giá, Hình thức theo đơn giá cố định', 'Bao gồm các hình thức nêu tại a và b', 'Không có hình thức nào nêu tại a và b', 3, '2022-03-28 18:42:15', '2022-03-28 18:42:15'),
(566, 1, 1, 'Chức năng, nhiệm vụ của Ban QLDA chuyên ngành, ban QLDA khu vực do ai quy định?', 'Người có thẩm quyền quyết định đầu tư', 'Người quyết định thành lập Ban QLDA chuyên ngành, ban QLDA khu vực', 'Cơ quan chuyên môn về xây dựng', 'Chủ đầu tư', 2, '2022-03-28 18:42:45', '2022-03-28 18:42:45');
INSERT INTO `cauhois` (`idcauhoi`, `linhvuc`, `trangthai`, `cauhoi`, `dapan1`, `dapan2`, `dapan3`, `dapan4`, `dapandung`, `created_at`, `updated_at`) VALUES
(567, 1, 1, 'Đối với các dự án đầu tư xây dựng điều chỉnh, cơ quan chuyên môn về xây dựng thẩm định Báo cáo nghiên cứu khả thi điều chỉnh trong trường hợp nào sau đây?', 'Khi điều chỉnh dự án có thay đổi về mục tiêu, quy mô sử dụng đất, quy mô đầu tư xây dựng', 'Khi có thay đổi về chỉ tiêu quy hoạch, kiến trúc của dự án tại quy hoạch chi tiết xây dựng, quy hoạch có tính chất kỹ thuật chuyên ngành khác hoặc quyết định/chấp thuận chủ trương đầu tư được phê duyệt', 'Khi điều chỉnh làm tăng tổng mức đầu tư dự án đối với dự án sử dụng vốn đầu tư công, dự án sử dụng vốn nhà nước ngoài đầu tư công', 'Tất cả các nội dung trên', 4, '2022-03-28 18:43:10', '2022-03-28 18:43:10'),
(568, 1, 1, 'Chủ thể nào phải chịu trách nhiệm chính về an toàn lao động trên công trường?', 'Chủ đầu tư', 'Nhà thầu thi công xây dựng công trình', 'Nhà thầu tư vấn giám sát thi công xây dựng công trình', 'Cả a, b và c', 2, '2022-03-28 18:43:36', '2022-03-28 18:43:36'),
(569, 1, 1, 'Các dự án đầu tư xây dựng thuộc Tập đoàn kinh tế, Tổng công ty nhà nước phải tuân thủ theo các quy định nào?', 'Điều lệ, quy chế hoạt động của Tập đoàn, Tổng công ty', 'Theo quy định Pháp luật về xây dựng, pháp luật về đấu thầu và pháp luật khác liên quan', 'Bao gồm a và b', 'Chỉ tuân thủ quy định của pháp luật về xây dựng', 3, '2022-03-28 18:44:03', '2022-03-28 18:44:03'),
(570, 1, 1, 'Theo quy định của pháp luật về xây dựng, đối với nguồn vốn khác, chủ đầu tư có thể áp dụng hình thức quản lý dự án nào sau đây?', 'Chủ đầu tư sử dụng tư cách pháp nhân của mình và bộ máy chuyên môn trực thuộc có đủ điều kiện, năng lực', 'Chủ đầu tư được thuê tổ chức, cá nhân có đủ điều kiện năng lực', 'Đáp án a và b là đúng', 'Đáp án a và b là sai', 3, '2022-03-28 18:44:29', '2022-03-28 18:44:29'),
(571, 1, 1, 'Theo quy định của pháp luật về xây dựng, đối với các gói thầu sử dụng vốn nhà nước ngoài đầu tư công thì hợp đồng xây dựng được ký kết vào thời điểm nào?', 'Sau khi hoàn thành việc lựa chọn nhà thầu', 'Sau khi hoàn thành việc lựa chọn nhà thầu và kết thúc đàm phán hợp đồng', 'Trước khi khởi công xây dựng công trình', 'Cả 3 phương án a, b và c', 2, '2022-03-28 18:44:54', '2022-03-28 18:44:54'),
(572, 1, 1, 'Theo quy định của pháp luật về xây dựng, đối với các gói thầu sử dụng vốn đầu tư công thì hợp đồng xây dựng được ký kết giữa bên giao thầu và bên nhận thầu bằng hình thức nào?', 'Bằng văn bản thỏa thuận giữa bên giao thầu và bên nhận thầu để thực hiện một phần công việc trong hoạt động đầu tư xây dựng', 'Bằng văn bản thỏa thuận giữa bên giao thầu và bên nhận thầu để thực hiện toàn bộ công việc trong hoạt động đầu tư xây dựng', 'Phương án a hoặc b', 'Cả 2 phương án a và b', 3, '2022-03-28 18:45:26', '2022-03-28 18:45:26'),
(573, 1, 1, 'Theo quy định của pháp luật về xây dựng, đối với các gói thầu sử dụng vốn đầu tư công, trường hợp bên nhận thầu là liên danh các nhà thầu thì khi ký kết hợp đồng xây dựng với bên giao thầu những nhà thầu nào trong liên danh phải cử đại diện hợp pháp của mình để ký hợp đồng?', 'Nhà thầu được liên danh các nhà thầu cử làm đại diện cho liên danh', 'Tất cả các nhà thầu tham gia trong liên danh', 'Phương án a hoặc b', 'Bất kể nhà thầu nào trong liên danh theo yêu cầu của bên giao thầu', 3, '2022-03-28 18:45:59', '2022-03-28 18:45:59'),
(574, 1, 1, 'Theo quy định của pháp luật về xây dựng, đối với các gói thầu sử dụng vốn đầu tư công thì hiệu lực của hợp đồng xây dựng được tính từ thời điểm nào?', 'Từ ngày ký kết hợp đồng', 'Từ ngày bên giao thầu nhận được bảo đảm thực hiện hợp đồng của bên nhận thầu', 'Từ ngày do bên giao thầu và bên nhận thầu thỏa thuận trong hợp đồng', 'Bao gồm cả a, b và c', 3, '2022-03-28 18:46:33', '2022-03-28 18:46:33'),
(575, 1, 1, 'Đối với các gói thầu sử dụng vốn đầu tư công, việc điều chỉnh đơn giá thực hiện hợp đồng chỉ được áp dụng đối với loại hợp đồng nào?', 'Hợp đồng theo đơn giá cố định; hợp đồng theo thời gian', 'Hợp đồng theo đơn giá điều chỉnh, hợp đồng theo thời gian', 'Cả a và b', 'a hoặc b', 2, '2022-03-28 18:47:13', '2022-03-28 18:47:13'),
(576, 1, 1, 'Trước khi ký kết hợp đồng EPC các bên phải thỏa thuận cụ thể những nội dung chủ yếu nào sau đây?', 'Phạm vi công việc dự kiến thực hiện theo hợp đồng EPC; Vị trí xây dựng, hướng tuyến công trình, loại, cấp công trình; quy mô, công suất và phương án sản phẩm được lựa chọn, năng lực khai thác sử dụng', 'Các thông tin về các tài liệu, số liệu về điều kiện tự nhiên, địa chất công trình, địa chất thủy văn, thủy văn của khu vực nơi xây dựng công trình; Các yêu cầu về thiết kế xây dựng và một số thông số thiết kế ban đầu', 'Bao gồm cả nội dung a và b', 'Không bao gồm nội dung a và b', 3, '2022-03-28 18:48:11', '2022-03-28 18:48:11'),
(577, 1, 1, 'Đối với các gói thầu thi công xây dựng sử dụng vốn đầu tư công, tiến độ thực hiện hợp đồng được điều chỉnh trong các trường hợp nào?', 'Trong quá trình thực hiện hợp đồng xảy ra các trường hợp bất khả kháng', 'Do bên giao thầu thay đổi thiết kế hoặc bàn giao mặt bằng không đúng với thỏa thuận trong hợp đồng', 'Đáp án a và b đúng', 'Các trường hợp trên đều không đúng', 3, '2022-03-28 18:48:46', '2022-03-28 18:48:46'),
(578, 1, 1, 'Hợp đồng EPC là loại hợp đồng thực hiện những công việc gì?', 'Thiết kế và thi công xây dựng', 'Thiết kế và cung cấp vật tư, thiết bị', 'Thiết kế - mua sắm vật tư, thiết bị - thi công xây dựng công trình', 'Lập dự án, thiết kế, cung cấp vật tư, thiết bị và thi công xây dựng', 3, '2022-03-28 18:50:50', '2022-03-28 18:50:50'),
(579, 1, 1, 'Đối với hợp đồng EPC ngoài tiến độ thi công cho từng giai đoạn của tổng thầu, nhà thầu còn phải lập tiến độ thực hiện cho những công việc nào dưới đây?', 'Tiến độ cho công việc thiết kế', 'Tiến độ cho công việc cung cấp thiết bị và thi công xây dựng', 'Tiến độ cho công việc thiết kế - mua sắm vật tư, thiết bị - thi công xây dựng công trình', 'Tiến độ cho công việc thiết kế và thi công xây dựng', 3, '2022-03-28 18:51:16', '2022-03-28 18:51:16'),
(580, 1, 1, 'Đối với các gói thầu sử dụng vốn đầu tư công, nhà thầu chính có quyền giao 100% công việc của hợp đồng đã ký kết với bên giao thầu cho nhà thầu phụ không?', 'Có', 'Không', 'Tùy thuộc vào tình hình cụ thể và nhà thầu chính quyết định', 'Do bên giao thầu và bên nhận thầu thỏa thuận', 2, '2022-03-28 18:51:39', '2022-03-28 18:51:39'),
(581, 1, 1, 'Theo quy định của pháp luật Xây dựng hiện hành, nhà thầu nào có trách nhiệm lập biện pháp an toàn cho người và thiết bị thi công công trình trên công trường xây dựng?', 'Nhà thầu thiết kế', 'Nhà thầu thi công xây dựng', 'Chủ đầu tư', 'Tư vấn giám sát thi công xây dựng', 2, '2022-03-28 18:52:51', '2022-03-28 18:52:51'),
(582, 1, 1, 'Hồ sơ trình thẩm định báo cáo nghiên cứu khả thi đầu tư xây dựng không bao gồm tài liệu nào dưới đây?', 'Tờ trình thẩm định báo cáo nghiên cứu khả thi', 'Thiết kế cơ sở của dự án', 'Thiết kế kỹ thuật của dự án', 'Giấy tờ liên quan đến đất đai', 3, '2022-03-28 18:53:22', '2022-03-28 18:53:22'),
(583, 1, 1, 'Công tác nào sau đây không nằm trong giai đoạn thực hiện dự án đầu tư xây dựng?', 'Thẩm định, phê duyệt thiết kế bản vẽ thi công và dự toán', 'Lựa chọn nhà thầu thi công xây dựng', 'Thẩm định, phê duyệt dự án', 'Nghiệm thu công việc xây dựng', 3, '2022-03-28 18:53:47', '2022-03-28 18:53:47'),
(584, 1, 1, 'Đối với các bộ, cơ quan ở trung ương: Ban quản lý dự án chuyên ngành, Ban quản lý dự án khu vực được thành lập theo tiêu chí nào sau đây?', 'Phù hợp với các chuyên ngành thuộc lĩnh vực quản lý', 'Theo yêu cầu về xây dựng cơ sở vật chất, hạ tầng tại các vùng, khu vực', 'Đáp án a hoặc b', 'Đáp án a và b', 3, '2022-03-28 18:54:13', '2022-03-28 18:54:13'),
(585, 1, 1, 'Trường hợp thuê tư vấn quản lý dự án thì nhiệm vụ, quyền hạn của tư vấn QLDA do ai quyết định?', 'Do chủ đầu tư thông qua hợp đồng', 'Do pháp luật quy định', 'Do người quyết định đầu tư', 'Cấp trên của tổ chức tư vấn quản lý dự án', 1, '2022-03-28 18:54:42', '2022-03-28 18:54:42'),
(586, 1, 1, 'Theo quy định của pháp luật xây dựng hiện hành, hợp đồng xây dựng không có hình thức nào dưới đây?', 'Hợp đồng trọn gói', 'Hợp đồng theo tỷ lệ %', 'Hợp đồng theo đơn giá điều chỉnh', 'Hợp đồng theo đơn giá cố định', 2, '2022-03-28 18:56:13', '2022-03-28 18:56:13'),
(587, 1, 1, 'Trong quá trình thực hiện hợp đồng, bên nhận thầu có được thay đổi người đại diện quản lý thực hiện hợp đồng không?', 'Có', 'Không', 'Có nhưng phải được sự chấp thuận của bên giao thầu', 'Cả a, b và c đều không đúng', 3, '2022-03-28 18:56:37', '2022-03-28 18:56:37'),
(588, 1, 1, 'Nguyên tắc và trình tự giải quyết tranh chấp hợp đồng xây dựng được quy định như thế nào sau đây?', 'Tôn trọng các thỏa thuận hợp đồng và các cam kết trong quá trình thực hiện hợp đồng, bảo đảm bình đẳng và hợp tác', 'Các bên hợp đồng có trách nhiệm tự thương lượng giải quyết tranh chấp, trường hợp các bên hợp đồng không tự thương lượng được thì tranh chấp được giải quyết thông qua hòa giải, trọng tài thương mại hoặc tòa án theo quy định của pháp luật', 'Đáp ứng cả a và b', 'Không cần đáp ứng những yêu cầu trên', 3, '2022-03-28 18:57:04', '2022-03-28 18:57:04'),
(589, 1, 1, 'Những cá nhân nào dưới đây không bắt buộc phải có chứng chỉ hành nghề hoạt động xây dựng?', 'Chủ nhiệm thiết kế xây dựng công trình', 'Chủ trì thiết kế bộ môn trong công trình xây dựng', 'Cá nhân giám sát thi công của nhà thầu thi công xây dựng', 'Cán bộ tư vấn giám sát thi công xây dựng', 3, '2022-03-28 18:57:26', '2022-03-28 18:57:26'),
(590, 1, 1, 'Chủ nhiệm thiết kế xây dựng hạng 1 phải đáp ứng các điều kiện gì?', 'Có trình độ đại học thuộc chuyên ngành phù hợp', 'Có thời gian làm công tác thiết kế xây dựng tối thiểu 7 năm', 'Đã làm chủ nhiệm thiết kế phần việc thuộc lĩnh vực phù hợp ít nhất 01 công trình từ cấp I trở lên hoặc 02 công trình từ cấp II trở lên', 'Cả a, b và c', 4, '2022-03-28 18:58:02', '2022-03-28 18:58:02'),
(591, 1, 1, 'Điều kiện nào dưới đây không yêu cầu đối với giám đốc QLDA hạng I?', 'Đã là chủ nhiệm lập dự án ít nhất 1 dự án nhóm A hoặc 2 dự án nhóm B', 'Có trình độ đại học chuyên ngành xây dựng', 'Có thời gian tham gia thiết kế hoặc thi công xây dựng tối thiểu 7 năm', 'Đã có chứng chỉ hành nghề thiết kế xây dựng hạng I hoặc giám sát thi công xây dựng hạng I', 1, '2022-03-28 18:59:09', '2022-03-28 18:59:09'),
(592, 1, 1, 'Chủ thể nào sau đây có trách nhiệm lập bản vẽ hoàn công công trình?', 'Chủ đầu tư', 'Nhà thầu thiết kế xây dựng', 'Nhà thầu thi công xây dựng', 'Nhà thầu tư vấn giám sát thi công xây dựng', 3, '2022-03-28 18:59:45', '2022-03-28 18:59:45'),
(593, 1, 1, 'Chủ thể nào có trách nhiệm lập tiến độ chi tiết thi công xây dựng công trình?', 'Chủ đầu tư', 'Nhà thầu thiết kế xây dựng công trình', 'Nhà thầu thi công xây dựng công trình', 'Nhà thầu tư vấn giám sát thi công xây dựng', 3, '2022-03-28 19:00:08', '2022-03-28 19:00:08'),
(594, 1, 1, 'Đối với công trình xây dựng sử dụng vốn đầu tư công, công trình xây dựng sử dụng vốn nhà nước ngoài đầu tư công, chủ đầu tư thẩm định thiết kế xây dựng triển khai sau thiết kế cơ sở đối với các nội dung nào sau đây?', 'Sự đáp ứng yêu cầu của thiết kế xây dựng với nhiệm vụ thiết kế, quy định tại hợp đồng thiết kế và quy định của pháp luật có liên quan', 'Sự phù hợp của thiết kế xây dựng với yêu cầu về dây chuyền và thiết bị công nghệ (nếu có)', 'Việc lập dự toán xây dựng công trình; sự phù hợp của giá trị dự toán xây dựng công trình với giá trị tổng mức đầu tư xây dựng; xác định giá trị dự toán xây dựng công trình', 'Bao gồm tất cả các nội dung ở trên', 4, '2022-03-28 19:00:35', '2022-03-28 19:00:35'),
(595, 1, 1, 'Số bước thiết kế xây dựng do ai quyết định?', 'Người quyết định đầu tư khi phê duyệt dự án', 'Chủ đầu tư khi triển khai thực hiện dự án', 'Tổ chức tư vấn khi lập dự án đầu tư xây dựng', 'Cả 3 phương án trên đều sai', 1, '2022-03-28 19:01:03', '2022-03-28 19:01:03'),
(596, 1, 1, 'Chủ thể nào có trách nhiệm thực hiện bảo hành công trình xây dựng?', 'Chủ đầu tư xây dựng công trình', 'Nhà thầu thi công xây dựng công trình', 'Nhà thầu thiết kế xây dựng công trình', 'Cả 3 phương án trên đều đúng', 2, '2022-03-28 19:01:40', '2022-03-28 19:01:40'),
(597, 1, 1, 'Việc điều chỉnh dự án sử dụng vốn khác phải đảm bảo yêu cầu nào sau đây?', 'Các yêu cầu về quy hoạch', 'Các yêu cầu về an toàn, bảo vệ môi trường', 'Các yêu cầu về phòng, chống cháy, nổ, quốc phòng, an ninh', 'Cả 3 phương án a, b và c', 4, '2022-03-28 19:02:05', '2022-03-28 19:02:05'),
(598, 1, 1, 'Dự án đầu tư xây dựng sử dụng vốn đầu tư công được xem xét điều chỉnh trong những trường hợp nào?', 'Do ảnh hưởng của thiên tai, sự cố môi trường, địch họa, hỏa hoạn và các yếu tố bất khả kháng khác', 'Xuất hiện yếu tố mang lại hiệu quả cao hơn cho dự án khi đã được chủ đầu tư chứng minh về hiệu quả tài chính, kinh tế - xã hội do việc điều chỉnh dự án mang lại', 'Khi quy hoạch xây dựng thay đổi có ảnh hưởng trực tiếp tới dự án', 'Cả a, b và c', 4, '2022-03-28 19:02:38', '2022-03-28 19:02:38'),
(599, 1, 1, 'Theo quy định của pháp luật về môi trường, những loại dự án nào phải lập báo cáo đánh giá tác động môi trường?', 'Dự án quan trọng quốc gia', 'Dự án đầu tư xây dựng đô thị mới, khu dân cư tập trung', 'Dự án khai thác, sử dụng nước dưới đất và tài nguyên thiên nhiên có quy mô lớn', 'Cả a, b và c', 4, '2022-03-28 19:03:17', '2022-03-28 19:03:17'),
(600, 1, 1, 'Trường hợp công việc được xác định rõ về số lượng, khối lượng, thời gian thực hiện ngắn thì áp dụng hình thức hợp đồng nào là hợp lý nhất?', 'Hợp đồng trọn gói', 'Hợp đồng theo đơn giá', 'Hợp đồng theo thời gian', 'Hợp đồng theo đơn giá cố định', 1, '2022-03-28 19:03:41', '2022-03-28 19:03:41'),
(601, 1, 1, 'Trường hợp công việc chưa đủ điều kiện để xác định chính xác về số lượng hoặc khối lượng thì nên áp dụng hình thức hợp đồng nào là thích hợp nhất?', 'Hợp đồng trọn gói', 'Hợp đồng theo đơn giá cố định', 'Hợp đồng theo thời gian', 'Hợp đồng theo tỷ lệ phần trăm', 2, '2022-03-28 19:04:06', '2022-03-28 19:04:06'),
(602, 1, 1, 'Bên giao thầu có quyền chấm dứt hợp đồng trong các trường hợp nào sau đây?', 'Bên nhận thầu bị phá sản hoặc Bên nhận thầu không thực hiện công việc theo hợp đồng 45 ngày liên tục mà không có lý do', 'Bên nhận thầu chuyển nhượng lợi ích của hợp đồng xây dựng cho bên khác mà không có nêu trong hợp đồng đã ký kết', 'Bao gồm các đáp án a và b', 'Việc chấm dứt hợp đồng là do bên giao thầu quyết định', 3, '2022-03-28 19:04:34', '2022-03-28 19:04:34'),
(603, 1, 1, 'Theo quy định của pháp luật về xây dựng, bản vẽ thiết kế xây dựng trong hồ sơ đề nghị cấp giấy phép xây dựng là bản vẽ của bước thiết kế nào?', 'Thiết kế cơ sở', 'Thiết kế kỹ thuật hoặc thiết kế bản vẽ thi công đã được thẩm định, phê duyệt theo quy định', 'Thiết kế bản vẽ thi công đã được thẩm định, phê duyệt', 'Một trong phương án a, b hoặc c', 2, '2022-03-28 19:04:59', '2022-03-28 19:04:59'),
(604, 1, 1, 'Khi khởi công xây dựng công trình yêu cầu phải có các điều kiện nào dưới đây?', 'Có mặt bằng xây dựng để bàn giao toàn bộ hoặc từng phần theo tiến độ xây dựng', 'Có thiết kế bản vẽ thi công của hạng mục công trình, công trình khởi công đã được phê duyệt', 'Đáp ứng cả điều kiện nêu tại a và b', 'Chỉ cần đáp ứng điều kiện a hoặc b', 3, '2022-03-28 19:05:26', '2022-03-28 19:05:26'),
(605, 1, 1, 'Ai có thẩm quyền phê duyệt điều chỉnh dự án đầu tư xây dựng?', 'Người quyết định đầu tư', 'Chủ đầu tư', 'Ban quản lý dự án', 'Cơ quan quản lý nhà nước có thẩm quyền', 1, '2022-03-28 19:05:51', '2022-03-28 19:05:51'),
(606, 1, 1, 'Cơ quan chuyên môn về xây dựng là cơ quan nào?', 'Cơ quan chuyên môn thuộc Bộ Xây dựng', 'Cơ quan chuyên môn thuộc Bộ Giao thông vận tải, Bộ Công thương, Bộ Nông nghiệp và phát triển nông thôn', 'Các Sở Xây dựng, Sở Giao thông vận tải, Sở Công thương, Sở Nông nghiệp và phát triển nông thôn', 'Bao gồm cả a, b và c', 4, '2022-03-28 19:06:20', '2022-03-28 19:06:20'),
(607, 1, 1, 'Theo quy định của Luật Xây dựng, công tác thẩm định là việc kiểm tra, đánh giá của ai?', 'Người quyết định đầu tư, chủ đầu tư, cơ quan chuyên môn về xây dựng', 'Cơ quan chuyên môn của người quyết định đầu tư', 'Người quyết định đầu tư, chủ đầu tư', 'Tổ chức tư vấn có đủ điều kiện năng lực hoạt động xây dựng', 1, '2022-03-28 19:06:43', '2022-03-28 19:06:43'),
(608, 1, 1, 'Đối với dự án sử dụng vốn đầu tư công, người quyết định đầu tư có thể giao đơn vị nào sau đây làm chủ đầu tư?', 'Ban quản lý dự án đầu tư xây dựng chuyên ngành, Ban quản lý dự án đầu tư xây dựng khu vực', 'Cơ quan, tổ chức có kinh nghiệm, năng lực quản lý', 'Đáp án a và b đúng', 'Đơn vị được giao khai thác vận hành công trình', 3, '2022-03-28 19:07:10', '2022-03-28 19:07:10'),
(609, 1, 1, 'Việc điều chỉnh dự án đầu tư xây dựng sử dụng vốn đầu tư công đã được phê duyệt do ai quyết định?', 'Người quyết định đầu tư', 'Chủ đầu tư', 'Cơ quan chuyên môn về xây dựng', 'Bao gồm cả a, b và c', 1, '2022-03-28 19:07:36', '2022-03-28 19:07:36'),
(610, 1, 1, 'Đối với các dự án đầu tư xây dựng điều chỉnh, cơ quan chuyên môn về xây dựng thẩm định Báo cáo nghiên cứu khả thi điều chỉnh trong trường hợp nào sau đây?', 'Khi điều chỉnh dự án có thay đổi về mục tiêu, quy mô sử dụng đất, quy mô đầu tư xây dựng', 'Khi có thay đổi về chỉ tiêu quy hoạch, kiến trúc của dự án tại quy hoạch chi tiết xây dựng, quy hoạch có tính chất kỹ thuật chuyên ngành khác hoặc quyết định/chấp thuận chủ trương đầu tư được phê duyệt', 'Đáp án a và b đều đúng', 'Đáp án a và b đều sai', 3, '2022-03-28 19:08:13', '2022-03-28 19:08:13'),
(611, 1, 1, 'Ban quản lý dự án đầu tư xây dựng một dự án là tổ chức như thế nào sau đây?', 'Là tổ chức trực thuộc chủ đầu tư', 'Được sử dụng con dấu riêng, được mở tài khoản tại kho bạc nhà nước hoặc ngân hàng thương mại', 'Chịu trách nhiệm trước pháp luật và chủ đầu tư về hoạt động quản lý dự án của mình', 'Bao gồm tất cả những nội dung trên', 4, '2022-03-28 19:08:37', '2022-03-28 19:08:37'),
(612, 1, 1, 'Trong quá trình lập dự án đầu tư xây dựng, tổ chức tư vấn lập dự án có các nghĩa vụ gì?', 'Thực hiện theo nội dung hợp đồng đã được ký kết với chủ đầu tư', 'Chịu trách nhiệm về chất lượng công việc theo hợp đồng đã được ký kết', 'Bồi thường thiệt hại khi sử dụng thông tin, tài liệu, tiêu chuẩn, quy chuẩn kỹ thuật, giải pháp kỹ thuật, tổ chức quản lý không phù hợp và vi phạm hợp đồng làm thiệt hại cho chủ đầu tư', 'Bao gồm a, b và c', 4, '2022-03-28 19:09:00', '2022-03-28 19:09:00'),
(613, 1, 1, 'Hồ sơ của hợp đồng xây dựng gồm các tài liệu nào dưới đây?', 'Văn bản thông báo trúng thầu hoặc chỉ định thầu', 'Các bản vẽ thiết kế và chỉ dẫn kỹ thuật (nếu có), Biên bản đàm phán hợp đồng', 'Bao gồm đáp án a và b', 'Không cần các tài liệu quy định tại a và b', 3, '2022-03-28 19:09:26', '2022-03-28 19:09:26'),
(614, 1, 1, 'Hợp đồng xây dựng có hiệu lực pháp lý khi đáp ứng các điều kiện nào sau đây?', 'Người tham gia ký kết có đầy đủ năng lực hành vi dân sự', 'Đáp ứng các nguyên tắc ký kết hợp đồng theo quy định', 'Hình thức hợp đồng bằng văn bản và được ký kết bởi người đại diện đúng thẩm quyền theo pháp luật của các bên tham gia hợp đồng. Trường hợp một bên tham gia hợp đồng là tổ chức thì bên đó phải ký tên, đóng dấu theo quy định của pháp luật', 'Cần đáp ứng đầy đủ các điều kiện ở trên', 4, '2022-03-28 19:09:51', '2022-03-28 19:09:51'),
(615, 1, 1, 'Cá nhân không yêu cầu phải có chứng chỉ hành nghề theo quy định khi thực hiện các hoạt động xây dựng nào sau đây?', 'Thiết kế, giám sát hệ thống thông tin liên lạc, viễn thông trong công trình', 'Thiết kế, giám sát công tác hoàn thiện công trình xây dựng như trát, ốp lát, sơn, lắp đặt cửa, nội thất và các công việc tương tự khác không ảnh hưởng đến kết cấu chịu lực của công trình', 'Các hoạt động xây dựng đối với công trình cấp IV; công viên cây xanh; đường cáp truyền dẫn tín hiệu viễn thông', 'Tất cả các nội dung ở trên', 4, '2022-03-28 19:10:18', '2022-03-28 19:10:18'),
(616, 1, 1, 'Đối với dự án đầu tư xây dựng sử dụng vốn đầu tư công thì Báo cáo nghiên cứu tiền khả thi đầu tư xây dựng được lập theo quy định nào?', 'Pháp luật về xây dựng', 'Pháp luật về đầu tư công', 'Pháp luật về xây dựng và pháp luật về đầu tư công', 'Pháp luật về đầu tư công, pháp luật về đầu tư, pháp luật xây dựng', 3, '2022-03-28 19:10:45', '2022-03-28 19:10:45'),
(617, 1, 1, 'Hội đồng thẩm định hoặc đơn vị được giao nhiệm vụ thẩm định dự án PPP thẩm định Báo cáo nghiên cứu khả thi dự án PPP theo quy định của pháp luật nào sau đây?', 'Pháp luật về đầu tư xây dựng', 'Pháp luật về đầu tư theo phương thức đối tác công tư', 'Pháp luật về đầu tư công', 'Pháp luật về đầu tư và đầu tư công', 2, '2022-03-28 19:11:12', '2022-03-28 19:11:12'),
(618, 1, 1, 'Việc quyết định đầu tư xây dựng của người quyết định đầu tư được thể hiện tại quyết định phê duyệt dự án đầu tư xây dựng, không bao gồm nội dung nào sau đây?', 'Tổ chức tư vấn lập Báo cáo nghiên cứu khả thi (Báo cáo kinh tế - kỹ thuật) đầu tư xây dựng, tổ chức lập khảo sát xây dựng (nếu có); tổ chức tư vấn lập thiết kế cơ sở', 'Địa điểm xây dựng và diện tích đất sử dụng', 'Phương án lựa chọn nhà thầu', 'Loại, nhóm dự án; loại, cấp công trình chính; thời hạn sử dụng theo thiết kế của công trình chính', 3, '2022-03-28 19:11:39', '2022-03-28 19:11:39'),
(619, 1, 1, 'Cơ quan chuyên môn về xây dựng từ chối tiếp nhận hồ sơ trình thẩm định Báo cáo nghiên cứu khả thi đầu tư xây dựng trong trường hợp nào sau đây?', 'Trình thẩm định không đúng với thẩm quyền của cơ quan chuyên môn về xây dựng hoặc người đề nghị thẩm định không đúng thẩm quyền theo quy định', 'Không thuộc đối tượng phải thẩm định tại cơ quan chuyên môn về xây dựng theo quy định', 'Hồ sơ trình thẩm định không bảo đảm về tính pháp lý hoặc không hợp lệ theo quy định', 'Tất cả các trường hợp trên', 4, '2022-03-28 19:12:07', '2022-03-28 19:12:07'),
(620, 1, 1, 'Trong trường hợp thuê tư vấn quản lý dự án, chủ đầu tư có trách nhiệm như thế nào là đúng sau đây?', 'Giám sát việc thực hiện hợp đồng tư vấn quản lý dự án', 'Xử lý các vấn đề có liên quan giữa tổ chức tư vấn quản lý dự án với các nhà thầu trong quá trình thực hiện dự án', 'Giám sát việc thực hiện hợp đồng của các nhà thầu thi công và giám sát thi công', 'Xử lý các vấn đề có liên quan giữa tổ chức tư vấn quản lý dự án với chính quyền địa phương trong quá trình thực hiện dự án', 1, '2022-03-28 19:12:33', '2022-03-28 19:12:33'),
(621, 1, 1, 'Cá nhân đề nghị cấp chứng chỉ hành nghề hoạt động xây dựng yêu cầu phải đáp ứng các điều kiện chung gì?', 'Có đủ năng lực hành vi dân sự theo quy định của pháp luật', 'Có trình độ chuyên môn được đào tạo, thời gian và kinh nghiệm tham gia công việc phù hợp với nội dung đề nghị cấp chứng chỉ hành nghề và phải đạt kết quả sát hạch theo quy định', 'Bao gồm a và b', 'Chỉ cần đạt được kết quả sát hạch theo quy định là đủ', 3, '2022-03-28 19:13:00', '2022-03-28 19:13:00'),
(622, 1, 1, 'Tổ chức đề nghị cấp chứng chỉ năng lực hoạt động xây dựng yêu cầu phải đáp ứng các điều kiện gì?', 'Những cá nhân chủ chốt của tổ chức phải có chứng chỉ hành nghề phù hợp với lĩnh vực và hạng năng lực mà tổ chức đề nghị cấp chứng chỉ năng lực', 'Tổ chức đã thực hiện công việc tương tự loại, cấp công trình', 'Phải có thời gian tham gia hoạt động xây dựng tối thiểu 3 năm', 'Đáp ứng cả điều kiện a và b ở trên', 4, '2022-03-28 19:13:23', '2022-03-28 19:13:23'),
(623, 1, 1, 'Nhà thầu phụ phải chịu trách nhiệm với ai về công việc do mình thực hiện?', 'Chủ đầu tư', 'Thầu chính hoặc tổng thầu', 'Chủ đầu tư và thầu chính hoặc tổng thầu', 'Chịu trách nhiệm với ai là căn cứ vào các điều khoản cam kết trong hợp đồng xây dựng', 2, '2022-03-28 19:13:57', '2022-03-28 19:13:57'),
(624, 1, 1, 'Trường hợp phải thuê thầu phụ để thực hiện một số phần việc trong hợp đồng đã ký kết với chủ đầu tư thì cần phải có chấp thuận của ai?', 'Người quyết định đầu tư', 'Chủ đầu tư', 'Người quyết định đầu tư hoặc chủ đầu tư tùy thuộc vào từng gói thầu', 'Không cần phải có sự chấp thuận của cơ quan, tổ chức nào', 2, '2022-03-28 19:14:18', '2022-03-28 19:14:18'),
(625, 1, 1, 'Bảo đảm thực hiện hợp đồng xây dựng phải được nộp cho bên giao thầu khi nào?', 'Trước thời điểm hợp đồng có hiệu lực', 'Sau khi hợp đồng được ký kết', 'Trước khi khởi công xây dựng công trình', 'Bao gồm cả a, b và c', 1, '2022-03-28 19:14:49', '2022-03-28 19:14:49'),
(626, 1, 1, 'Bảo đảm thực hiện hợp đồng của nhà thầu thi công xây dựng có hiệu lực đến khi nào?', 'Đến khi nhà thầu đã hoàn thành các nghĩa vụ theo hợp đồng', 'Sau khi chủ đầu tư đã nhận được bảo đảm bảo hành của nhà thầu', 'Đáp án a hoặc b do hai bên thỏa thuận trong hợp đồng', 'Sau khi công việc theo hợp đồng đã hoàn thành bàn giao chủ chủ đầu tư', 3, '2022-03-28 19:15:16', '2022-03-28 19:15:16'),
(627, 1, 1, 'Cá nhân không có chứng chỉ hành nghề được tham gia các hoạt động xây dựng theo quy định nào sau đây là đúng?', 'Được tham gia các hoạt động xây dựng thuộc lĩnh vực phù hợp với chuyên ngành được đào tạo, phù hợp với quy định của Bộ luật Lao động', 'Không được hành nghề độc lập, không được đảm nhận chức danh theo quy định phải có chứng chỉ hành nghề', 'Tuân thủ cả quy định a và b', 'Được tham gia các hoạt động xây dựng đối với những dự án nhóm C, công trình cấp II trở xuống', 3, '2022-03-28 19:15:47', '2022-03-28 19:15:47'),
(628, 1, 1, 'Theo quy định của pháp luật xây dựng, cá nhân khi thực hiện các hoạt động xây dựng nào sau đây không cần phải có chứng chỉ hành nghề?', 'Thiết kế, giám sát hệ thống thông tin liên lạc, viễn thông trong công trình', 'Thiết kế, giám sát thi công hệ thống kết cấu công trình xây dựng', 'Không nội dung nào ở trên', 'Cả a và b đúng', 1, '2022-03-28 19:16:11', '2022-03-28 19:16:11'),
(629, 1, 1, 'Tổ chức hoạt động xây dựng mới được thành lập có những cá nhân có chứng chỉ hành nghề hạng 1 phù hợp với lĩnh vực mà tổ chức đề nghị cấp chứng chỉ năng lực hoạt động xây dựng, nhưng chưa ký hợp đồng để thực hiện bất kể công việc gì trong hoạt động đầu tư xây dựng thì có được cấp chứng chỉ năng lực hoạt động xây dựng hạng 1 không?', 'Có', 'Không', 'Có, nhưng chỉ được xem cấp chứng chỉ hành năng lực cho lĩnh vực định giá xây dựng', 'Có, nhưng chỉ được xem cấp chứng chỉ hành năng lực cho các lĩnh vực giám sát thi công xây dựng, kiểm định xây dựng', 2, '2022-03-28 19:16:34', '2022-03-28 19:16:34'),
(630, 1, 1, 'Bước thiết kế công trình xây dựng nào mới đủ điều kiện để khởi công xây dựng công trình?', 'Thiết kế cơ sở', 'Thiết kế kỹ thuật', 'Thiết kế bản vẽ thi công', 'Một trong ba bước thiết kế trên đều được', 3, '2022-03-28 19:16:59', '2022-03-28 19:16:59'),
(631, 1, 1, 'Những người nào sau đây tham gia và ký biên bản nghiệm thu công việc xây dựng', 'Người giám sát thi công xây dựng công trình và người phụ trách kỹ thuật thi công trực tiếp của nhà thầu thi công xây dựng công trình', 'Người của Chủ đầu tư/Ban quản lý dự án, người giám sát thi công xây dựng công trình và người phụ trách kỹ thuật thi công trực tiếp của nhà thầu thi công xây dựng công trình', 'Người của Chủ đầu tư/Ban quản lý dự án và người phụ trách kỹ thuật thi công trực tiếp của nhà thầu thi công xây dựng công trình', 'Cả ba đáp án trên', 1, '2022-03-28 19:17:33', '2022-03-28 19:17:33'),
(632, 1, 1, 'Ai là người có trách nhiệm tổ chức lập hồ sơ hoàn thành công trình xây dựng?', 'Nhà thầu thi công xây dựng', 'Chủ đầu tư', 'Nhà thầu giám sát thi công xây dựng', 'Cơ quan quản lý nhà nước có thẩm quyền', 2, '2022-03-28 19:18:00', '2022-03-28 19:18:00'),
(633, 1, 1, 'Thời hạn bảo trì công trình được tính như thế nào?', 'Sau khi kết thúc thời hạn bảo hành cho đến khi hết niên hạn sử dụng công trình', 'Từ ngày nghiệm thu đưa công trình xây dựng vào sử dụng cho đến khi hết niên hạn sử dụng công trình', 'Từ ngày chủ đầu tư bàn giao công trình cho chủ sở hữu hoặc người quản lý sử dụng công trình', 'Từ ngày có văn bản chấp thuận kết quả nghiệm thu của chủ đầu tư', 2, '2022-03-28 19:18:26', '2022-03-28 19:18:26'),
(634, 1, 1, 'Việc áp dụng quy chuẩn kỹ thuật trong hoạt động đầu tư xây dựng là:', 'Bắt buộc', 'Khuyến khích', 'Tự nguyện', 'Thỏa thuận', 1, '2022-03-28 19:19:03', '2022-03-28 19:19:03'),
(635, 1, 1, 'Quy định áp dụng Tiêu chuẩn kỹ thuật trong hoạt động đầu tư xây dựng như thế nào?', 'Bắt buộc đối với các tiêu chuẩn được viện dẫn trong quy chuẩn kỹ thuật hoặc văn bản quy phạm pháp luật khác có liên quan', 'Khuyến khích áp dụng', 'Theo nguyên tắc tự nguyện', 'Đáp án a và c', 4, '2022-03-28 19:19:32', '2022-03-28 19:19:32'),
(636, 1, 1, 'Những loại tiêu chuẩn nào sau đây bắt buộc áp dụng?', 'TCVN', 'Tiêu chuẩn nước ngoài', 'Các tiêu chuẩn nằm trong danh mục tiêu chuẩn đã được người quyết định đầu tư phê duyệt', 'Danh mục tiêu chuẩn do tư vấn thiết kế đệ trình', 3, '2022-03-28 19:19:55', '2022-03-28 19:19:55'),
(637, 1, 1, 'Nhà thầu thi công phải trình chủ đầu tư chấp thuận những tài liệu nào sau đây?', 'Kế hoạch tổ chức thí nghiệm và kiểm định chất lượng, quan trắc, đo đạc các thông số kỹ thuật của công trình theo yêu cầu thiết kế và chỉ dẫn kỹ thuật', 'Biện pháp kiểm tra, kiểm soát chất lượng vật liệu, sản phẩm, cấu kiện, thiết bị được sử dụng cho công trình; thiết kế biện pháp thi công, trong đó quy định cụ thể các biện pháp, bảo đảm an toàn cho người, máy, thiết bị và công trình', 'Kế hoạch kiểm tra, nghiệm thu công việc xây dựng, nghiệm thu giai đoạn thi công xây dựng hoặc bộ phận (hạng mục) công trình xây dựng, nghiệm thu hoàn thành hạng mục công trình, công trình xây dựng', 'Toàn bộ các tài liệu nêu trên', 4, '2022-03-28 19:20:30', '2022-03-28 19:20:30'),
(638, 1, 1, 'Việc giám sát thi công xây dựng công trình phải đảm bảo các yêu cầu nào sau đây?', 'Thực hiện trong suốt quá trình thi công từ khi khởi công xây dựng, trong thời gian thực hiện cho đến khi hoàn thành và nghiệm thu công việc, công trình xây dựng', 'Theo thiết kế xây dựng được phê duyệt, tiêu chuẩn áp dụng, quy chuẩn kỹ thuật, quy định về quản lý, sử dụng vật liệu xây dựng, chỉ dẫn kỹ thuật và hợp đồng xây dựng', 'Trung thực khách quan, không vụ lợi', 'Tất cả các yêu cầu trên', 4, '2022-03-28 19:21:32', '2022-03-28 19:21:32'),
(639, 1, 1, 'Nhà thầu giám sát thi công xây dựng có trách nhiệm gì sau đây?', 'Thực hiện giám sát theo hợp đồng được ký kết', 'Từ chối nghiệm thu khi công trình không đạt yêu cầu về chất lượng', 'Giám sát việc thực hiện các quy định về an toàn, bảo vệ môi trường', 'Tất cả các điều trên', 4, '2022-03-28 19:22:00', '2022-03-28 19:22:00'),
(640, 1, 1, 'Tổ chức giám sát thi công xây dựng phải độc lập với các nhà thầu thi công xây dựng công trình trong các trường hợp nào sau đây?', 'Các công trình đầu tư bằng nguồn vốn đầu tư công và nguồn vốn nhà nước ngoài đầu tư công', 'Các công trình đầu tư bằng nguồn vốn khác', 'Không trường hợp nào cần', 'Tất cả các trường hợp trên', 1, '2022-03-28 19:22:31', '2022-03-28 19:22:31'),
(641, 1, 1, 'Bản vẽ hoàn công là bản vẽ nào sau đây?', 'Là bản vẽ công trình xây dựng hoàn thành, trong đó thể hiện vị trí, kích thước, vật liệu và thiết bị được sử dụng thực tế', 'Là bản vẽ của thiết kế kỹ thuật', 'Là bản vẽ của thiết kế bản vẽ thi công', 'Tất cả các đáp án trên', 1, '2022-03-28 19:23:00', '2022-03-28 19:23:00'),
(642, 1, 1, 'Thẩm quyền kiểm tra biện pháp thi công xây dựng của nhà thầu thi công?', 'Tư vấn thiết kế', 'Người giám sát thi công xây dựng của chủ đầu tư', 'Đơn vị kiểm định độc lập', 'Cả ba đáp án trên', 2, '2022-03-28 19:23:25', '2022-03-28 19:23:25'),
(643, 1, 1, 'Nhật ký thi công xây dựng công trình do ai lập?', 'Chủ đầu tư', 'Nhà thầu thi công xây dựng', 'Đơn vị tư vấn giám sát lập', 'Cả ba đáp án trên', 2, '2022-03-28 19:23:54', '2022-03-28 19:23:54'),
(644, 1, 1, 'Ai là người có thẩm quyền phê duyệt thiết kế biện pháp thi công?', 'Chủ đầu tư', 'Nhà thầu thi công xây dựng', 'Người quyết định đầu tư', 'Tư vấn giám sát', 1, '2022-03-28 19:24:27', '2022-03-28 19:24:27'),
(645, 1, 1, 'Nội dung nào sau đây không cần phải đáp ứng khi khởi công công trình?', 'Có thiết kế bản vẽ thi công của hạng mục công trình, công trình khởi công đã được phê duyệt', 'Chủ đầu tư đã ký kết hợp đồng với nhà thầu thực hiện các hoạt động xây dựng liên quan đến công trình được khởi công theo quy định của pháp luật', 'Có hợp đồng với đơn vị cung cấp vật liệu chính của công trình', 'Có biện pháp bảo đảm an toàn, bảo vệ môi trường trong quá trình thi công xây dựng', 3, '2022-03-28 19:24:57', '2022-03-28 19:24:57'),
(646, 1, 1, 'Nội dung nào sau đây phải đáp ứng khi khởi công công trình?', 'Có mặt bằng xây dựng để bàn giao toàn bộ hoặc từng phần theo tiến độ xây dựng', 'Có thiết kế bản vẽ thi công của hạng mục công trình, công trình khởi công đã được phê duyệt', 'Chủ đầu tư đã ký kết hợp đồng với nhà thầu thực hiện các hoạt động xây dựng liên quan đến công trình được khởi công theo quy định của pháp luật', 'Có tất cả các nội dung ở trên', 4, '2022-03-28 19:25:30', '2022-03-28 19:25:30'),
(647, 1, 1, 'Đơn vị nào có trách nhiệm bảo đảm an toàn cho con người, công trình xây dựng, tài sản, thiết bị, phương tiện trong quá trình thi công xây dựng công trình, phòng, chống cháy, nổ và bảo vệ môi trường trong giai đoạn thi công?', 'Tư vấn giám sát', 'Nhà thầu thi công xây dựng', 'Tư vấn Quản lý dự án', 'Đơn vị cung cấp máy, thiết bị thi công', 2, '2022-03-28 19:26:03', '2022-03-28 19:26:03'),
(648, 1, 1, 'Nhà thầu thi công xây dựng có trách nhiệm xác định vùng nguy hiểm trong thi công xây dựng công trình và thực hiện những công tác nào sau đây?', 'Tổ chức lập, trình chủ đầu tư chấp thuận biện pháp bảo đảm an toàn cho con người, công trình xây dựng, tài sản, thiết bị, phương tiện trong vùng nguy hiểm trong thi công xây dựng công trình', 'Rà soát biện pháp bảo đảm an toàn định kỳ, đột xuất để điều chỉnh cho phù hợp với thực tế thi công trên công trường', 'Cả nội dung a và b', 'Không phải các nội dung trên', 3, '2022-03-28 19:27:05', '2022-03-28 19:27:05'),
(649, 1, 1, 'Nội dung nào sau đây thuộc về nghĩa vụ của nhà thầu giám sát thi công xây dựng công trình?', 'Nghiệm thu khối lượng thi công xây dựng, phù hợp với tiêu chuẩn áp dụng, quy chuẩn kỹ thuật và theo yêu cầu của tiến độ thi công', 'Nghiệm thu khối lượng bảo đảm chất lượng, phù hợp với tiêu chuẩn áp dụng, quy chuẩn kỹ thuật và theo yêu cầu của thiết kế công trình', 'Nghiệm thu giá trị thi công xây dựng, phù hợp với tiêu chuẩn áp dụng, quy chuẩn kỹ thuật và theo yêu cầu của thiết kế công trình', 'Nghiệm thu khối lượng theo đơn giá được duyệt, phù hợp với tiêu chuẩn áp dụng, quy chuẩn kỹ thuật và theo yêu cầu của thiết kế công trình', 2, '2022-03-28 19:27:33', '2022-03-28 19:27:33'),
(650, 1, 1, 'Đối với công tác an toàn và bảo vệ môi trường trên công trường xây dựng, người giám sát có trách nhiệm nào sau đây?', 'Lập biện pháp và tuân thủ các quy định về an toàn, bảo vệ môi trường', 'Giám sát việc thực hiện các quy định về an toàn, bảo vệ môi trường', 'Tạm dừng thi công và thông báo kịp thời cho chủ đầu tư để xử lý trong trường hợp phát hiện công trình có nguy cơ xảy ra mất an toàn', 'Đáp án b và c', 4, '2022-03-28 19:28:05', '2022-03-28 19:28:05'),
(651, 1, 1, 'Nội dung nào sau đây không thuộc nghĩa vụ của nhà thầu giám sát thi công xây dựng công trình?', 'Thực hiện giám sát theo đúng hợp đồng', 'Từ chối nghiệm thu khi công trình không đạt yêu cầu chất lượng', 'Từ chối nghiệm thu khi sản phẩm thiết kế không đạt yêu cầu về chất lượng', 'Đề xuất với chủ đầu tư những bất hợp lý về thiết kế xây dựng', 3, '2022-03-28 19:28:33', '2022-03-28 19:28:33'),
(652, 1, 1, 'Nội dung nào sau đây không thuộc quyền hạn của nhà thầu giám sát thi công xây dựng công trình?', 'Tham gia nghiệm thu, xác nhận công việc, công trình đã hoàn thành thi công xây dựng', 'Tạm dừng thi công trong trường hợp phát hiện công trình có nguy cơ xảy ra mất an toàn hoặc nhà thầu thi công sai thiết kế và thông báo kịp thời cho chủ đầu tư để xử lý', 'Yêu cầu nhà thầu thi công xây dựng công trình thực hiện đúng thiết kế được phê duyệt và hợp đồng thi công xây dựng đã ký kết', 'Yêu cầu thanh toán giá trị khối lượng xây dựng hoàn thành theo đúng hợp đồng', 4, '2022-03-28 19:29:02', '2022-03-28 19:29:02'),
(653, 1, 1, 'Quản lý thực hiện dự án đầu tư xây dựng bao gồm những nội dung nào sau đây?', 'Quản lý về phạm vi, kế hoạch công việc', 'Quản lý khối lượng công việc; chất lượng xây dựng', 'Quản lý tiến độ thực hiện; chi phí đầu tư xây dựng', 'Tất cả các nội dung ở trên', 4, '2022-03-28 19:29:26', '2022-03-28 19:29:26'),
(654, 1, 1, 'Ban quản lý dự án đầu tư xây dựng chuyên ngành, Ban quản lý dự án đầu tư xây dựng khu vực có trách nhiệm gì?', 'Xác định yêu cầu, nội dung nhiệm vụ lập dự án; cung cấp thông tin, tài liệu cần thiết trong trường hợp thuê tư vấn lập dự án; tổ chức nghiệm thu kết quả lập dự án và lưu trữ hồ sơ dự án đầu tư xây dựng', 'Kiểm tra, giám sát việc thực hiện dự án; định kỳ báo cáo việc thực hiện dự án với người quyết định đầu tư, cơ quan quản lý nhà nước có thẩm quyền', 'Thu hồi vốn, trả nợ vốn vay đối với dự án có yêu cầu về thu hồi vốn, trả nợ vốn vay', 'Tất cả các trách nhiệm tại điểm a, b và c', 4, '2022-03-28 19:29:56', '2022-03-28 19:29:56'),
(655, 1, 1, 'Tổng thầu xây dựng là nhà thầu ký kết hợp đồng trực tiếp với ai để nhận thầu một số loại công việc của công trình hoặc toàn bộ công việc của dự án đầu tư xây dựng?', 'Chủ đầu tư', 'Nhà thầu phụ', 'Chủ đầu tư và các nhà thầu phụ', 'Ban quản lý dự án đầu tư xây dựng', 1, '2022-03-28 19:30:28', '2022-03-28 19:30:28'),
(656, 1, 1, 'Đối với dự án đầu tư xây dựng sử dụng vốn đầu tư công, việc giám sát, đánh giá đầu tư phải tuân thủ theo quy định nào?', 'Theo quy định của pháp luật về đầu tư công', 'Theo quy định của pháp luật về xây dựng', 'Theo quy định của pháp luật về đầu tư công và pháp luật về xây dựng', 'Theo quy định của pháp luật về đầu tư công, pháp luật về xây dựng và pháp luật khác có liên quan', 4, '2022-03-28 19:30:53', '2022-03-28 19:30:53'),
(657, 1, 1, 'Hoạt động đầu tư xây dựng phải bảo đảm các nguyên tắc nào dưới đây?', 'Sử dụng hợp lý nguồn lực, tài nguyên tại khu vực có dự án, bảo đảm đúng mục đích dự án được phê duyệt', 'Đúng trình tự đầu tư xây dựng; tuân thủ tiêu chuẩn, quy chuẩn kỹ thuật, quy định của pháp luật có liên quan', 'Bảo đảm chất lượng, tiến độ, an toàn công trình, tính mạng, sức khỏe con người và tài sản; phòng, chống cháy, nổ; bảo vệ môi trường', 'Tất cả các nguyên tắc nêu tại a, b và c', 4, '2022-03-28 19:31:30', '2022-03-28 19:31:30'),
(658, 1, 1, 'Chi phí mua bảo hiểm cho người lao động trong thời gian thi công xây dựng của nhà thầu thi công xây dựng được tính trong chi phí nào?', 'Trong tổng mức đầu tư', 'Trong chi phí sản xuất kinh doanh của nhà thầu', 'Trong dự toán xây dựng', 'Trong giá trị hợp đồng thi công xây dựng', 2, '2022-03-28 19:31:56', '2022-03-28 19:31:56'),
(659, 1, 1, 'Những hành vi nào dưới đây bị nghiêm cấm trong hoạt động đầu tư xây dựng?', 'Khởi công xây dựng công trình khi chưa đủ điều kiện khởi công theo quy định của pháp luật về xây dựng', 'Xây dựng công trình không đúng quy hoạch xây dựng; vi phạm chỉ giới xây dựng, cốt xây dựng; xây dựng công trình không đúng với giấy phép xây dựng được cấp', 'Vi phạm quy định về an toàn lao động, tài sản, phòng, chống cháy, nổ, an ninh, trật tự và bảo vệ môi trường trong xây dựng', 'Tất cả các hành vi nêu tại a, b và c', 4, '2022-03-28 19:32:24', '2022-03-28 19:32:24'),
(660, 1, 1, 'Đối với dự án nhóm A gồm nhiều dự án thành phần trong đó mỗi dự án thành phần có thể vận hành độc lập, khai thác sử dụng hoặc được phân kỳ đầu tư để thực hiện thì dự án thành phần được quản lý thực hiện như thế nào?', 'Như dự án nhóm A', 'Như một dự án độc lập', 'Như một dự án độc lập, nhưng phải được cấp có thẩm quyền cho phép đầu tư chấp thuận', 'Như một dự án độc lập, do người quyết định đầu tư quyết định', 3, '2022-03-28 19:32:51', '2022-03-28 19:32:51'),
(661, 1, 1, 'Đối với dự án sử dụng vốn đầu tư công, trong thời gian thực hiện dự án, giá vật liệu xây dựng trên thị trường biến động tăng hơn so với giá tính trong tổng mức đầu tư được duyệt thì có được điều chỉnh dự án không?', 'Không', 'Có, nếu chỉ số giá xây dựng do Bộ Xây dựng, Ủy ban nhân dân cấp tỉnh công bố lớn hơn chỉ số giá xây dựng được sử dụng để tính dự phòng trượt giá trong tổng mức đầu tư dự án được duyệt', 'Điều chỉnh hay không là do người quyết định đầu tư quyết định', 'Điều chỉnh hay không là do cơ quan chuyên môn về xây dựng cho phép', 2, '2022-03-28 19:33:26', '2022-03-28 19:33:26'),
(662, 1, 1, 'Quy định nào là đúng về việc phân kỳ đầu tư?', 'Được thể hiện trong Báo cáo nghiên cứu khả thi đầu tư xây dựng và quyết định đầu tư xây dựng', 'Phù hợp với tiến độ, thời gian thực hiện dự án trong nội dung quyết định hoặc chấp thuận chủ trương đầu tư xây dựng', 'Cả a và b đều đúng', 'Các đáp án trên là sai', 3, '2022-03-28 19:34:04', '2022-03-28 19:34:04'),
(663, 1, 1, 'Đối với dự án sử dụng vốn đầu tư công, tiến độ thực hiện dự án có được vượt quá thời gian đã được xác định trong dự án được người quyết định đầu tư phê duyệt không?', 'Có, nhưng phải được chủ đầu tư chấp thuận', 'Có, nhưng phải được người quyết định đầu tư chấp thuận', 'Có, nhưng phải được cơ quan chuyên môn về xây dựng chấp thuận', 'Không', 2, '2022-03-28 19:34:27', '2022-03-28 19:34:27'),
(664, 1, 1, 'Nhà thầu tư vấn giám sát thi công xây dựng không có trách nhiệm nào dưới đây?', 'Thực hiện nghĩa vụ theo nội dung hợp đồng đã được ký kết với chủ đầu tư', 'Chịu trách nhiệm về chất lượng công việc theo hợp đồng đã được ký kết', 'Bồi thường thiệt hại khi sử dụng thông tin, tài liệu, tiêu chuẩn, quy chuẩn kỹ thuật, giải pháp kỹ thuật, tổ chức quản lý không phù hợp và vi phạm hợp đồng làm thiệt hại cho chủ đầu tư', 'Chịu trách nhiệm về chất lượng thiết kế xây dựng công trình', 4, '2022-03-28 19:34:59', '2022-03-28 19:34:59'),
(665, 1, 1, 'Thiết kế xây dựng đã được phê duyệt chỉ được điều chỉnh khi nào?', 'Khi điều chỉnh dự án đầu tư xây dựng có yêu cầu điều chỉnh thiết kế xây dựng', 'Trong quá trình thi công xây dựng có yêu cầu phải điều chỉnh thiết kế xây dựng để bảo đảm chất lượng công trình và hiệu quả của dự án', 'Bao gồm cả trường hợp a và b', 'Không được điều chỉnh trong bất kể trường hợp nào', 3, '2022-03-28 19:35:26', '2022-03-28 19:35:26'),
(666, 1, 1, 'Hồ sơ đề nghị cấp giấy phép xây dựng gồm những tài liệu cơ bản nào?', 'Đơn đề nghị cấp giấy phép xây dựng', 'Bản sao một trong những giấy tờ hợp pháp về quyền sử dụng đất', 'Một số bản vẽ thiết kế xây dựng', 'Gồm các tài liệu nêu tại a, b và c', 4, '2022-03-28 19:35:50', '2022-03-28 19:35:50'),
(667, 1, 1, 'Ai có trách nhiệm thực hiện lập quyết toán hợp đồng xây dựng?', 'Chủ đầu tư', 'Nhà thầu thi công xây dựng công trình', 'Nhà thầu tư vấn giám sát thi công xây dựng', 'Ban quản lý dự án đầu tư xây dựng', 2, '2022-03-28 19:36:22', '2022-03-28 19:36:22'),
(668, 1, 1, 'Khi khởi công xây dựng công trình phải có bước thiết kế nào được phê duyệt?', 'Thiết kế cơ sở', 'Thiết kế kỹ thuật', 'Thiết kế bản vẽ thi công của hạng mục công trình, công trình khởi công đã được phê duyệt và được chủ đầu tư kiểm tra, xác nhận trên bản vẽ', 'Tất cả các bước thiết kế nêu tại a, b và c', 3, '2022-03-28 19:36:49', '2022-03-28 19:36:49'),
(669, 1, 1, 'Việc thu hồi đất, giao đất, cho thuê đất, bồi thường, giải phóng mặt bằng xây dựng được thực hiện theo quy định nào?', 'Quy định của pháp luật về xây dựng', 'Quy định của pháp luật về đất đai', 'Quy định của pháp luật về xây dựng và pháp luật về đất đai', 'Theo quy định của Ủy ban nhân dân cấp tỉnh', 2, '2022-03-28 19:37:20', '2022-03-28 19:37:20'),
(670, 1, 1, 'Việc bàn giao toàn bộ hoặc một phần mặt bằng xây dựng để thi công là do ai quyết định?', 'Người quyết định đầu tư quyết định', 'Chủ đầu tư quyết định', 'Theo thỏa thuận giữa chủ đầu tư và nhà thầu thi công xây dựng', 'Chính quyền địa phương quyết định', 3, '2022-03-28 19:37:46', '2022-03-28 19:37:46'),
(671, 1, 1, 'Tổ chức nào có trách nhiệm lắp đặt biển báo công trình tại công trình?', 'Chủ đầu tư xây dựng công trình', 'Nhà thầu thiết kế xây dựng công trình', 'Nhà thầu chính thi công xây dựng công trình', 'Nhà thầu phụ thi công xây dựng công trình', 1, '2022-03-28 19:38:12', '2022-03-28 19:38:12'),
(672, 1, 1, 'Vật liệu, cấu kiện sử dụng vào công trình xây dựng phải tuân thủ theo quy định nào?', 'Theo đúng thiết kế xây dựng, chỉ dẫn kỹ thuật (nếu có) đã được phê duyệt', 'Bảo đảm chất lượng theo tiêu chuẩn, quy chuẩn kỹ thuật và pháp luật về chất lượng sản phẩm hàng hóa', 'Theo quy định tại cả đáp án a và b', 'Theo yêu cầu của chủ đầu tư', 3, '2022-03-28 19:38:40', '2022-03-28 19:38:40'),
(673, 1, 1, 'Trong quá trình thi công xây dựng công trình, chủ đầu tư có nghĩa vụ gì?', 'Phối hợp, tham gia với Ủy ban nhân dân các cấp thực hiện việc bồi thường thiệt hại, giải phóng mặt bằng xây dựng để bàn giao cho nhà thầu thi công xây dựng', 'Thuê tổ chức tư vấn có đủ năng lực hoạt động xây dựng để kiểm định chất lượng công trình khi cần thiết', 'Lưu trữ hồ sơ xây dựng công trình', 'Tất cả các nghĩa vụ nêu tại a, b và c', 4, '2022-03-28 19:39:11', '2022-03-28 19:39:11'),
(674, 1, 1, 'Nhà thầu thi công xây dựng có nghĩa vụ gì?', 'Chịu trách nhiệm về chất lượng, nguồn gốc của vật tư, nguyên liệu, vật liệu', 'Lập bản vẽ hoàn công, tham gia nghiệm thu công trình', 'Sử dụng vật liệu đúng chủng loại, bảo đảm yêu cầu theo thiết kế được duyệt', 'Tất cả các nghĩa vụ nêu tại a, b và c', 4, '2022-03-28 19:39:41', '2022-03-28 19:39:41'),
(675, 1, 1, 'Theo quy định của pháp luật về xây dựng có mấy cấp sự cố công trình xây dựng?', 'Một', 'Hai', 'Ba', 'Bốn', 3, '2022-03-28 19:40:08', '2022-03-28 19:40:08'),
(676, 1, 1, 'Trong thời gian thi công xây dựng, xảy ra sự cố công trình xây dựng thì thẩm quyền giải quyết sự cố thực hiện theo quy định nào?', 'Theo Luật Xây dựng 50/2014 và 62/2020', 'Theo Nghị định 06/2021/NĐ-CP', 'Theo Nghị định 10/2021/NĐ-CP', 'Theo các quy định tại điểm a, b và c', 2, '2022-03-28 19:40:31', '2022-03-28 19:40:31'),
(677, 1, 1, 'Việc điều chỉnh đơn giá thực hiện hợp đồng chỉ áp dụng đối với loại hợp đồng xây dựng nào?', 'Hợp đồng theo đơn giá điều chỉnh và hợp đồng theo thời gian', 'Hợp đồng trọn gói', 'Hợp đồng theo đơn giá cố định', 'Tất cả các loại hợp đồng nêu tại a, b và c', 1, '2022-03-28 19:41:00', '2022-03-28 19:41:00'),
(678, 1, 1, 'Ai có trách nhiệm lập và trình chủ đầu tư chấp thuận kế hoạch tổng hợp về an toàn lao động trước khi khởi công xây dựng công trình?', 'Ban quản lý dự án đầu tư xây dựng', 'Nhà thầu thi công xây dựng công trình', 'Nhà thầu tư vấn giám sát thi công xây dựng công trình', 'Không có quy định ai phải thực hiện', 2, '2022-03-28 19:41:25', '2022-03-28 19:41:25'),
(679, 1, 1, 'Theo quy định của pháp luật về xây dựng, kiểm định viên thực hiện kiểm định kỹ thuật an toàn lao động phải được huấn luyện, bồi dưỡng và sát hạch được phân thành mấy nhóm?', 'Hai', 'Ba', 'Bốn', 'Năm', 3, '2022-03-28 19:41:51', '2022-03-28 19:41:51'),
(680, 1, 1, 'Trên cơ sở đảm bảo phù hợp trình tự, thủ tục theo quy định của pháp luật về đất đai, việc bồi thường, hỗ trợ, tái định cư được thực hiện tại giai đoạn nào của dự án?', 'Tại giai đoạn chuẩn bị dự án', 'Tại giai đoạn thực hiện dự án', 'Đáp án a hoặc đáp án b', 'Tại giai đoạn kết thúc xây dựng', 3, '2022-03-28 19:42:18', '2022-03-28 19:42:18'),
(681, 1, 1, 'Hai phương án (A và B) của 1 dự án có tuổi thọ và vốn đầu tư như nhau.\r\nPhương án A sẽ được chọn vì - Tìm câu trả lời chưa chính xác trong các phương án sau:', 'Thời gian hoàn vốn của A nhanh hơn của B', 'NPV của A lớn hơn của B', 'Chi phí vận hành hàng năm của A nhỏ hơn B', 'IRRA > IRRB > MARR', 3, '2022-03-28 19:43:23', '2022-03-28 19:43:23'),
(682, 1, 1, 'Có 2 phương án A và B với IRRB >IRRA >MARR, phương án được chọn là:', 'A', 'B', 'Chưa xác định', 'Cả A và B', 3, '2022-03-28 19:44:43', '2022-03-28 19:44:43'),
(683, 1, 1, 'Có 2 phương án A và B, vốn đầu tư ban đầu của B lớn hơn của A với IRRB>IRRA và IRRA<MARR thì phương án được chọn là:', 'A', 'B', 'Cả A và B đều bị loại', 'Chưa xác định', 4, '2022-03-28 19:45:18', '2022-03-28 19:45:18'),
(684, 1, 1, 'Có 2 phương án có số vốn ban đầu bỏ ra bằng nhau, thu nhập hoàn vốn hàng năm bằng nhau, khi đó:', 'Phương án có tuổi thọ dài hơn sẽ bị loại bỏ', 'Phương án có tuổi thọ dài hơn sẽ được chọn', 'Chưa xác định', 'Cả hai phương án đều bị loại bỏ', 3, '2022-03-28 19:45:43', '2022-03-28 19:45:43'),
(685, 1, 1, 'Trong phân tích kinh tế - xã hội của dự án đầu tư, thuế thu nhập doanh nghiệp:', 'Là một khoản do doanh nghiệp phải bỏ ra để nộp cho nhà nước nên phải tính vào dòng chi', 'Là một khoản mà Nhà nước và xã hội được hưởng từ doanh nghiệp nên được tính vào dòng thu', 'Không coi là chi phí cũng không được tính vào dòng thu', 'Không câu nào đúng', 2, '2022-03-28 19:46:09', '2022-03-28 19:46:09'),
(686, 1, 1, 'Đối với các dự án đầu tư phục vụ công cộng thì:', 'Phải đạt hiệu quả cao về mặt tài chính', 'Phải có hiệu quả về mặt kinh tế - xã hội', 'Phải đạt hiệu quả cả về tài chính và kinh tế - xã hội', 'Hoàn toàn không quan tâm đến hiệu quả về mặt tài chính', 2, '2022-03-28 19:46:36', '2022-03-28 19:46:36'),
(687, 1, 1, 'Một dự án có NPV = 0, vậy:', 'NFV > 0', 'NFV = 0', 'NFV < 0', 'Chưa xác định', 2, '2022-03-28 19:47:00', '2022-03-28 19:47:00'),
(688, 1, 1, 'Tìm câu trả lời sai\r\nChỉ tiêu NPV có nhược điểm là:', 'Phụ thuộc nhiều vào suất chiết khấu', 'Chưa nói lên được hiệu quả sử dụng của một đồng vốn', 'Không được sử dụng để lựa chọn các phương án/dự án loại bỏ nhau nếu tuổi thọ khác nhau', 'Phải xác định rõ ràng dòng thu chi của dự án', 3, '2022-03-28 19:47:29', '2022-03-28 19:47:29'),
(689, 1, 1, 'Nội dung nào sau đây không phải là tác dụng của dự án đầu tư:', 'Là một phương án sản xuất kinh doanh hàng năm của doanh nghiệp', 'Là cơ sở để xây dựng kế hoạch thực hiện đầu tư', 'Là cơ sở để thẩm định và quyết định tài trợ vốn', 'Là căn cứ đề nghị vay vốn, hưởng ưu đãi đầu tư', 1, '2022-03-28 19:47:57', '2022-03-28 19:47:57'),
(690, 1, 1, 'Một dự án đầu tư có 3 phương án thực hiện, khi đó mối quan hệ giữa 3 phương án sẽ là:', 'Phụ thuộc nhau', 'Độc lập với nhau', 'Loại trừ nhau', 'Bổ sung nhau', 3, '2022-03-28 19:48:18', '2022-03-28 19:48:18'),
(691, 2, 1, 'Vì sao phải có thiết kế cơ sở trong hồ sơ Báo cáo nghiên cứu khả thi:', 'Là cơ sở để quản lý dự án', 'Không phải là cơ sở để lập Tổng mức đầu tư', 'Là căn cứ để quyết định đầu tư xây dựng', 'Là cơ sở để tiến hành lập Dự toán xây dựng công trình', 3, '2022-03-28 19:48:51', '2022-03-28 19:48:51'),
(692, 1, 1, 'Tìm câu trả lời sai:\r\nDự án đầu tư có vai trò:', 'Là cơ sở để quyết định đầu tư xây dựng', 'Là cơ sở để bố trí kế hoạch vốn đầu tư', 'Là cơ sở đề điều chỉnh quy hoạch xây dựng', 'Là cơ sở để xây dựng kế hoạch thực hiện đầu tư', 3, '2022-03-28 19:49:21', '2022-03-28 19:49:21');
INSERT INTO `cauhois` (`idcauhoi`, `linhvuc`, `trangthai`, `cauhoi`, `dapan1`, `dapan2`, `dapan3`, `dapan4`, `dapandung`, `created_at`, `updated_at`) VALUES
(693, 1, 1, 'Tìm câu trả lời sai:\r\nDự án đầu tư có vai trò:', 'Là văn kiện cơ bản để người có thẩm quyền quyết định đầu tư xây dựng', 'Là một bộ phận trong hợp đồng giữa chủ đầu tư và nhà thầu thi công xây dựng', 'Là căn cứ để theo dõi đánh giá và điều chỉnh những tồn đọng, vướng mắc trong quá trình thực hiện và khai thác dự án', 'Có tác dụng tích cực để giải quyết những vấn đề nảy sinh trong quan hệ giữa các bên liên quan', 2, '2022-03-28 19:49:51', '2022-03-28 19:49:51'),
(694, 1, 1, 'Tìm câu trả lời sai \r\nSuất thu lời nội tại IRR là:', 'Khả năng cho lãi của dự án', 'Lãi suất vay vốn đầu tư', 'Nếu dùng nó làm suất chiết khấu thì NPV=0', 'Là lãi suất cao nhất có thể vay vốn để đầu tư mà không bị lỗ', 2, '2022-03-28 19:50:16', '2022-03-28 19:50:16'),
(695, 1, 1, 'Tìm câu trả lời sai\r\nPhân tích kinh tế - xã hội nhằm mục đích:', 'Đảm bảo cho lợi ích của chủ đầu tư không trái với lợi ích của Nhà nước và xã hội', 'Thuyết phục cơ quan có thẩm quyền chấp nhận dự án', 'Tìm đối tác liên doanh', 'Tranh thủ sự ủng hộ của nhân dân và chính quyền địa phương', 3, '2022-03-28 19:50:44', '2022-03-28 19:50:44'),
(696, 1, 1, 'Doanh nghiệp thường chọn dự án có thời gian hoàn vốn ngắn để:', 'Giảm rủi ro', 'Giảm ứ đọng vốn', 'Tăng tốc độ luân chuyển vốn', 'Tất cả các ý trên', 4, '2022-03-28 19:51:09', '2022-03-28 19:51:09'),
(697, 1, 1, 'Lựa chọn câu đúng nhất. Dự án có độ nhạy cao là:', 'Dự án có độ rủi ro cao', 'Dự án có các chỉ tiêu hiệu quả thay đổi nhiều khi các yếu tố liên quan đến chúng thay đổi', 'Dự án có các yếu tố đầu vào dễ thay đổi', 'Dự án có các yếu tố đầu vào ít thay đổi', 2, '2022-03-28 19:51:33', '2022-03-28 19:51:33'),
(698, 1, 1, 'Vai trò của đầu tư:', 'Thúc đẩy tăng trưởng kinh tế', 'Tăng cường khả năng công nghệ của đất nước', 'Tác động chuyển dịch cơ cáu kinh tế', 'Tất cả các ý trên', 4, '2022-03-28 19:51:56', '2022-03-28 19:51:56'),
(699, 1, 1, 'Dự án đầu tư là một tập hồ sơ tài liệu trình bày một cách chi tiết một hoạt động đầu tư nhằm:', 'Đạt được mục tiêu của chủ đầu tư', 'Đạt mục tiêu lợi nhuận', 'Tránh lãng phí', 'Tránh đầu tư dàn trải', 1, '2022-03-28 19:52:19', '2022-03-28 19:52:19'),
(700, 1, 1, 'Dự án đầu tư do:', 'Chủ đầu tư hoặc tư vấn do Chủ đầu tư thuê lập', 'Nhà thầu thi công xây dựng lập', 'Cơ quan cho vay vốn lập', 'Người có thẩm quyền quyết định đầu tư lập', 1, '2022-03-28 19:52:45', '2022-03-28 19:52:45'),
(701, 1, 1, 'Chủ nhiệm lập dự án phải là người:', 'Có trình độ quản lý tốt', 'Có trình độ tổng hợp về kinh tế - kỹ thuật', 'Có kinh nghiệm lập dự án, có uy tín và đạo đức nghề nghiệp', 'Tất cả các ý trên', 4, '2022-03-28 19:53:05', '2022-03-28 19:53:05'),
(702, 1, 1, 'Trong phân tích tài chính dự án đầu tư các dòng thu chi phải xét đến giá trị thời gian của tiền là vì:', 'Do tiền có giá trị thời gian', 'Thời gian xây dựng và khai thác dài', 'Các khoản thu, chi của dự án phát sinh tại các thời điểm khác nhau', 'Tất cả các ý trên', 4, '2022-03-28 19:53:29', '2022-03-28 19:53:29'),
(703, 1, 1, 'Suất thu lời nội tại IRR là lãi suất mà nếu dùng nó làm suất chiết khấu thì:', 'NPV>0', 'NPV=0', 'NPV<0', 'Không liên quan đến NPV', 2, '2022-03-28 19:54:00', '2022-03-28 19:54:00'),
(704, 1, 1, 'Suất thu lời nội tại IRR là:', 'Khả năng cho lãi của dự án', 'Suất chiết khấu của dự án', 'Chi phí sử dụng vốn của dự án', 'Không câu nào đúng', 1, '2022-03-28 19:54:22', '2022-03-28 19:54:22'),
(705, 1, 1, 'Phân tích tài chính là việc đánh giá dự án trên góc độ của:', 'Chủ đầu tư', 'Nhà thầu', 'Nhà nước', 'Tổ chức cho vay vốn', 1, '2022-03-28 19:54:49', '2022-03-28 19:54:49'),
(706, 1, 1, 'Phân tích kinh tế - xã hội được tiến hành đứng trên góc độ lợi ích của:', 'Chủ đầu tư', 'Toàn bộ nền kinh tế', 'Tổ chức cho vay vốn', 'Tổ chức tài trợ', 2, '2022-03-28 19:55:23', '2022-03-28 19:55:23'),
(707, 1, 1, 'Tất cả các dự án đều phải:', 'Thẩm định cả về phương diện hiệu quả tài chính và hiệu quả kinh tế - xã hội', 'Đối với các dự án do doanh nghiệp đầu tư thì chỉ cần quan tâm đến hiệu quả tài chính', 'Đối với các dự án do Nhà nước đầu tư thì chỉ cần quan tâm đến hiệu quả kinh tế - xã hội', 'Không câu nào đúng', 1, '2022-03-28 19:55:44', '2022-03-28 19:55:44'),
(708, 1, 1, 'Mức độ chính xác của giá sản phẩm xây dựng phụ thuộc vào:', 'Mức độ chi tiết, chính xác của thiết kế', 'Mức độ chính xác của giá cả các yếu tố đầu vào', 'Năng lực của các kỹ sư', 'Tất cả các ý trên', 4, '2022-03-28 19:56:09', '2022-03-28 19:56:09'),
(709, 1, 1, 'Mục đích của việc kiểm soát chi phí là:', 'Đảm bảo cho chi phí hiện tại không được vượt quá tầm kiểm soát', 'Đảm bảo cho các chi phí trong tương lai không được vượt quá tầm kiểm soát', 'Cả ý a và b', 'Đảm bảo chi phí thực hiện đúng như với ngân sách đã lập ra ban đầu', 3, '2022-03-28 19:56:40', '2022-03-28 19:56:40'),
(710, 1, 1, 'Định mức dự toán xây dựng công trình gồm:', 'Thành phần công việc và định mức các thành phần hao phí', 'Thành phần công việc và phương pháp tính toán', 'Định mức các thành phần hao phí và phương pháp tính toán', 'Định mức các thành phần hao phí, phương pháp tính toán và thành phần công việc', 1, '2022-03-28 19:57:07', '2022-03-28 19:57:07'),
(711, 1, 1, 'Để dự án đầu tư xây dựng đạt hiệu quả cao thì cần phải quản lý tốt các khâu nào?', 'Quản lý chất lượng xây dựng, an toàn trong quá trình thi công xây dựng', 'Quản lý chi phí từ khâu lập, thẩm định, phê duyệt dự án; lập, thẩm định, phê duyệt thiết kế, dự toán', 'Quản lý tiến độ thi công xây dựng', 'Quản lý tất cả các khâu nêu tại Điểm a, b, c', 4, '2022-03-28 19:57:29', '2022-03-28 19:57:29'),
(712, 1, 1, 'Quy trình lựa chọn nhà thầu đối với đấu thầu rộng rãi, đấu thầu hạn chế được thực hiện như thế nào?', 'Chuẩn bị lựa chọn nhà thầu', 'Tổ chức lựa chọn nhà thầu', 'Đánh giá hồ sơ dự thầu, đàm phán và thương thảo ký kết hợp đồng', 'Bao gồm cả a, b và c', 4, '2022-03-28 19:58:36', '2022-03-28 19:58:36'),
(713, 1, 1, 'Việc thương thảo hợp đồng xây dựng phải dựa trên cơ sở sau đây?', 'Báo cáo đánh giá hồ sơ dự thầu của tổ chuyên gia', 'Mẫu hợp đồng đã điền đầy đủ các thông tin cụ thể của gói thầu', 'Các yêu cầu nêu trong hồ sơ mời thầu; Hồ sơ dự thầu và các tài liệu giải thích làm rõ hồ sơ dự thầu của nhà thầu (nếu có)', 'Tất cả các cơ sở nêu tại Điểm a, b, c', 4, '2022-03-28 20:53:21', '2022-03-28 20:53:21'),
(714, 1, 1, 'Thương thảo hợp đồng xây dựng gồm những nội dung gì?', 'Nhiệm vụ và phạm vi công việc chi tiết của nhà thầu tư vấn', 'Kế hoạch công tác và bố trí nhân sự', 'Tiến độ thực hiện gói thầu', 'Tất cả các nội dung nêu tại Điểm a, b, c', 4, '2022-03-28 20:54:16', '2022-03-28 20:54:16'),
(715, 1, 1, 'Công trường xây dựng phải đảm bảo các yêu cầu gì?', 'Tổng mặt bằng công trường xây dựng phải được thiết kế và phê duyệt, phù hợp với địa điểm xây dựng, điều kiện cụ thể của công trường', 'Vật tư, vật liệu phải được sắp xếp theo đúng thiết kế của tổng mặt bằng đã được phê duyệt', 'Phải có các biển báo về an toàn lao động cho người, máy thi công và các chỉ dẫn khác theo quy định', 'Tất cả các yêu cầu nêu tại Điểm a, b, c', 4, '2022-03-28 20:54:41', '2022-03-28 20:54:41'),
(716, 1, 1, 'Nội dung nào dưới đây phải được chỉ rõ trong hồ sơ tiến độ thi công xây dựng?', 'Thời gian, thời điểm, vị trí các công việc được thực hiện', 'Tên của các nhà thầu thi công', 'Quyết định đầu tư xây dựng', 'Tất cả các nội dung nêu tại Điểm a, b và c', 1, '2022-03-28 20:55:11', '2022-03-28 20:55:11'),
(717, 1, 1, 'Nội dung nào dưới đây phải được chỉ rõ trong hồ sơ tiến độ thi công xây dựng?', 'Quyết định đầu tư xây dựng', 'Nhiệm vụ và phạm vi công việc chi tiết của nhà thầu', 'Lao động, máy móc, thiết bị và các tài nguyên khác để đảm bảo thực hiện tiến độ', 'Tất cả các nội dung nêu tại Điểm a, b và c', 3, '2022-03-28 20:55:40', '2022-03-28 20:55:40'),
(718, 1, 1, 'Tiến độ thực hiện dự án đầu tư xây dựng phụ thuộc vào các yếu tố nào dưới đây?', 'Nhiệm vụ và phạm vi công việc chi tiết của nhà thầu', 'Tiến trình thực hiện các công việc phù hợp với giải pháp thực hiện đã lựa chọn, sử dụng hợp lý các nguồn lực và điều kiện kinh phí được cấp theo tiến độ của dự án', 'Tên của các nhà thầu', 'Tất cả các yếu tố nêu tại Điểm a, b, c', 2, '2022-03-28 20:56:07', '2022-03-28 20:56:07'),
(719, 1, 1, 'Tiến độ thực hiện dự án đầu tư xây dựng phụ thuộc vào các yếu tố nào dưới đây?', 'Tổng thời gian thực hiện và các mốc thời gian phải hoàn thành đối với từng công việc', 'Quyết định đầu tư xây dựng', 'Tổng mức đầu tư xây dựng', 'Phạm vi công việc chi tiết của nhà thầu', 1, '2022-03-28 20:56:31', '2022-03-28 20:56:31'),
(720, 1, 1, 'Những công tác nào phải được giám sát chặt chẽ trong quá trình thi công xây dựng công trình?', 'Chỉ những công tác quan trọng', 'Mọi công tác thi công xây dựng', 'Những công việc sau này bị che khuất do vật liệu khác lấp phủ', 'Những công tác ảnh hưởng đến việc thi công tiếp theo', 2, '2022-03-28 20:56:54', '2022-03-28 20:56:54'),
(721, 1, 1, 'Việc giám sát thi công xây dựng được thực hiện vào thời điểm nào?', 'Giám sát vào giờ hành chính', 'Chỉ cần giám sát các công tác chủ yếu, quan trọng', 'Khi nào trên công trường diễn ra các hoạt động xây dựng', 'Khi sắp nghiệm thu công tác xây dựng thì cần giám sát', 3, '2022-03-28 20:57:25', '2022-03-28 20:57:25'),
(722, 1, 1, 'Những yêu cầu nào đối với công tác giám sát trong quá trình thi công xây dựng công trình?', 'Giám sát thi công đúng thiết kế được phê duyệt, đúng tiêu chuẩn, quy chuẩn áp dụng, quy định về quản lý, sử dụng vật liệu xây dựng, chỉ dẫn kỹ thuật và hợp đồng xây dựng', 'Giám sát theo đúng ý kiến của bên thiết kế', 'Giám sát theo lệnh ghi trong giấy giao việc của chủ đầu tư', 'Giám sát theo hướng dẫn của chuyên gia', 1, '2022-03-28 20:57:52', '2022-03-28 20:57:52'),
(723, 1, 1, 'Nhà thầu phải lập, trình chủ đầu tư chấp thuận kế hoạch tổng hợp về an toàn lao động khi nào?', 'Trước khi khởi công xây dựng công trình', 'Theo tiến độ thực hiện hợp đồng', 'Trước khi thi công công việc quan trọng của công trình', 'Không bắt buộc phải lập và trình chủ đầu tư', 1, '2022-03-28 20:58:16', '2022-03-28 20:58:16'),
(724, 1, 1, 'Khi phát hiện nguy cơ xảy ra tai nạn lao động, sự cố mất an toàn lao động, người quản lý dự án phải làm gì?', 'Dừng thi công xây dựng', 'Yêu cầu nhà thầu có biện pháp khắc phục đảm bảo an toàn', 'Chỉ được tiếp tục thi công sau khi người quản lý dự án kiểm tra, chấp thuận đảm bảo an toàn', 'Phải thực hiện các công việc nêu tại Điểm a, b, c', 4, '2022-03-28 20:58:43', '2022-03-28 20:58:43'),
(725, 1, 1, 'Chủ đầu tư có trách nhiệm gì trong quản lý về an toàn lao động trong quá trình thi công xây dựng công trình?', 'Giám sát việc thực hiện của nhà thầu tuân thủ các biện pháp thi công và biện pháp đảm bảo an toàn đã được phê duyệt', 'Giám sát tuân thủ các quy phạm kỹ thuật an toàn trong thi công xây dựng', 'Kiểm tra, xử lý vi phạm, dừng thi công và yêu cầu khắc phục khi nhà thầu vi phạm các quy định về an toàn trên công trường', 'Tất cả các trách nhiệm nêu tại Điểm a, b, c', 4, '2022-03-28 20:59:14', '2022-03-28 20:59:14'),
(726, 1, 1, 'Nội dung công việc nào dưới đây thuộc trách nhiệm về quản lý an toàn lao động trong quá trình thi công xây dựng của chủ đầu tư?', 'Giám sát việc thực hiện của nhà thầu tuân thủ các biện pháp thi công và biện pháp đảm bảo an toàn đã được phê duyệt', 'Nghiệm thu khối lượng thi công xây dựng', 'Kiểm tra chất lượng các hạng mục thi công xây dựng', 'Tất cả các trách nhiệm nêu tại Điểm a, b, c', 1, '2022-03-28 20:59:47', '2022-03-28 20:59:47'),
(727, 1, 1, 'Mua bảo hiểm trong hoạt động xây dựng là một hình thức kiểm soát phòng ngừa rủi ro theo cách thức nào?', 'Né tránh rủi ro', 'Chuyển dịch rủi ro theo hợp đồng', 'Chuyển dịch rủi ro', 'Chấp nhận rủi ro', 2, '2022-03-28 21:00:20', '2022-03-28 21:00:20'),
(728, 1, 1, 'Trong suất vốn đầu tư do Bộ Xây dựng công bố:', 'Chưa bao gồm thuế giá trị gia tăng', 'Đã bao gồm thuế giá trị gia tăng', 'Chưa bao gồm thuế giá trị gia tăng và chi phí dự phòng', 'Chưa bao gồm thuế giá trị gia tăng và chi phí dự phòng', 2, '2022-03-28 21:00:47', '2022-03-28 21:00:47'),
(729, 1, 1, 'Chi phí chung trong chi phí xây dựng gồm những chi phí nào sau đây:', 'Chi phí quản lý doanh nghiệp', 'Chi phí điều hành sản xuất tại công trường, chi phí phục vụ công nhân', 'Chi phí phục vụ thi công tại công trường và một số chi phí phục vụ cho quản lý khác của doanh nghiệp', 'Tất cả các mục trên', 4, '2022-03-28 21:01:19', '2022-03-28 21:01:19'),
(730, 1, 1, 'Đơn giá xây dựng chi tiết của công trình không được xác định trên cơ sở nào sau đây?', 'Định mức xây dựng', 'Giá vật tư, vật liệu, cấu kiện xây dựng', 'Định mức chi phí tư vấn xây dựng', 'Giá nhân công, giá ca máy và thiết bị thi công', 3, '2022-03-28 21:01:46', '2022-03-28 21:01:46'),
(731, 1, 1, 'Giá xây dựng tổng hợp bộ phận kết cấu công trình do Bộ Xây dựng công bố là:', 'Bao gồm toàn bộ chi phí cần thiết để hoàn thành một đơn vị khối lượng nhóm, loại công tác xây dựng, đơn vị kết cấu hoặc bộ phận công trình xây dựng', 'Là tổng mức đầu tư dự án', 'Chưa bao gồm thuế giá trị gia tăng', 'Phương án a và b', 1, '2022-03-28 21:02:14', '2022-03-28 21:02:14'),
(732, 1, 1, 'Đơn vị nào sau đây chịu trách nhiệm về giá trị đề nghị thanh toán trong hồ sơ đề nghị thanh toán?', 'Chủ đầu tư hoặc đại diện hợp pháp của chủ đầu tư', 'Cơ quan thanh toán vốn đầu tư', 'Chủ đầu tư và cơ quan thanh toán vốn đầu tư', 'Đơn vị tư vấn lập hồ sơ thanh toán', 1, '2022-03-28 21:02:37', '2022-03-28 21:02:37'),
(733, 1, 1, 'Nội dung nào sau đây là sai quy định về chi phí tư vấn đầu tư xây dựng đã được phê duyệt?', 'Là chi phí tối đa để thực hiện công tác tư vấn đầu tư xây dựng', 'Được điều chỉnh khi có thay đổi về đơn giá xây dựng được công bố', 'Được quản lý thông qua hợp đồng tư vấn xây dựng', 'Được điều chỉnh khi thay đổi về phạm vi công việc, điều kiện và tiến độ thực hiện công tác tư vấn đầu tư xây dựng', 2, '2022-03-28 21:03:02', '2022-03-28 21:03:02'),
(734, 1, 1, 'Các yếu tố nào ảnh hưởng trực tiếp đến quá trình quản lý dự án đầu tư xây dựng?', 'Yếu tố con người lãnh đạo và quản lý', 'Yếu tố xây dựng, thực hiện kế hoạch và chế độ kiểm soát, báo cáo quá trình thực hiện', 'Phân định rõ trách nhiệm và mối quan hệ giữa các bên tham gia quản lý và thực hiện dự án', 'Tất cả các yếu tố nêu tại Điểm a, b, c', 4, '2022-03-28 21:03:26', '2022-03-28 21:03:26'),
(735, 1, 1, 'Nội dung nào dưới đây không phải là nguồn lực chính để làm căn cứ cho việc lập tiến độ thi công xây dựng?', 'Lực lượng lao động của nhà thầu', 'Vật liệu chính cung cấp cho từng giai đoạn thi công xây dựng', 'Nhân lực của Ban quản lý dự án', 'Xe-máy, thiết bị thi công cho từng công việc và tổng hợp cho từng giai đoạn', 3, '2022-03-28 21:03:52', '2022-03-28 21:03:52'),
(736, 1, 1, 'Kế hoạch tổng hợp về an toàn lao động đã được chủ đầu tư chấp thuận có được điều chỉnh trong quá trình thi công không?', 'Có, nếu kiểm tra thấy kế hoạch đã được lập không đảm bảo an toàn', 'Có, do nhà thầu quyết định nếu thấy cần thiết', 'Có, do chủ đầu tư quyết định nếu thấy cần thiết', 'Không được điều chỉnh', 1, '2022-03-28 21:04:18', '2022-03-28 21:05:06'),
(737, 1, 1, 'Vì sao chi phí dự phòng đối với dự án đầu tư xây dựng quy mô lớn và phức tạp thường cao hơn các dự án khác?', 'Do nhiều cơ quan có liên quan nên có nhiều yêu cầu mới đặt ra khiến phải thay đổi thiết kế trong quá trình thực hiện để đáp ứng, từ đó chi phí phát sinh tăng lên', 'Do thời gian thực hiện dự án đầu tư xây dựng quy mô lớn và phức tạp thường dài hơn nên rủi ro nhiều hơn', 'Do sử dụng nhiều chủng loại vật liệu và máy móc thiết bị hơn', 'Tất cả các ý trên đều đúng', 2, '2022-03-28 21:05:54', '2022-03-28 21:05:54'),
(738, 1, 1, 'Phân tích nào sau đây là phân tích độ nhạy?', 'Đánh giá sự thay đổi của NPV khi giá nguyên vật liệu đầu vào của dự án có một số thay đổi (tăng, giảm)', 'Đánh giá sự thay đổi của IRR khi giá bán sản phẩm của dự án có một số thay đổi (tăng, giảm)', 'Đánh giá sự thay đổi của NPV khi giá nguyên vật liệu đầu vào và giá bán sản phẩm dự án cùng thay đổi (tăng, giảm)', 'Tất cả các phương án trên', 4, '2022-03-28 21:06:31', '2022-03-28 21:06:31'),
(739, 1, 1, 'Chủ đầu tư tổ chức thực hiện quản lý dự án theo cách nào sau đây là đúng?', 'Chủ đầu tư sử dụng tư cách pháp nhân của mình và bộ máy chuyên môn trực thuộc có đủ điều kiện, năng lực', 'Chủ đầu tư thuê tổ chức, cá nhân có đủ điều kiện năng lực theo quy định để quản lý dự án', 'Thực hiện theo cách a hoặc b là đúng', 'Phải thuê ban quản lý dự án chuyên ngành hoặc ban quản lý dự án khu vực', 3, '2022-03-28 21:06:57', '2022-03-28 21:06:57'),
(740, 1, 1, 'Vốn vay ngắn hạn ngân hàng của dự án là để:', 'Bổ sung vốn lưu động cho dự án', 'Bổ sung vốn cố định cho dự án', 'Mua cổ phiếu của dự án', 'Mua máy móc thiết bị nâng cấp công nghệ cho dự án', 1, '2022-03-28 21:07:22', '2022-03-28 21:07:22'),
(741, 1, 1, 'Nội dung nào sau đây là đúng quy định về hồ sơ đề nghị cấp giấy phép xây dựng?', 'Các văn bản, giấy tờ, bản vẽ thiết kế trong hồ sơ đề nghị cấp phép xây dựng là bản chính hoặc bản sao có chứng thực hoặc bản sao điện tử', 'Toàn bộ tài liệu trong hồ sơ đề nghị cấp phép xây dựng phải là bản gốc hoặc chính', 'Các quyết định phải là bản chính, các tài liệu khác trong hồ sơ đề nghị cấp phép xây dựng là bản sao điện tử', 'Các nội dung trên đều đúng', 1, '2022-03-28 21:07:45', '2022-03-28 21:07:45'),
(742, 1, 1, 'Tiến độ thực hiện của dự án không thể hiện theo sơ đồ nào dưới đây?', 'Sơ đồ ngang', 'Sơ đồ đứng', 'Sơ đồ xiên', 'Sơ đồ mạng', 2, '2022-03-28 21:08:17', '2022-04-16 01:57:36'),
(743, 1, 1, 'Trong các chỉ tiêu sau, chỉ tiêu nào là giá xây dựng tổng hợp bộ phận kết cấu công trình?', '300 triệu đồng/ dầm bê tông cốt thép dự ứng lực mác 40Mpa, dầm l, dài 18m', '54 triệu đồng/cháu mẫu giáo khi quy mô đầu tư xây dựng nhà trẻ 75 < số cháu ≤ 125', 'Cả hai phương án a và b', 'Không có chỉ tiêu nào là giá xây dựng tổng hợp bộ phận kết cấu công trình', 1, '2022-03-28 21:08:48', '2022-03-28 21:08:48'),
(744, 1, 1, 'Trong quá trình quản lý thực hiện dự án, phát hiện thấy tem hiệu chuẩn của thiết bị thí nghiệm - thử nghiệm đã hết hiệu lực thì giám đốc quản lý dự án xử lý thế nào?', 'Không có ý kiến gì, vì thiết bị đã được kiểm tra trước khi chấp thuận cho phòng thí nghiệm hoạt động của dự án', 'Tiếp tục cho làm thí nghiệm, yêu cầu kiểm tra hiệu chuẩn bổ sung', 'Đình chỉ thí nghiệm, yêu cầu phòng thí nghiệm mời đơn vị có chức năng đến kiểm tra, hiệu chỉnh lại', 'Không có xử lý gì vì các phép thử trước đây cũng đã tiến hành trên chính thiết bị ấy', 3, '2022-03-28 21:09:19', '2022-03-28 21:09:19'),
(745, 1, 1, 'Nghiệm thu thang máy điện và thang máy thủy lực đủ điều kiện vận hành an toàn phải thực hiện theo trình tự nào dưới đây?', 'Thử động ở 100% tải định mức - Thử động ở 125% tải định mức - Kiểm tra tổng thể', 'Thử động ở 125% tải định mức - Thử động ở 100% tải định mức - Kiểm tra tổng thể', 'Kiểm tra tổng thể - Thử động ở 100% tải định mức - Thử động ở 125% tải định mức', 'Kiểm tra tổng thể - Thử động ở 125% tải định mức - Thử động ở 100% tải định mức', 3, '2022-03-28 21:09:45', '2022-03-28 21:09:45'),
(746, 1, 1, 'Nghiệm thu chạy thử không tải thiết bị công nghệ để làm gì?', 'Đánh giá chất lượng lắp đặt', 'Đánh giá tình trạng thiết bị khi chạy không tải', 'Phát hiện và loại trừ sai sót', 'Cả ba phương án a, b và c', 4, '2022-03-28 21:10:09', '2022-03-28 21:10:09'),
(747, 1, 1, 'Nghiệm thu chạy thử không tải chỉ được đánh giá là đạt khi nào?', 'Đã chạy thử liên tục theo quy định', 'Thông số dây chuyền phù hợp với thiết kế và công nghệ', 'Không xảy ra sự cố kỹ thuật đáng kể', 'Cả ba yếu tố nêu tại a, b và c', 4, '2022-03-28 21:12:54', '2022-03-28 21:12:54'),
(748, 1, 1, 'Việc phê duyệt thiết kế xây dựng triển khai sau thiết kế cơ sở của chủ đầu tư được thể hiện tại quyết định phê duyệt, gồm các nội dung chủ yếu nào sau đây?', 'Người phê duyệt; Tên công trình hoặc bộ phận công trình', 'Tên dự án; Loại và cấp công trình', 'Địa điểm xây dựng; Thời hạn sử dụng theo thiết kế của công trình', 'Bao gồm tất cả các nội dung ở trên', 4, '2022-03-28 21:13:24', '2022-03-28 21:13:24'),
(749, 1, 1, 'Ban quản lý dự án chuyên ngành, Ban quản lý dự án khu vực được thực hiện tư vấn quản lý dự án cho các dự án khác hoặc thực hiện một số công việc tư vấn trong trường hợp nào sau đây?', 'Bảo đảm hoàn thành nhiệm vụ quản lý dự án được giao và đáp ứng yêu cầu về điều kiện năng lực theo quy định khi thực hiện công việc tư vấn', 'Bảo đảm hoàn thành nhiệm vụ quản lý dự án được giao, không cần xét đến điều kiện năng lực khi thực hiện công tác tư vấn', 'Khi có chủ đầu tư thuê và không cần phải xét đến điều kiện năng lực của tổ chức cũng như cá nhân thực hiện', 'Đáp ứng một trong các trường hợp ở trên', 1, '2022-03-28 21:13:45', '2022-03-28 21:13:45'),
(750, 1, 1, 'Trong quá trình triển khai thực hiện dự án, việc kiểm tra thực hiện tiến độ các công việc bằng cách nào?', 'Kiểm tra kết quả thực hiện so với tiến độ chi tiết đã được chủ đầu tư phê duyệt', 'Kiểm tra thường xuyên qua báo cáo, thống kê', 'Kiểm tra đột xuất trên sơ đồ tiến độ tại thời điểm kiểm tra (tính theo tỷ lệ thực hiện)', 'Tất cả các cách nêu tại điểm a, b, c', 4, '2022-03-28 21:14:14', '2022-03-28 21:14:14'),
(751, 1, 1, 'Bộ phận điều hành dự án của chủ đầu tư có trách nhiệm gì trong quản lý về an toàn lao động trong quá trình thi công xây dựng công trình?', 'Giám sát việc thực hiện của nhà thầu tuân thủ các biện pháp thi công và biện pháp đảm bảo an toàn đã được phê duyệt', 'Giám sát tuân thủ các quy phạm kỹ thuật an toàn trong thi công xây dựng', 'Kiểm tra, báo cáo chủ đầu tư xử lý vi phạm, dừng thi công và yêu cầu khắc phục khi nhà thầu vi phạm các quy định về an toàn trên công trường', 'Tất cả các trách nhiệm nêu tại điểm a, b, c', 4, '2022-03-28 21:14:40', '2022-03-28 21:14:40'),
(752, 1, 1, 'Khi nào cần phải tiến hành quan trắc biến dạng (lún, chuyển dịch ngang) trong thi công xây dựng công trình?', 'Trong toàn bộ quá trình xây dựng', 'Khi có quy định trong thiết kế được duyệt', 'Khi Tư vấn giám sát yêu cầu', 'Khi công trình có sự cố', 1, '2022-03-28 21:15:01', '2022-03-28 21:15:01'),
(753, 1, 1, 'Thang máy điện nào bắt buộc phải có giấy chứng nhận hợp quy?', 'Thang máy PCCC', 'Thang máy tải hàng và băng ca', 'Thang máy tải khách', 'Các thang máy tại cả 3 phương án a, b và c', 4, '2022-03-28 21:15:33', '2022-03-28 21:15:33'),
(754, 1, 1, 'Nghiệm thu thiết bị công nghệ gồm các nội dung nào dưới đây?', 'Nghiệm thu tĩnh', 'Nghiệm thu chạy thử không tải', 'Nghiệm thu chạy thử có tải', 'Thực hiện cả ba nội dung trên', 4, '2022-03-28 21:16:01', '2022-03-28 21:16:01'),
(755, 1, 1, 'Trong tiến độ thi công xây dựng phải thể hiện rõ những nội dung gì?', 'Thời gian, thời điểm, vị trí các công việc được thực hiện', 'Chi phí tiền vốn', 'Sử dụng lao động, máy móc, thiết bị và các tài nguyên khác để đảm bảo thực hiện tiến độ', 'Tất cả các nội dung nêu tại điểm a, b và c', 4, '2022-03-28 21:16:26', '2022-03-28 21:16:26'),
(756, 1, 1, 'Việc khai báo, điều tra, báo cáo và giải quyết sự cố mất an toàn lao động trong thi công xây dựng công trình được thực hiện theo quy định nào?', 'Luật Xây dựng năm 2014 và Luật sửa đổi, bổ sung một số điều của Luật Xây dựng năm 2020', 'Nghị định 06/2021/NĐ-CP về quản lý chất lượng, thi công xây dựng và bảo trì công trình xây dựng', 'Luật An toàn, Vệ sinh lao động và các văn bản hướng dẫn', 'Các văn bản quy định tại điểm a, b, c', 4, '2022-03-28 21:16:48', '2022-03-28 21:16:48'),
(757, 1, 1, 'Để chuẩn bị cho công tác hoàn thiện cần phải thực hiện những công tác gì?', 'Phải thi công xong các việc làm dưới lớp hoàn thiện như điện, nước', 'Phải lập biên bản nghiệm thu đảm bảo điều kiện để thi công hoàn thiện', 'Phải chỉnh độ cao các lớp nằm dưới lớp hoàn thiện', 'Phải lập biên bản cho các việc đã làm xong', 2, '2022-03-28 21:17:11', '2022-03-28 21:17:11'),
(758, 1, 1, 'Đo bóc khối lượng xây dựng từ bản vẽ thiết kế kỹ thuật, thiết kế bản vẽ thi công để làm gì?', 'Xác định dự toán, lập bảng khối lượng trong hồ sơ mời thầu', 'Xác định giá gói thầu, giá dự thầu', 'Xác định giá hợp đồng, trường hợp chỉ định thầu, xác định giá thanh toán trong trường hợp chỉ định thầu và phương thức hợp đồng trọn gói', 'Tất cả các phương án a, b và c', 4, '2022-03-28 21:17:31', '2022-03-28 21:17:31'),
(759, 1, 1, 'Các chi phí nào sau đây không được đưa vào quyết toán hợp đồng xây dựng?', 'Các chi phí thiệt hại xảy ra trong quá trình đầu tư xây dựng thuộc trách nhiệm của bảo hiểm', 'Chi phí cho khối lượng hoàn thành của các cấu kiện đúc sẵn', 'Chi phí thiệt hại do nguyên nhân bất khả kháng theo quy định của pháp luật', 'Tất cả các phương án trên', 1, '2022-03-28 21:18:05', '2022-03-28 21:18:05'),
(760, 1, 1, 'Các chi phí nào sau đây không được đưa vào quyết toán hợp đồng xây dựng?', 'Các chi phí phát sinh do điều chỉnh thiết kế xây dựng', 'Các chi phí của các khối lượng phá đi làm lại do lỗi của nhà thầu', 'Chi phí thiệt hại do nguyên nhân bất khả kháng theo quy định của pháp luật', 'Tất cả các phương án trên', 2, '2022-03-28 21:18:37', '2022-03-28 21:18:37'),
(761, 1, 1, 'Thành phần cấp phối của bê tông được xác định bằng phương pháp nào trước khi thi công xây dựng?', 'Dựa trên loại, cấp bê tông được quy định trong thiết kế', 'Dựa trên cơ sở thiết kế công thức trộn', 'Dựa trên thí nghiệm trong phòng với vật liệu dự kiến sẽ sử dụng', 'Thực hiện tất cả các bước nêu tại phương án a, b và c', 4, '2022-03-28 21:19:00', '2022-03-28 21:19:00'),
(762, 1, 1, 'Công tác giám sát lắp đặt thiết bị công nghệ bao gồm các nội dung nào dưới đây?', 'Giám sát trước lắp đặt', 'Giám sát quá trình lắp đặt', 'Giám sát quá trình thử nghiệm và nghiệm thu', 'Cả ba nội dung nêu tại a, b và c', 4, '2022-03-28 21:19:27', '2022-03-28 21:19:27'),
